INSERT INTO `cms_article` VALUES ('74077', '61888', '比特币会成为法定货币吗？', '', null, '/userfiles/1/_thumbs/images/cms/article/2017/11/1b4384a08564b2752646e7525940425f.jpg', '比特币', '一般来说，货币有四大职能，分别是价值计量、支付结算、流通手段和价值贮藏。其中，比特币在改善支付和流通手段方面最有可为。事实上，改善支付手段都未必需要比特币，支付宝和微信支付这些第三方支付都可以做得更好。', '0', null, '0', '', null, null, '1', '2017-11-10 18:24:20', '1', '2017-11-16 19:55:20', null, '0');
INSERT INTO `cms_article` VALUES ('74079', '61888', '比特币，它究竟是不是货币？为何一路走高？', '', null, '/userfiles/1/_thumbs/images/cms/article/2017/11/3ed995c10f7b122b10094772190590be(1).jpg', '比特币交易', '近期比特币的走势可谓是气势如虹、扶摇直上，但是央行货币金银局官网发布《关于冒用人民银行名义发行或推广数字货币的风险提示》。央行提示称，尚未发行法定数字货币，也未授权任何机构和企业发行法定数字货币，无推广团队。目前市场上所谓&ldquo;数字货币&rdquo;均非法定数字货币。', '0', null, '0', '', null, null, '1', '2017-11-10 18:24:48', '1', '2017-11-16 19:51:54', null, '0');
INSERT INTO `cms_article` VALUES ('74082', '61888', '什么是比特币？比特币究竟为什么值钱？', '', null, '/userfiles/1/_thumbs/images/cms/article/2017/11/7.png', '比特币', '什么是比特币？比特币究竟为什么值钱？什么是比特币？比特币究竟为什么值钱？', '0', null, '0', '', null, null, '1', '2017-11-10 18:25:17', '1', '2017-11-13 17:29:38', null, '1');
INSERT INTO `cms_article` VALUES ('74092', '61888', '为何比特币会暴涨暴跌？究竟该怎么理解？', '', null, '/userfiles/1/_thumbs/images/cms/article/2017/11/25b1a8658d26f33e6d3c1621fa35652f.jpg', '比特币', '有了对比特币内在价值的认知，我们再来分析其价格的波动。一般来说，一国货币的价格（也就是我们常说的汇率）由该国货币的购买力所决定，当国家的经济水平，财政情况稳定的时候，汇率相对也比较稳定，很少出现暴涨暴跌的情况。', '0', null, '0', '', null, null, '1', '2017-11-11 18:28:36', '1', '2017-11-16 19:53:51', null, '0');
INSERT INTO `cms_article` VALUES ('74098', '74095', '做用户放心的数字资产生产平台', '', null, '/userfiles/1/_thumbs/images/cms/article/2017/11/6.png', '公司简介', '聚算宝（www.hke1688.com）数字资产综合服务平台，由锦晖区块链科技有限公司负责运营。平台依托多年专业金融背景，基于区块链、互联网、大数据风控和云计算等技术，立志引领区块链技术创新，推动区块链产业发展，为全球用户提供更安全、更专业、更用心的数字资产综合服务。\r\n核心团队由超过百位长期从事金融、互联网、区块链研发的资深专家组成，全面系统的风控体系，专业的资金管理方式，', '0', null, '0', '', null, null, '1', '2017-11-28 09:58:46', '1', '2017-12-06 11:51:56', null, '0');
INSERT INTO `cms_article` VALUES ('74102', '74095', '11', '', null, '', '比特币', '的萨芬撒反对', '0', null, '0', '', null, null, '1', '2017-11-10 10:09:19', '1', '2017-11-10 10:09:19', null, '1');
INSERT INTO `cms_article` VALUES ('74128', '61888', '区块链的概念是什么？具体它是起到什么作用？', '', null, '/userfiles/1/_thumbs/images/cms/article/2017/11/006.jpg', '比特币新闻', '区块链实际上就是一串不同为正常人们所用的数字解码程序。通过下那个数据块或是数据解码程序，帮助整个网络当中的信息进行存储，但是不同的是这种数据块是一种即时存储，并不是只是专注于一个系统服务器进行储存信息。', '0', null, '0', '', null, null, '1', '2017-11-11 14:54:19', '1', '2017-11-16 19:52:57', null, '0');
INSERT INTO `cms_article` VALUES ('74130', '61888', '数字货币的发展前景如何？', '', null, '/userfiles/1/_thumbs/images/cms/article/2017/11/e244cb247e983fd67317d0a74655b869.jpg', '比特币投资', '相信随着网络的电子商务不断的发展，已经出现了各种各样的电子货币。但是这些电子话费的使用范围很小，并且能够做到的事情有些都是电子货币，都是只是仅限于某一个平台上的一些物品交换你或者是购买一些服务。却不能够囊括生活的各个方面。', '0', null, '0', '', null, null, '1', '2017-11-11 14:54:24', '1', '2017-11-16 19:53:09', null, '0');
