INSERT INTO `cms_article` VALUES ('74138', '61888', '比特币下跌，虚拟货币大跌背后的深层逻辑是什么？', '', null, '/userfiles/1/_thumbs/images/cms/article/2017/11/007.jpg', '比特币交易', '数字货币的出现从某种程度上说明以互联网技术为主要驱动力的外部势力正在深度影响并改变着当前业已形成的金融秩序。改造并不能一蹴而就，金融领域市场行情的变化更是喜怒无常。因此，我们看到了虚拟货币市场跌宕起伏的一些变化。', '0', null, '0', '', null, null, '1', '2017-11-11 14:56:11', '1', '2017-11-16 19:52:43', null, '0');
INSERT INTO `cms_article` VALUES ('74140', '61888', '比特币挖矿赚钱吗？投资比特币挖矿主要有哪些风险', '', null, '/userfiles/1/_thumbs/images/cms/article/2017/11/005.jpeg', '比特币投资', '比特币挖矿和养猪是一样的，猪肉市场需求一直在，比特币市场也非常大，挖出来的币不愁卖不出去。养猪需要搭建猪舍，买饲料，照顾猪，矿机要矿场，要吃电，要你各种照顾。猪肉价格一样波动，养猪也有同行竞争，比特币也一样。养猪有赚钱的，也有赔钱的，挖比特币也一样。', '0', null, '0', '', null, null, '1', '2017-11-11 14:56:17', '1', '2017-11-16 19:53:38', null, '0');
