INSERT INTO `cms_article` VALUES ('74199', '61893', '测试公告', '', null, '', '公告', '核心团队由超过百位长期从事金融、互联网、区块链研发的资深专家组成，全面系统的风控体系，专业的资金管理方式，7*24小时无间断交易的技术支持，为平台持续提供稳定、安全、便捷的服务保障。\r\n58BTC放眼未来全国布局，分别在北京、上海和四川设立分公司，业务领域包括：矿场矿池、云算力服务、数字资产钱包、在线交易平台、区块链技术应用等。', '0', null, '0', '', null, null, '1', '2017-11-13 11:07:56', '1', '2017-11-13 17:30:17', null, '1');
INSERT INTO `cms_article` VALUES ('74255', '61893', '关于58BTC矿场11月10日断网及恢复公告', '', null, '', '断网恢复公告', '尊敬的客户：\r\n由于主干网络光纤中断，导致全面断网（包括生活区），58BTC矿场于2017年11月10日12:10左右停止运行，经过连夜抢修，已于2017年11月11日1:00恢复运行。备用网络解决方案正在搭建中，以确保今后场地网络正常。打币比例届时将参考真实算力统计发放。\r\n感谢您的支持与理解！', '0', null, '0', '', null, null, '1', '2017-11-13 22:34:09', '1', '2017-11-13 22:36:04', null, '1');
