INSERT INTO `cms_article` VALUES ('74323', '61888', '什么是比特币？比特币究竟为什么值钱？', '', null, '/userfiles/1/_thumbs/images/cms/article/2017/11/fdedb8e84c58bae69c7bc18d47f5fac2.jpg', '比特币交易', '比特币通过去中心化的技术来进行&ldquo;记账&rdquo;，其特点是不可修改（维护比特币系统的节点分布在世界各地，如果需要修改过往数据，那么需要战胜51%节点的算力，国家几乎无此资源），此外比特币的所有交易信息均透明可查询，也就极大程度保护了交易的&ldquo;信任&rdquo;。', '0', null, '0', '', null, null, '1', '2017-11-23 21:42:23', '1', '2017-11-16 19:52:24', null, '0');
INSERT INTO `cms_article` VALUES ('74326', '61888', '比特币是怎么产出的？', '', null, '/userfiles/1/_thumbs/images/cms/article/2017/11/3ed995c10f7b122b10094772190590be.jpg', '比特币投资', '有人说那这样比特币不就会越来越多，最后完全没有价值了吗？中本聪当然也想到这个问题，这里比特币系统还有一个机制：那就是比特币具有总量有限，前4年总额将产生10500000BTC，每隔4年产出数额减半，在第4年至第8年会产生5250000BTC，第8至12年则只有2625000BTC，如此类推。到最后，总共产生的比特币数量为接近21000000BTC。', '0', null, '0', '', null, null, '1', '2017-11-15 15:06:06', '1', '2017-11-16 19:55:07', null, '0');
