INSERT INTO `cms_article` VALUES ('74883', '61888', '比特币期货在芝加哥期货交易所首秀：暴涨逾3000美元 两次触发熔断！', '', null, '', '比特币期货 芝加哥期货交易所 熔断', '比特币期货在芝加哥期货交易所首秀：暴涨逾3000美元 两次触发熔断！', '0', null, '0', '', null, null, '1', '2017-12-11 14:22:11', '1', '2017-12-11 14:22:11', null, '0');
INSERT INTO `cms_article_data` VALUES ('74077', '<h1 class=\"tac f30 col333\" style=\"outline: none; margin: 0px; padding: 55px 0px 40px; font-weight: normal; font-size: 30px; font-family: Arial, Helvetica, \'Microsoft YaHei\'; white-space: normal; text-align: center !important;\">\r\n	比特币会成为法定货币吗？</h1>\r\n<p>\r\n	<span class=\"tac f14 col9c time\" style=\"outline: none; display: block; padding-bottom: 40px; font-family: Arial, Helvetica, \'Microsoft YaHei\'; white-space: normal; text-align: center !important; color: rgb(156, 156, 156) !important;\">时间：2017-06-29</span></p>\r\n<div class=\"text\" style=\"outline: none; overflow: hidden; padding-bottom: 80px; color: rgb(85, 85, 85); font-family: Arial, Helvetica, \'Microsoft YaHei\'; white-space: normal;\">\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em;\">\r\n		&nbsp;</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em;\">\r\n		一般来说，货币有四大职能，分别是价值计量、支付结算、流通手段和价值贮藏。其中，比特币在改善支付和流通手段方面最有可为。事实上，改善支付手段都未必需要比特币，支付宝和微信支付这些第三方支付都可以做得更好。</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em; text-align: center;\">\r\n		<img alt=\"比特币会成为法定货币吗？\" border=\"0\" height=\"300\" src=\"http://www.58btc.com/uploads/images/1b4384a08564b2752646e7525940425f.jpg\" style=\"outline: none; border-style: none; border-width: initial; vertical-align: top; width: 508px; height: 300px;\" title=\"比特币会成为法定货币吗？\" vspace=\"0\" width=\"508\" /></p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em;\">\r\n		不过，比特币不能解决价值计量问题。表面上看，比特币的供应量和生产都由算法决定，似乎可以通过算法来确认比特币的价值。问题是，算法是无穷的，如何确认不同算法生产出来的这些币的不同价值呢？</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em;\">\r\n		比特币也不能解决价值贮藏问题。作为天选之子，比特币综合了各种成功必需的因素，包括那个最要命的运气。这里面最重要的因素是拥护比特币的人们对其可能成为未来法定货币的想象共同体。但是，如果有一天这个想象共同体不存在了呢？那么比特币很可能像曾经的&ldquo;郁金香热&rdquo;里那些郁金香一样。甚至还不如郁金香，因为郁金香不具有金融投机属性以后，至少还有作为花的使用价值。</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em;\">\r\n		比特币宣称要去中心化，不需要权威机构来管理比特币。嗯，这样的想法渗透着自由和民主的血液。但是，自由和民主并不是绝对的，绝对的自由其实并不自由，而绝对的民主也并不民主。试想一下，像左右货币供应量这样大的利益，如果真的没有中心，会不会出现霍布斯在《利维坦》中所论述的那样，当自然状态出现时，出现一切人对一切人的战争？</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em;\">\r\n		比特币一直强调由算法决定供应量，没有政府和银行来发行比特币，持有比特币就可以免于货币政策的影响。这种由于货币超发导致的货币贬值，确实是信用货币体系下一个问题，而且影响人们生活的各个方面。大家希望手里的货币不要贬值，这种理想可以理解，但是希望持有的货币不受货币政策影响，这样的想法是有问题的。</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em;\">\r\n		在人类的发展历程中，从实物货币到信用货币，货币的作用是逐步变大的。所以，在现今信用货币体系下，货币政策的作用不仅是调节货币供应量，还有一个重要作用是管理预期。</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em;\">\r\n		为什么要管理预期？因为世界是不确定的，尤其在现代商业社会，参与经济活动的人数空前巨大，使得不确定性更加突出。在如何应对经济不确定性方面，人类发明了一个伟大的工具，就是预期管理。再看比特币，确定性是其一个重要的特点。所谓成也萧何，败也萧何。确定的供应量是比特币吸引人的一个重要特点，也是阻止比特币成为未来法定数字货币的绊脚石。因为，确定的货币供应量，无法用来管理预期。当然了，比特币也许本来就没打算管理预期，甚至就没有管理这个事。</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em;\">\r\n		虽然现在有不少国家的央行成立专门机构研究法定数字货币，可以预见，在当前的商业经济环境下，在现行的货币理论体系下，比特币不会成为未来法定数字货币。不过，如果区块链和比特币改变了货币的理论体系和市场规则，也许有不同的结果。</p>\r\n</div>\r\n<p>\r\n	&nbsp;</p>', '', '', '1');
INSERT INTO `cms_article_data` VALUES ('74079', '<h1 class=\"tac f30 col333\" style=\"outline: none; margin: 0px; padding: 55px 0px 40px; font-weight: normal; font-size: 30px; font-family: Arial, Helvetica, \'Microsoft YaHei\'; white-space: normal; text-align: center !important;\">\r\n	比特币，它究竟是不是货币？为何一路走高？</h1>\r\n<p>\r\n	<span class=\"tac f14 col9c time\" style=\"outline: none; display: block; padding-bottom: 40px; font-family: Arial, Helvetica, \'Microsoft YaHei\'; white-space: normal; text-align: center !important; color: rgb(156, 156, 156) !important;\">时间：2017-06-29</span></p>\r\n<div class=\"text\" style=\"outline: none; overflow: hidden; padding-bottom: 80px; color: rgb(85, 85, 85); font-family: Arial, Helvetica, \'Microsoft YaHei\'; white-space: normal;\">\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em;\">\r\n		&nbsp;</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em;\">\r\n		近期比特币的走势可谓是气势如虹、扶摇直上，但是央行货币金银局官网发布《关于冒用人民银行名义发行或推广数字货币的风险提示》。央行提示称，尚未发行法定数字货币，也未授权任何机构和企业发行法定数字货币，无推广团队。目前市场上所谓&ldquo;数字货币&rdquo;均非法定数字货币。</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em; text-align: center;\">\r\n		<img alt=\"比特币，它究竟是不是货币？为何一路走高？\" border=\"0\" height=\"295\" src=\"http://www.58btc.com/uploads/images/3ed995c10f7b122b10094772190590be.jpg\" style=\"outline: none; border-style: none; border-width: initial; vertical-align: top; width: 490px; height: 295px;\" title=\"比特币，它究竟是不是货币？为何一路走高？\" vspace=\"0\" width=\"490\" /></p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em;\">\r\n		目前市面上交易的数字货币中，比特币、莱特币、以太币等资产市值靠前，市场认可度稍高。今年5月中旬，最具代表性的数字货币&mdash;&mdash;比特币，国内交易价格破万元，而那时，正值央行等监管部门进驻国内各大比特币交易平台近4个月，这一始于年初的检查工作是要求各交易平台不得违反国家有关反洗钱、外汇管理和支付结算等金融法律法规，而间隔不足一个月，时间还未走完6月上旬，比特币又破了两万元，走势真是让人震撼。</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em;\">\r\n		不单单是中国央行不认为其实货币，在其他很多大国的央行也是一样看法。但也有不少国家认可其支付能力，<strong style=\"outline: none;\">那么，它究竟是不是货币？</strong></p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em;\">\r\n		按照经典教科书的定义，货币是固定充当一般等价物的特殊商品，同时，它应该具备价值尺度、流通收单、支付手段、储藏手段和世界货币五大基本职能。现实是，无论现在已经有多少国家允许交易中使用比特币，但其普及的范围仍然有限，尤其这一支付要基于网络设备等软硬件支持。在最近勒索病毒事件中，其制造者宣称要以比特币为支付手段，这令不少人错愕，禁不住要问&ldquo;比特币是什么玩意儿，宝宝没有啊&rdquo;。显然，这一要求进一步凸显比特币的匿名性和虚拟性，便于隐藏和跨境流通，其距离&ldquo;固定充当一般等价物&rdquo;成为&ldquo;货币&rdquo;还有距离。</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em;\">\r\n		可是，交易火爆看得人眼热，它是投资品吗？对这一问题，业界似乎仍有分歧。作为一个合法交易品种，比特币拥有与黄金类似的稀缺属性，总量固定，因此将之作为投资品是有升值空间的；但另一方面，被业界视为风险偏好较高的对冲基金经理人大多对比特币采取敬而远之的态度。鉴于比特币类数字货币交易价格的大幅起落，很多投资经历也表明，投身其中还是需要一颗坚实的心脏。</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em;\">\r\n		但无论如何，基于区块链技术产生的比特币将更高层次的数字货币带进人们的视野。正如工银国际研究部主管、首席经济学家程实所说，比特币突然出现和快速崛起的真正意义，是让人们在危机混乱中看清国际货币体系改革的方向：加强货币发行的内在约束、削弱霸权货币的体系影响、尊重微观群体的货币权力、满足信息时代的货币需求、体现平等多元的货币精神。</p>\r\n</div>\r\n<p>\r\n	&nbsp;</p>', '', '', '1');
INSERT INTO `cms_article_data` VALUES ('74082', '<h1 class=\"tac f30 col333\" style=\"outline: none; margin: 0px; padding: 55px 0px 40px; font-weight: normal; font-size: 30px; font-family: Arial, Helvetica, \'Microsoft YaHei\'; white-space: normal; text-align: center !important;\">\r\n	什么是比特币？比特币究竟为什么值钱？</h1>\r\n<p>\r\n	<span class=\"tac f14 col9c time\" style=\"outline: none; display: block; padding-bottom: 40px; font-family: Arial, Helvetica, \'Microsoft YaHei\'; white-space: normal; text-align: center !important; color: rgb(156, 156, 156) !important;\">时间：2017-06-29</span></p>\r\n<div class=\"text\" style=\"outline: none; overflow: hidden; padding-bottom: 80px; color: rgb(85, 85, 85); font-family: Arial, Helvetica, \'Microsoft YaHei\'; white-space: normal;\">\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em;\">\r\n		&nbsp;</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em; text-align: center;\">\r\n		<strong style=\"outline: none;\"><img alt=\"什么是比特币？比特币究竟为什么值钱？\" border=\"0\" height=\"332\" src=\"http://www.58btc.com/uploads/images/fdedb8e84c58bae69c7bc18d47f5fac2.jpg\" style=\"outline: none; border-style: none; border-width: initial; vertical-align: top; width: 500px; height: 332px;\" title=\"什么是比特币？比特币究竟为什么值钱？\" vspace=\"0\" width=\"500\" /></strong></p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em;\">\r\n		<strong style=\"outline: none;\">比特币的4重含义：</strong></p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em;\">\r\n		第一个被证明的区块链应用；</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em;\">\r\n		区块链是什么？解释起来有些繁琐，我将在以后的文章中专门解释，暂且大家理解成&ldquo;账本&rdquo;。</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em;\">\r\n		运用去中心化维护的世界银行；</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em;\">\r\n		比如，我们在互联网上进行转账，我将10元通过工行转账给A君，那么将由工行来负责&ldquo;记账&rdquo;，将我的账户减10元，将A君账户增加10元，这个过程就是中心化的过程，工行就是中心，中心将各个节点（用户）连在一起，节点无法离开中心。</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em;\">\r\n		去中心化的世界银行意味着，我将10元转给A君直接跨越了工行，直接点对点进行了价值传递。</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em;\">\r\n		一种货币；</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em;\">\r\n		去中心化世界银行的股票。</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em;\">\r\n		<strong style=\"outline: none;\">比特币为什么值钱？</strong></p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em;\">\r\n		通过上述介绍，比特币相当于是去中心化世界银行的&ldquo;股票&rdquo;，如果这个去中心化的世界银行可以造福人类，有目前其他银行不具备的优势，被社会所极力认可，并且不断渗入社会，那么他的&ldquo;股价&rdquo;（币值）势必会不断提升。</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em;\">\r\n		<strong style=\"outline: none;\">比特币有哪些目前银行所不具备的优势呢？</strong></p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em;\">\r\n		<strong style=\"outline: none;\">信任&amp;价值传递！</strong></p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em;\">\r\n		目前互联网金融日新月异，但是大家回忆下10年前的互联网，没有支付，没有网络购物，只有新闻、QQ，单机游戏。。。是什么改变了这一切？</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em;\">\r\n		是第三方平台！比如财付通，支付宝。第三方平台解决了线上大众的信任问题由此可以让大家安心去购物付款、转账，进行价值传递。</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em;\">\r\n		但是第三方平台有巨大的隐患。</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em;\">\r\n		<strong style=\"outline: none;\">数据安全</strong></p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em;\">\r\n		目前在互联网上的交易其实是信用交易，都是通过平台&ldquo;记账&rdquo;方式来运行，也就是说，一旦对方数据库受损，&ldquo;账本&rdquo;遗失，你的线上资产，交易记录，都将有巨大的风险。</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em;\">\r\n		<strong style=\"outline: none;\">繁重佣金&amp;效率</strong></p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em;\">\r\n		因为线上的交易需要通过中心化的公司来&ldquo;记账&rdquo;，比如你通过工行转账10万给国外，那么需要工行与国外的银行进行对账核算，不但会产生高额的手续费更是会有&ldquo;到账时间&rdquo;约束。</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em;\">\r\n		<strong style=\"outline: none;\">比特币可以统统解决这一切</strong></p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em;\">\r\n		<strong style=\"outline: none;\">100%信任</strong></p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em;\">\r\n		比特币通过去中心化的技术来进行&ldquo;记账&rdquo;，其特点是不可修改（维护比特币系统的节点分布在世界各地，如果需要修改过往数据，那么需要战胜51%节点的算力，国家几乎无此资源），此外比特币的所有交易信息均透明可查询，也就极大程度保护了交易的&ldquo;信任&rdquo;。</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em;\">\r\n		<strong style=\"outline: none;\">极低佣金的价值传递</strong></p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em;\">\r\n		因为比特币去中心化的特质，决定了可以点对点进行交易，而不是点-中心-中心-点，可以极大提升效率并且节省手续费。</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em;\">\r\n		如上，正是比特币被越来越多人、公司、科研领域所看好的原因，也就造就了其飞速成长的币值。</p>\r\n</div>\r\n<p>\r\n	&nbsp;</p>', '', '', '1');
INSERT INTO `cms_article_data` VALUES ('74092', '<h1 class=\"tac f30 col333\" style=\"outline: none; margin: 0px; padding: 55px 0px 40px; font-weight: normal; font-size: 30px; text-align: center !important;\">\r\n	为何比特币会暴涨暴跌？究竟该怎么理解？</h1>\r\n<p>\r\n	<span class=\"tac f14 col9c time\" style=\"outline: none; display: block; padding-bottom: 40px; text-align: center !important; color: rgb(156, 156, 156) !important;\">时间：2017-06-28</span></p>\r\n<div class=\"text\" style=\"outline: none; overflow: hidden; padding-bottom: 80px;\">\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em; color: rgb(85, 85, 85); font-family: Arial, Helvetica, \'Microsoft YaHei\'; line-height: 21px; white-space: normal;\">\r\n		&nbsp;</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em; color: rgb(85, 85, 85); font-family: Arial, Helvetica, \'Microsoft YaHei\'; line-height: 21px; white-space: normal;\">\r\n		有了对比特币内在价值的认知，我们再来分析其价格的波动。一般来说，一国货币的价格（也就是我们常说的汇率）由该国货币的购买力所决定，当国家的经济水平，财政情况稳定的时候，汇率相对也比较稳定，很少出现暴涨暴跌的情况。</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em; color: rgb(85, 85, 85); font-family: Arial, Helvetica, \'Microsoft YaHei\'; line-height: 21px; white-space: normal; text-align: center;\">\r\n		<img alt=\"为何比特币会暴涨暴跌？究竟该怎么理解？\" border=\"0\" height=\"351\" src=\"http://www.58btc.com/uploads/images/25b1a8658d26f33e6d3c1621fa35652f.jpg\" style=\"outline: none; border-style: none; border-width: initial; vertical-align: top; width: 501px; height: 351px;\" title=\"为何比特币会暴涨暴跌？究竟该怎么理解？\" vspace=\"0\" width=\"501\" /></p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em; color: rgb(85, 85, 85); font-family: Arial, Helvetica, \'Microsoft YaHei\'; line-height: 21px; white-space: normal;\">\r\n		反观比特币的价格，暴涨暴跌反而好像是常态。究其原因，主要是比特币虽然具备了&ldquo;成为更好货币的价值&rdquo;，但这种价值的实现有太多的不确定性，影响了大家对这个价值的判断，所以才会出现剧烈的波动。具体来说，有这样一些不确定性：</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em; color: rgb(85, 85, 85); font-family: Arial, Helvetica, \'Microsoft YaHei\'; line-height: 21px; white-space: normal;\">\r\n		1）技术风险。</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em; color: rgb(85, 85, 85); font-family: Arial, Helvetica, \'Microsoft YaHei\'; line-height: 21px; white-space: normal;\">\r\n		比如非对称加密算法有可能被破解、协议代码可能存在漏洞、某种方式的网络攻击可能使整个系统瘫痪、系统升级中可能出现技术问题等等。这些是比特币发展早期面临的主要风险，毕竟中本聪势单力孤，其编程技术也并不十分出色。随着更多人才的加入，代码不断更新，很多潜在的技术风险被消除，中本聪也宣布退出了核心开发团队。经过7年的运行，市值过百亿美元之后，比特币已经遭遇过无数次的攻击生存下来了。现在，存在重大技术风险而未被攻击的可能性已经非常小了。</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em; color: rgb(85, 85, 85); font-family: Arial, Helvetica, \'Microsoft YaHei\'; line-height: 21px; white-space: normal;\">\r\n		2）竞争风险。</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em; color: rgb(85, 85, 85); font-family: Arial, Helvetica, \'Microsoft YaHei\'; line-height: 21px; white-space: normal;\">\r\n		区块链技术，数字货币，这些技术大部分都是开源的。也就是说比特币的存在并非无可替代。实际上，目前已经有成千上万种的数字货币（例如最近更火的以太币）。这些数字货币的出现对比特币形成一定的竞争压力，可称为&ldquo;竞争币&rdquo;，理论上会对比特币的市场和价值形成威胁。不过，威胁最大的可能是央行正试图用区块链技术改造法币而形成的主权数字货币，其他国家也在尝试。</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em; color: rgb(85, 85, 85); font-family: Arial, Helvetica, \'Microsoft YaHei\'; line-height: 21px; white-space: normal;\">\r\n		3）政策风险。</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em; color: rgb(85, 85, 85); font-family: Arial, Helvetica, \'Microsoft YaHei\'; line-height: 21px; white-space: normal;\">\r\n		比特币成为货币将对现有货币运行、金融监管、货币政策等产生重大影响，会遇到传统货币金融体系的阻力，也会产生新的社会经济问题，产生新的政策管控问题。2014&ndash;2015年价格的持续下跌，很大程度上是受到国内相关政策的影响。尽管2013年以来，包括美国、中国、俄罗斯等国货币当局陆续由抵制转向逐步认同，但随着比特币逐渐进入主流经济，产生的摩擦将会更大，政策层面仍有很大的不确定性。</p>\r\n	<div>\r\n		&nbsp;</div>\r\n</div>\r\n<p>\r\n	&nbsp;</p>', '', '', '1');
