\">\r\n		<img src=\"http://www.hke1688.com:80//userfiles/1/images/cms/article/2017/12/kuan2.png\" style=\"vertical-align: top;\" /></dt>\r\n	<dd style=\"margin: 0px; padding: 0px;\">\r\n		矿机产币</dd>\r\n</dl>\r\n<dl style=\"margin: 0px; text-align: center; color: rgb(85, 85, 85); line-height: 24px; padding-right: 0px; padding-left: 0px; font-family: Arial, Helvetica, &quot;Microsoft YaHei&quot;; font-size: 16px; float: left; white-space: normal;\">\r\n	<dt style=\"margin: 0px; padding: 70px 0px 35px;\">\r\n		<img src=\"http://www.hke1688.com:80//userfiles/1/images/cms/article/2017/12/kuan3.png\" style=\"vertical-align: top;\" /></dt>\r\n	<dd style=\"margin: 0px; padding: 0px;\">\r\n		矿场环境</dd>\r\n</dl>\r\n<div class=\"box\" style=\"background: none; border-radius: 5px; border: 0px currentColor; color: rgb(85, 85, 85); line-height: 24px; padding-bottom: 0px; font-family: Arial, Helvetica, &quot;Microsoft YaHei&quot;; font-size: 16px; white-space: normal; box-shadow: 0px 0px 3px rgb(238,238,238);\">\r\n	<p style=\"margin: 0px; padding: 0px 0px 22px; text-indent: 2em;\">\r\n		&nbsp;</p>\r\n	&nbsp;\r\n	<p>\r\n		&nbsp;</p>\r\n	<p style=\"margin: 0px; padding: 0px 0px 22px; text-indent: 0em;\">\r\n		&nbsp;</p>\r\n	<h3 class=\"f30 bold\" style=\"margin: 0px; padding: 10px 63px 10px 0px; text-indent: 0em; overflow: hidden; font-size: 30px;\">\r\n		&nbsp;</h3>\r\n	<h3 class=\"f30 bold\" style=\"margin: 0px; padding: 10px 63px 10px 0px; text-indent: 0em; overflow: hidden; font-size: 30px;\">\r\n		联系我们：</h3>\r\n	<p style=\"margin: 0px; padding: 0px 0px 22px; text-indent: 0em;\">\r\n		&nbsp;</p>\r\n	<p style=\"margin: 0px; padding: 0px 0px 22px; text-indent: 0em;\">\r\n		公司地址：深圳市福田区福田街道滨河大道5022号联合广场A座18楼1812</p>\r\n	<p style=\"margin: 0px; padding: 0px 0px 22px; text-indent: 0em;\">\r\n		财富热线：4008093628&nbsp;&nbsp; 0755-82770917</p>\r\n</div>\r\n<p>\r\n	&nbsp;</p>', '', '', '1');
