INSERT INTO `cms_article_data` VALUES ('74128', '<h1 class=\"tac f30 col333\" style=\"outline: none; margin: 0px; padding: 55px 0px 40px; font-weight: normal; font-size: 30px; text-align: center !important;\">\r\n	区块链的概念是什么？具体它是起到什么作用？</h1>\r\n<p>\r\n	<span class=\"tac f14 col9c time\" style=\"outline: none; display: block; padding-bottom: 40px; text-align: center !important; color: rgb(156, 156, 156) !important;\">时间：2017-06-27</span></p>\r\n<div class=\"text\" style=\"outline: none; overflow: hidden; padding-bottom: 80px;\">\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em; color: rgb(85, 85, 85); font-family: Arial, Helvetica, &quot;Microsoft YaHei&quot;; white-space: normal;\">\r\n		&nbsp;</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em; color: rgb(85, 85, 85); font-family: Arial, Helvetica, &quot;Microsoft YaHei&quot;; white-space: normal;\">\r\n		在网络当中，木马病毒横行，已经有越来越多的公司和交易软件受到了这些黑客的攻击。而对于一些投资项目来说，网络病毒更是具有较大的威胁。</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em; color: rgb(85, 85, 85); font-family: Arial, Helvetica, &quot;Microsoft YaHei&quot;; white-space: normal; text-align: center;\">\r\n		<img alt=\"区块链的概念是什么？具体它是起到什么作用？\" border=\"0\" height=\"368\" src=\"http://www.58btc.com/uploads/images/0412775f44fde4481b80aa8dabc34ab5.jpg\" style=\"outline: none; border-width: initial; border-style: none; vertical-align: top; width: 574px; height: 368px;\" title=\"区块链的概念是什么？具体它是起到什么作用？\" vspace=\"0\" width=\"574\" /></p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em; color: rgb(85, 85, 85); font-family: Arial, Helvetica, &quot;Microsoft YaHei&quot;; white-space: normal;\">\r\n		当然，也随着网络科技的发展，已经有了一个数据块帮助投资者规避这一类型的投资风险，这个程序就是区块链。</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em; color: rgb(85, 85, 85); font-family: Arial, Helvetica, &quot;Microsoft YaHei&quot;; white-space: normal;\">\r\n		区块链实际上就是一串不同为正常人们所用的数字解码程序。通过下那个数据块或是数据解码程序，帮助整个网络当中的信息进行存储，但是不同的是这种数据块是一种即时存储，并不是只是专注于一个系统服务器进行储存信息。</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em; color: rgb(85, 85, 85); font-family: Arial, Helvetica, &quot;Microsoft YaHei&quot;; white-space: normal;\">\r\n		所以本身在一些并不是特别值得信任的服务器上进行存储，就不会威胁到客户信息的安全。</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em; color: rgb(85, 85, 85); font-family: Arial, Helvetica, &quot;Microsoft YaHei&quot;; white-space: normal;\">\r\n		区块链的技术最早是在2008年开始使用的。这种技术使得人们可以不通过固定的某一个服务器的方式进行储存数据的同时，能够向用户提供大批量的信息，通过数据解码的方式，让客户能够快速的在网络上看到自己的交易记录以及交易的成功与否，以及近一段时间的交易记录。</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em; color: rgb(85, 85, 85); font-family: Arial, Helvetica, &quot;Microsoft YaHei&quot;; white-space: normal;\">\r\n		因为本身数据的储存模式，就是不断跳跃，无规律可循，这也导致区块链上的数据很难被修改。也因为属于即时储存，过了一段时间就会转存到其他服务器之上，不会有过多的残留或者是交易信息和历史驻留，这使得整个比特币的交易更安全更保密。</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em; color: rgb(85, 85, 85); font-family: Arial, Helvetica, &quot;Microsoft YaHei&quot;; white-space: normal;\">\r\n		防止出现像其他网站被黑客攻击时所产生的数据乱码亦或者是交易的金额出现问题。保证数据安全的同时，也保证运营的稳定。也保证客户的资料安全和客户的金融安全。</p>\r\n	<div>\r\n		&nbsp;</div>\r\n</div>\r\n<p>\r\n	&nbsp;</p>', '', '', '1');
INSERT INTO `cms_article_data` VALUES ('74130', '<h1 class=\"tac f30 col333\" style=\"outline: none; margin: 0px; padding: 55px 0px 40px; font-weight: normal; font-size: 30px; text-align: center !important;\">\r\n	数字货币的发展前景如何？</h1>\r\n<p>\r\n	<span class=\"tac f14 col9c time\" style=\"outline: none; display: block; padding-bottom: 40px; text-align: center !important; color: rgb(156, 156, 156) !important;\">时间：2017-06-27</span></p>\r\n<div class=\"text\" style=\"outline: none; overflow: hidden; padding-bottom: 80px;\">\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em; color: rgb(85, 85, 85); font-family: Arial, Helvetica, &quot;Microsoft YaHei&quot;; white-space: normal;\">\r\n		&nbsp;</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em; color: rgb(85, 85, 85); font-family: Arial, Helvetica, &quot;Microsoft YaHei&quot;; white-space: normal;\">\r\n		相信随着网络的电子商务不断的发展，已经出现了各种各样的电子货币。但是这些电子话费的使用范围很小，并且能够做到的事情有些都是电子货币，都是只是仅限于某一个平台上的一些物品交换你或者是购买一些服务。却不能够囊括生活的各个方面。</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em; color: rgb(85, 85, 85); font-family: Arial, Helvetica, &quot;Microsoft YaHei&quot;; white-space: normal; text-align: center;\">\r\n		<img alt=\"数字货币的发展前景如何？\" border=\"0\" height=\"427\" src=\"http://www.58btc.com/uploads/images/e244cb247e983fd67317d0a74655b869.jpg\" style=\"outline: none; border-width: initial; border-style: none; vertical-align: top; width: 640px; height: 427px;\" title=\"数字货币的发展前景如何？\" vspace=\"0\" width=\"640\" /></p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em; color: rgb(85, 85, 85); font-family: Arial, Helvetica, &quot;Microsoft YaHei&quot;; white-space: normal;\">\r\n		而比特币不同，比特币能够做到的是所有电子货币的总和，与此同时，还能够做到一些电子货币所不能做到的事情，其中最典型的就是购买一些化妆品奢侈品，甚至购买房屋和汽车。</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em; color: rgb(85, 85, 85); font-family: Arial, Helvetica, &quot;Microsoft YaHei&quot;; white-space: normal;\">\r\n		但是不得不说，比特币作为数字货币的一种，还是需要一个合适的交易平台，而比特币交易平台主要进行的就是这种货币的交易工作。</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em; color: rgb(85, 85, 85); font-family: Arial, Helvetica, &quot;Microsoft YaHei&quot;; white-space: normal;\">\r\n		在比特币交易平台上可以使用数字货币购买任何你所能够想到的东西，服务亦或者是旁汽车和一些高档住宅，化妆品和奢侈品。可以说，在国外，比特币已经成为了一种新型的数字货币。</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em; color: rgb(85, 85, 85); font-family: Arial, Helvetica, &quot;Microsoft YaHei&quot;; white-space: normal;\">\r\n		与此同时，比特币交易平台还能够管理关于比特币的交易。能够通过一定量的现实货币来进行购买，购买数字货币并不是单单只是为了在网上购买东西，而是为了能够通过这些货币进行获利。</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em; color: rgb(85, 85, 85); font-family: Arial, Helvetica, &quot;Microsoft YaHei&quot;; white-space: normal;\">\r\n		因为随着比特币市场的不断发展，越来越多的比特币被购入，这种货币的市场价值也在不断攀升，这也就意味着比特币成为了证券当中类似外汇的一种投资项目。通过在比特币交易平台上不断的进行买入卖出来获得中间差价，通过积攒比特币和一些活动赚取比特币的方式为自己提供比特币的收入。</p>\r\n	<div>\r\n		&nbsp;</div>\r\n</div>\r\n<p>\r\n	&nbsp;</p>', '', '', '1');
