INSERT INTO `cms_article_data` VALUES ('74134', '<p>\r\n	123</p>', '', '', '1');
INSERT INTO `cms_article_data` VALUES ('74138', '<h1 class=\"tac f30 col333\" style=\"outline: none; margin: 0px; padding: 55px 0px 40px; font-weight: normal; font-size: 30px; font-family: Arial, Helvetica, &quot;Microsoft YaHei&quot;; white-space: normal; text-align: center !important;\">\r\n	比特币下跌，虚拟货币大跌背后的深层逻辑是什么？</h1>\r\n<p>\r\n	<span class=\"tac f14 col9c time\" style=\"outline: none; display: block; padding-bottom: 40px; font-family: Arial, Helvetica, &quot;Microsoft YaHei&quot;; white-space: normal; text-align: center !important; color: rgb(156, 156, 156) !important;\">时间：2017-06-28</span></p>\r\n<div class=\"text\" style=\"outline: none; overflow: hidden; padding-bottom: 80px; color: rgb(85, 85, 85); font-family: Arial, Helvetica, &quot;Microsoft YaHei&quot;; white-space: normal;\">\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em;\">\r\n		&nbsp;</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em;\">\r\n		数字货币的出现从某种程度上说明以互联网技术为主要驱动力的外部势力正在深度影响并改变着当前业已形成的金融秩序。改造并不能一蹴而就，金融领域市场行情的变化更是喜怒无常。因此，我们看到了虚拟货币市场跌宕起伏的一些变化。</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em; text-align: center;\">\r\n		<img alt=\"比特币下跌，虚拟货币大跌背后的深层逻辑是什么？\" border=\"0\" height=\"333\" src=\"http://www.58btc.com/uploads/images/db82fe6ee755c9a08624dbac195cb096.jpg\" style=\"outline: none; border-width: initial; border-style: none; vertical-align: top; width: 500px; height: 333px;\" title=\"比特币下跌，虚拟货币大跌背后的深层逻辑是什么？\" vspace=\"0\" width=\"500\" /></p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em;\">\r\n		尽管如此，我们依然不能否认互联网技术对于传统金融体系的冲击以及它们对于未来金融市场的积极影响和变化。因为从这些虚拟货币的产生和运作机制来看，它们大大提升了原有的以实体货币为主要交易标的的传统金融市场的效率，并大大节省了交易成本。</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em;\">\r\n		正是由于这些优势的出现，市场对于这些虚拟货币充满了信心，投机心理的增加让这些虚拟货币的成长超脱了原有的轨道。今年以来，以比特币为代表的虚拟货币就出现了一次较大规模的上涨。从4月1日以来，比特币的价格就上涨了两倍多，本月突破了3000美元。而以太币的价格今年更是一度上涨了40倍，从1月的8美元，升至6月的400美元。</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em;\">\r\n		虚拟货币的不断上涨一方面表现出市场对于这类新兴货币的热衷，更加彰显出整个市场对于这类货币未来发展的十足信心。那么，是不是当前的市场的确需要这么多的虚拟货币进行交易呢？显然不是。这轮虚拟货币价格的上涨主要是由于市场炒作造成的，对于虚拟货币的不断调高和拉升，不仅能够让外部市场对这类货币更加重视，而且能够从这种炒作当中获利。所以，无论是市场层面还是投资层面都会比较热衷看到虚拟货币市场出现这种情况。</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em;\">\r\n		从市场层面来看，虚拟货币市场的出现对于传统金融体系的影响是相对较为深远的。传统金融体系的交易标的主要是以纸质的货币为主，即使互联网技术对金融行业的交易方式和用户来源的获取方式都产生了影响，却依然没有改变基本标的为纸质货币的现实。而虚拟货币出现之后，这种以纸质货币为主要交易标的的情况得到了本质性的改变，通过数字货币的形式，我们依然能够实现交易，而且这种交易并不是基于传统金融机构的银行、证券等基础元素，而是通过互联网公司的形式来完成的。</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em;\">\r\n		相对于传统金融的壁垒深重以及行政色彩浓厚的特点，虚拟货币的市场化程度更高，交易的流程和环节更加简单和方便。通过虚拟货币，用户能够在互联网世界进行更加广泛，更加深入的交易，这种交易的方式真正超越了国界限制，并实现了真正意义上的金融交易效率的提升。</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em;\">\r\n		从这个角度来看，虚拟货币的出现对于金融市场的影响是非常深远的。因为它从根本上解决了金融交易当中的诸多壁垒，实现了金融元素运行的无缝、快速和直接。因此，从提升金融效率的角度来看，虚拟货币的火爆是市场层面深层次需求的外在表现，正是有了这种迫切的需求，才会让市场看到了这其中潜藏着的巨大的潜力，并愿意去推高或炒作这种货币。</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em;\">\r\n		从投资层面来讲，以传统金融体系为主要特征的投资方式在经过近百年的发展后，它的风控措施、监督手段、盈利模式已经相对较为成熟。在一个相对较为成熟的市场氛围当中，想要再次获得超乎寻常的高收益是一件非常艰难的事情。只有在一个新生的市场当中，在市场监管机制和法律都不太完善的情况下，投资者的获利空间才能更大。</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em;\">\r\n		因此，以比特币为代表的虚拟货币在今年以来出现了轮番上涨的情况。在这当中，或许市场投资者对于这种新型货币的炒作成分较高。其实，市场的表现也印证了虚拟货币此轮上涨背后的炒作味道。因为在过去两周的时间里，虚拟货币市场的价格一直在出现剧烈波动。风投资本家Fred Wilson周一在博客上写道：&ldquo;我的人认为我们将在加密货币领域遭遇一次抛售。&rdquo;他旗下的Union Square Partners几年前就开始在这一领域投资。Fred Wilson对于虚拟货币的抛售无疑是市场对于虚拟货币这种新型的货币形式操作心态的一种具体体现。</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em;\">\r\n		由于市场的抛售，最终让虚拟货币市场出现了很大的跌幅。其中，跌幅最大的是以太币，Coindesk的数据显示，这种虚拟货币价格一度大跌24%，至231美元。与此同时，比特币下跌7%，至2424美元。</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em;\">\r\n		为什么风投机构热衷于炒作虚拟货币呢？首先，就是因为虚拟货币的监管机制依然不太完善。因为虚拟货币是建构在网络空间上的存在，在相对较为成熟的网络衍生品的监管依然存在漏洞的今天，对于虚拟货币这种相对并不太成熟的网络衍生品的监管则更加漏洞百出，于是这就给很多风头机构有了很多可以直接参与投机的机会，同样让他们能够轻而易举地对虚拟货币的价格进行炒作。</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em;\">\r\n		其次，虚拟货币是建构在网络空间的一种存在，网络空间并不像现实空间一样，有国界和地域等方面的限制。整个网络空间就是虚拟货币的交易平台，在世界任何地方的投资者都能够在网络上面进行虚拟货币的交易。另外，在网络平台上进行虚拟货币的交易还不用支付高额的交易费用，这就让很多投资者更加热衷于炒作虚拟货币。</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em;\">\r\n		因此，从市场层面和投资者层面都可以看到虚拟货币正在成为一种越来越受欢迎的新型的货币形式，而随着互联网技术对于金融体系影响的逐步加剧，以虚拟货币为主要元素和基本标的的新金融时代的到来将会成为一种可能，并将会更加深入地影响到我们的生活。</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em;\">\r\n		以虚拟货币为主要交易标的的新金融时代的到来将会让金融真正变成一种生活方式。因为新金融时代的一个最为主要的特点就是货币数字化，而货币的数字化一个最为直接的体现就是我们日常生活的一些行为数据与货币数据能够实现无缝对接，并开始产生深度联系。正是基于这样一种原因，我们将来的生活可能是一种数字化的生活，而虚拟货币正是这个大数据生活当中的一部分。</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em;\">\r\n		尽管互联网技术改变了传统金融行业获取用户的方式，改变了用户的交易方式和消费习惯，并催生了P2P、众筹、网络信贷等新生事物的存在，并催生了以蚂蚁金服、京东众筹、聚米众筹、苏宁众筹为代表的诸多新生平台的产生，但是金融和其他行业之间并没有实现真正融通，它们之间依然存在着诸多壁垒。这些壁垒的存在让即将到来的大数据时代和智能时代始终都给人一种难以落地的感觉。</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em;\">\r\n		但是，金融则能够将看似并不相关的行业通过交易的形式联通起来，并最终打破两者之间的壁垒。如何联通呢？如果交易都是在两个行业端口来完成，并独立实现交易的话，这种联通是无法实现的。唯一一个方法就是将两个端口完成的交易进行数字化的处理，通过数字化的方式实现两个行业的联通，这样两个不相关的行业也有了联通的可能性，大数据所提出的融通和共享才有了实现的可能性。</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em;\">\r\n		正是因为这个原因，所以我们看到了以阿里、腾讯都在通过支付端口的布局来实现对于用户最终的支付端口的控制。阿里正在借助以淘宝、天猫为代表电商平台将不同行业的产品聚集在一起，在通过支付宝进行交易，将不同行业与金融行业最终联系在了一起；腾讯则借助它在社交领域的深耕，通过将人们在日常社交过程当中的行为进行金融化的处理，推出了红包、打赏等一系列社交相关的产品，同样与金融联系在了一起。</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em;\">\r\n		互联网巨头不断借助先发优势将不同行业与金融端口实现结合，从而保证了它们所打造了全闭环的产品流程。在一切行为和产品都在被数据化的当下，虚拟货币的出现无疑能够解决线下的现金货币与线上的数据交易无法真正实现对接的难题，通过将线下交易进行数据化处理，才能真正实现线上与线下全数据的交流，减少壁垒，真正实现大数据时代的到来。</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em;\">\r\n		结语</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em;\">\r\n		线上交易的数据化趋势正在愈加明显，金融的基本标的却依然是以纸质货币为主，线上与线下之间的壁垒变得愈加深重。只有将金融标的进行数据化的处理，才能打破线下和线上并不统一的现状，让金融与其他行业真正融为一体。虚拟货币的出现恰恰解决了这个难题，并彻底让货币告别了国界和地域的限制，实现了线上和线下交易效率的提升。</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em;\">\r\n		随着大数据时代的到来，虚拟货币在联通各行业的时候将会表现出更加独特的优势和力量，并通过金融的数字化真正将其与其他行业真正联系在一起。然而，值得注意的是，虚拟货币毕竟是一个新生事物，当代金融体系历经百年所建构的体系并不会被它在短短几十年的时间内瓦解。但是，虚拟货币取代现金货币的趋势将会不可避免，只是这种趋势的发展还将会遭遇诸多反复和重新推倒而已。</p>\r\n</div>\r\n<p>\r\n	&nbsp;</p>', '', '', '1');
INSERT INTO `cms_article_data` VALUES ('74140', '<h1 class=\"tac f30 col333\" style=\"outline: none; margin: 0px; padding: 55px 0px 40px; font-weight: normal; font-size: 30px; text-align: center !important;\">\r\n	比特币挖矿赚钱吗？投资比特币挖矿主要有哪些风险</h1>\r\n<p>\r\n	<span class=\"tac f14 col9c time\" style=\"outline: none; display: block; padding-bottom: 40px; text-align: center !important; color: rgb(156, 156, 156) !important;\">时间：2017-06-21</span></p>\r\n<div class=\"text\" style=\"outline: none; overflow: hidden; padding-bottom: 80px;\">\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em; color: rgb(85, 85, 85); font-family: Arial, Helvetica, &quot;Microsoft YaHei&quot;; white-space: normal;\">\r\n		&nbsp;</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em; color: rgb(85, 85, 85); font-family: Arial, Helvetica, &quot;Microsoft YaHei&quot;; white-space: normal;\">\r\n		我知道有很多人赚钱了。而且目前比特币行业里最赚钱的就是挖矿了。</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em; color: rgb(85, 85, 85); font-family: Arial, Helvetica, &quot;Microsoft YaHei&quot;; white-space: normal;\">\r\n		但我们不应该盲目自信，更不要赌博。我们投资一个项目的理由永远不能是：别人赚钱了。我们要清楚看到这项目里有什么风险。</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em; color: rgb(85, 85, 85); font-family: Arial, Helvetica, &quot;Microsoft YaHei&quot;; white-space: normal;\">\r\n		<strong style=\"outline: none;\">工程风险</strong></p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em; color: rgb(85, 85, 85); font-family: Arial, Helvetica, &quot;Microsoft YaHei&quot;; white-space: normal;\">\r\n		听到实体产业大家都会觉得很阳光，那就请正面对待比特币产业吧，因为比特币挖矿就是实体产业。做挖矿项目是要搞三通一平、要建厂房、要买机器、要配水配电通风、要工程师&hellip;&hellip;这尼玛不算实体还有什么算？</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em; color: rgb(85, 85, 85); font-family: Arial, Helvetica, &quot;Microsoft YaHei&quot;; white-space: normal;\">\r\n		先给大家看一张矿厂的图吧。</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em; color: rgb(85, 85, 85); font-family: Arial, Helvetica, &quot;Microsoft YaHei&quot;; white-space: normal;\">\r\n		<img alt=\"比特币挖矿赚钱吗？投资比特币挖矿主要有哪些风险\" border=\"0\" height=\"360\" src=\"http://www.58btc.com/uploads/images/f8c4e93619b9a5bb4a205d756dae847a.jpeg\" style=\"outline: none; border-width: initial; border-style: none; vertical-align: top; width: 640px; height: 360px;\" title=\"比特币挖矿赚钱吗？投资比特币挖矿主要有哪些风险\" vspace=\"0\" width=\"640\" /></p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em; color: rgb(85, 85, 85); font-family: Arial, Helvetica, &quot;Microsoft YaHei&quot;; white-space: normal;\">\r\n		图中的矿场是建设过程中的，你看线缆沟都还没有埋好，通风扇就随地摆放，机器也没有点亮。这里面的矿机离帮主人挖比特币我猜还得有三天上以的时间。</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em; color: rgb(85, 85, 85); font-family: Arial, Helvetica, &quot;Microsoft YaHei&quot;; white-space: normal;\">\r\n		要布这样的矿场，你就得懂工程上的知识。工程上需要应对的风险主要包括这么几类：</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em; color: rgb(85, 85, 85); font-family: Arial, Helvetica, &quot;Microsoft YaHei&quot;; white-space: normal;\">\r\n		1.控制采购成本。这可不单单是采购矿机的成本，还有货架、线缆、变压器、路由器、电源、线槽、各种型材、&hellip;&hellip;等等等，如果你拉一张明细表，这里面至少要100行，螺丝你就要准备好几十种，别小看这些小东西，任何一个零件的缺失或多买都会加大你的成本，甚至推迟你矿机上线时间。千万不要以为买好了矿机就完事了，真干起活来要买的东西多着呢。</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em; color: rgb(85, 85, 85); font-family: Arial, Helvetica, &quot;Microsoft YaHei&quot;; white-space: normal;\">\r\n		2.控制建造成本。矿机不是智能机器，这话的意思是不是你有意愿，你告诉矿机该怎么干活它就会给你干的。你想要让矿机帮你挖比特币，是要你去伺候它。你要搞一个厂房，这个厂房要做好防尘、防雨，还要通风防高温；你要在将矿机整齐摆放好，将线缆归置顺，接好电线、接好控制线、接好网线；你还要考虑检修&hellip;&hellip;等等等。你最好请个工程师帮你搞，电工最好要有高压证哦。你一定得有心里准备，矿机是少爷，你并不是老爷，你只是个丫头。</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em; color: rgb(85, 85, 85); font-family: Arial, Helvetica, &quot;Microsoft YaHei&quot;; white-space: normal;\">\r\n		3.控制环境风险。你还得考虑环境因素，矿机不是零排放设备，这玩意会制造大量的噪音和热量。这样你就不得不考虑运营工人的身心健康，你也要考虑周边居民的关系。你要敢在小区里建一个有点规模的矿场，邻居肯定给你拆了，除非你是地方一霸。</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em; color: rgb(85, 85, 85); font-family: Arial, Helvetica, &quot;Microsoft YaHei&quot;; white-space: normal;\">\r\n		4.控制技术风险。搞比特币矿场主要是工程学上的技术问题，比特币本身的专业技术并不是重点。你需要项目管理人才，需要电工，需要搞建设的工程师，需要懂机房建设的人才。虽然这些知识并不复杂，但有经验的人才能帮你降低成本和控制风险。</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em; color: rgb(85, 85, 85); font-family: Arial, Helvetica, &quot;Microsoft YaHei&quot;; white-space: normal;\">\r\n		好了，如果你有幸避开了这些风险，并且成本比同行低，那恭喜你可以进入下一关了。</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em; color: rgb(85, 85, 85); font-family: Arial, Helvetica, &quot;Microsoft YaHei&quot;; white-space: normal;\">\r\n		<strong style=\"outline: none;\">运营风险</strong></p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em; color: rgb(85, 85, 85); font-family: Arial, Helvetica, &quot;Microsoft YaHei&quot;; white-space: normal;\">\r\n		矿场建好了，你的印钞厂就建设好了，不过你还不能躺着着收钱，你还是个丫鬟命，好好伺候你的矿机吧。</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em; color: rgb(85, 85, 85); font-family: Arial, Helvetica, &quot;Microsoft YaHei&quot;; white-space: normal;\">\r\n		要让你的矿厂给你创造更高的收益，需要避免以下几个风险。</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em; color: rgb(85, 85, 85); font-family: Arial, Helvetica, &quot;Microsoft YaHei&quot;; white-space: normal;\">\r\n		1.降低运营成本。矿厂运营的最大成本是电费，应该想办法找到可持续的低价电。不过这个应该归为第1章里的&ldquo;控制采购成本&rdquo;这一类。电这玩意可不能省，这是原料，别想着偷工减料。为了降低运营成本，你可以购买更低功耗的矿机。这就涉及到采购成本和运营成本之间的衡量了。运营成本的另外几个大头是房租和人工，还有少量的耗材。如果你的矿厂建设在僻远的地方，你甚至要将你的差旅费考虑进去，一来二去的飞机票火车票可就能买一两个币了。</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em; color: rgb(85, 85, 85); font-family: Arial, Helvetica, &quot;Microsoft YaHei&quot;; white-space: normal;\">\r\n		2.降低矿机的折旧。矿机会报废的，这玩意虽然是铁皮做的，可也会老化死去的。一般使用挖矿所得能否覆盖运营成本来衡量矿机是否该报废。矿机报废目前主要取决于全网算力的增长，但算力这玩意涨不涨不是你能控制的。所以你只能着眼于保护的好你的矿机。从源头来说就要采购功耗更低，质量更好的矿机哦，也要配置质量更好的电源电缆和辅助设备，当然这会抬升采购成本。从运营角度来看，你要保证电源的稳定，控制矿厂的温度不要过高，降低矿场的灰尘。保护的好矿机寿命就会更长，产出也会更稳定。</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em; color: rgb(85, 85, 85); font-family: Arial, Helvetica, &quot;Microsoft YaHei&quot;; white-space: normal;\">\r\n		3.避免意外风险。矿厂要特别注意防火。曾经有大型矿场被火烧了导致全网算力瞬间下降的事。一定要装个避雷针，当然还要防洪哦，常见的自然灾害都要考虑。谁让我们搞的是实体呢。矿场要防盗，要不养条狗吧：）。要维护好公共关系，有些刁民可不是好惹的，别让他们有机会捣乱。电老虎也要考虑照顾一样，呵呵，天朝断你电不让你开工的事可是常有。这些公共关系事故导致矿场损失的事是时有发生，社区爆出过多起矿场纠纷，警察收缴矿机，变电所停你电等事故导致全网算力下降的事。所以不要掉以轻心，需要正经将这一类事件当成你项目投资的风险要素。</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em; color: rgb(85, 85, 85); font-family: Arial, Helvetica, &quot;Microsoft YaHei&quot;; white-space: normal;\">\r\n		如果你成功控制住了这些风险，运营成本达标，那恭喜你，你应该赚钱的概率非常大了。不过还是有些风险你要小心面对。</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em; color: rgb(85, 85, 85); font-family: Arial, Helvetica, &quot;Microsoft YaHei&quot;; white-space: normal;\">\r\n		<strong style=\"outline: none;\">比特币自身系统影响收益</strong></p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em; color: rgb(85, 85, 85); font-family: Arial, Helvetica, &quot;Microsoft YaHei&quot;; white-space: normal;\">\r\n		比特币系统本身的运作也会极大的影响挖矿生意的利润，这里主要有以下两个风险。</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em; color: rgb(85, 85, 85); font-family: Arial, Helvetica, &quot;Microsoft YaHei&quot;; white-space: normal;\">\r\n		1.币价下跌导致的风险。挖矿项目的获利评判最好还是以人民币计算，使用比特币来考虑会复杂很多。比特币价格本身的波动性很大，因此挖矿能否获利受币价格波动直接影响。使用一张资产负债表来衡量你的矿场总资产，如果币价下跌你就会知道你的总资产缩水，如果你承担不了账面资产缩水就要面临清亏出场的局面。</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em; color: rgb(85, 85, 85); font-family: Arial, Helvetica, &quot;Microsoft YaHei&quot;; white-space: normal;\">\r\n		有些矿主不考虑币价，直接挖到币后就卖出，从来不屯币；有些矿主会选择逢高卖出，价格太低就承受账面亏损，忍着；还有些矿主是以矿场养矿场，只有在需要运营成本时才会卖出比特币，其它的币都被屯起来。但无论哪种办法都无法避免价格波动对收益的影响，币价涨跌谁也控制不了，为了避免在币价过低时卖出挖矿所得，你需要建立一个资金预算，比如规划好电费，别到时候没钱交电费，又舍不得卖币。</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em; color: rgb(85, 85, 85); font-family: Arial, Helvetica, &quot;Microsoft YaHei&quot;; white-space: normal;\">\r\n		2.比特币算力上涨带来的风险。比特币全网的挖矿产出是固定的，每天1800BTC。越多的算力在挖，平均算力挖到的就越少。很明显如果算力上涨，你买到的矿机就要贬值，如果算力大幅度上涨，你的矿机甚至面临产出抵不了运营费用的局面，就会直接导致关机停产。</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em; color: rgb(85, 85, 85); font-family: Arial, Helvetica, &quot;Microsoft YaHei&quot;; white-space: normal;\">\r\n		从历史数据来看算力是单边上涨的，比特币运行7年来几乎没有回调过，或者说回调可以忽略不计。币价有涨有跌，但算力却单边上涨。这也说明了比特币挖矿这个业务是非常吸引人的。因此请将你购买的矿机估算一个折旧率，以覆盖算力上涨带来的矿机产出降低。</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em; color: rgb(85, 85, 85); font-family: Arial, Helvetica, &quot;Microsoft YaHei&quot;; white-space: normal;\">\r\n		其实这类影响和做其他生意是一样的，比如你养猪。猪肉价格上涨还是下跌肯定影响你的收益。而养猪的越多，也就意味着你的猪就倾向于贬值。这和币价以及算力影响挖矿收益的道理是一样的。</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em; color: rgb(85, 85, 85); font-family: Arial, Helvetica, &quot;Microsoft YaHei&quot;; white-space: normal;\">\r\n		比特币挖矿和养猪是一样的，猪肉市场需求一直在，比特币市场也非常大，挖出来的币不愁卖不出去。养猪需要搭建猪舍，买饲料，照顾猪，矿机要矿场，要吃电，要你各种照顾。猪肉价格一样波动，养猪也有同行竞争，比特币也一样。养猪有赚钱的，也有赔钱的，挖比特币也一样。</p>\r\n	<div>\r\n		&nbsp;</div>\r\n</div>\r\n<p>\r\n	&nbsp;</p>', '', '', '1');
INSERT INTO `cms_article_data` VALUES ('74197', '<p>\r\n	尊敬的用户： 由于电信机房升级，场地网络受到影响。58BTC矿场于10月28日机器中断运行约15分钟，目前机器正常中。打币比例届时将参考真实算力统计发放。 感谢您的理解与支持！</p>', '', '', '1');
INSERT INTO `cms_article_data` VALUES ('74199', '<p>\r\n	无</p>', '', '', '1');
