INSERT INTO `cms_article_data` VALUES ('74323', '<h1 class=\"tac f30 col333\" style=\"white-space: normal; outline: none; margin: 0px; padding: 55px 0px 40px; font-weight: normal; font-size: 30px; font-family: Arial, Helvetica, &quot;Microsoft YaHei&quot;; text-align: center !important;\">\r\n	什么是比特币？比特币究竟为什么值钱？</h1>\r\n<p>\r\n	<span class=\"tac f14 col9c time\" style=\"white-space: normal; outline: none; display: block; padding-bottom: 40px; font-family: Arial, Helvetica, &quot;Microsoft YaHei&quot;; text-align: center !important; color: rgb(156, 156, 156) !important;\">时间：2017-06-29</span></p>\r\n<div class=\"text\" style=\"white-space: normal; outline: none; overflow: hidden; padding-bottom: 80px; color: rgb(85, 85, 85); font-family: Arial, Helvetica, &quot;Microsoft YaHei&quot;;\">\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em;\">\r\n		&nbsp;</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em; text-align: center;\">\r\n		<strong style=\"outline: none;\"><img alt=\"什么是比特币？比特币究竟为什么值钱？\" border=\"0\" height=\"332\" src=\"http://www.58btc.com/uploads/images/fdedb8e84c58bae69c7bc18d47f5fac2.jpg\" style=\"height: 332px; vertical-align: top; border-width: initial; border-style: none; outline: none; width: 500px;\" title=\"什么是比特币？比特币究竟为什么值钱？\" vspace=\"0\" width=\"500\" /></strong></p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em;\">\r\n		<strong style=\"outline: none;\">比特币的4重含义：</strong></p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em;\">\r\n		第一个被证明的区块链应用；</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em;\">\r\n		区块链是什么？解释起来有些繁琐，我将在以后的文章中专门解释，暂且大家理解成&ldquo;账本&rdquo;。</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em;\">\r\n		运用去中心化维护的世界银行；</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em;\">\r\n		比如，我们在互联网上进行转账，我将10元通过工行转账给A君，那么将由工行来负责&ldquo;记账&rdquo;，将我的账户减10元，将A君账户增加10元，这个过程就是中心化的过程，工行就是中心，中心将各个节点（用户）连在一起，节点无法离开中心。</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em;\">\r\n		去中心化的世界银行意味着，我将10元转给A君直接跨越了工行，直接点对点进行了价值传递。</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em;\">\r\n		一种货币；</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em;\">\r\n		去中心化世界银行的股票。</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em;\">\r\n		<strong style=\"outline: none;\">比特币为什么值钱？</strong></p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em;\">\r\n		通过上述介绍，比特币相当于是去中心化世界银行的&ldquo;股票&rdquo;，如果这个去中心化的世界银行可以造福人类，有目前其他银行不具备的优势，被社会所极力认可，并且不断渗入社会，那么他的&ldquo;股价&rdquo;（币值）势必会不断提升。</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em;\">\r\n		<strong style=\"outline: none;\">比特币有哪些目前银行所不具备的优势呢？</strong></p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em;\">\r\n		<strong style=\"outline: none;\">信任&amp;价值传递！</strong></p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em;\">\r\n		目前互联网金融日新月异，但是大家回忆下10年前的互联网，没有支付，没有网络购物，只有新闻、QQ，单机游戏。。。是什么改变了这一切？</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em;\">\r\n		是第三方平台！比如财付通，支付宝。第三方平台解决了线上大众的信任问题由此可以让大家安心去购物付款、转账，进行价值传递。</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em;\">\r\n		但是第三方平台有巨大的隐患。</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em;\">\r\n		<strong style=\"outline: none;\">数据安全</strong></p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em;\">\r\n		目前在互联网上的交易其实是信用交易，都是通过平台&ldquo;记账&rdquo;方式来运行，也就是说，一旦对方数据库受损，&ldquo;账本&rdquo;遗失，你的线上资产，交易记录，都将有巨大的风险。</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em;\">\r\n		<strong style=\"outline: none;\">繁重佣金&amp;效率</strong></p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em;\">\r\n		因为线上的交易需要通过中心化的公司来&ldquo;记账&rdquo;，比如你通过工行转账10万给国外，那么需要工行与国外的银行进行对账核算，不但会产生高额的手续费更是会有&ldquo;到账时间&rdquo;约束。</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em;\">\r\n		<strong style=\"outline: none;\">比特币可以统统解决这一切</strong></p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em;\">\r\n		<strong style=\"outline: none;\">100%信任</strong></p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em;\">\r\n		比特币通过去中心化的技术来进行&ldquo;记账&rdquo;，其特点是不可修改（维护比特币系统的节点分布在世界各地，如果需要修改过往数据，那么需要战胜51%节点的算力，国家几乎无此资源），此外比特币的所有交易信息均透明可查询，也就极大程度保护了交易的&ldquo;信任&rdquo;。</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em;\">\r\n		<strong style=\"outline: none;\">极低佣金的价值传递</strong></p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em;\">\r\n		因为比特币去中心化的特质，决定了可以点对点进行交易，而不是点-中心-中心-点，可以极大提升效率并且节省手续费。</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em;\">\r\n		如上，正是比特币被越来越多人、公司、科研领域所看好的原因，也就造就了其飞速成长的币值。</p>\r\n	<div>\r\n		&nbsp;</div>\r\n</div>\r\n<p>\r\n	&nbsp;</p>', '', '', '1');
INSERT INTO `cms_article_data` VALUES ('74326', '<h1 class=\"tac f30 col333\" style=\"outline: none; margin: 0px; padding: 55px 0px 40px; font-weight: normal; font-size: 30px; text-align: center !important;\">\r\n	比特币是怎么产出的？</h1>\r\n<p>\r\n	<span class=\"tac f14 col9c time\" style=\"outline: none; display: block; padding-bottom: 40px; text-align: center !important; color: rgb(156, 156, 156) !important;\">时间：2017-06-21</span></p>\r\n<div class=\"text\" style=\"outline: none; overflow: hidden; padding-bottom: 80px;\">\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em; color: rgb(85, 85, 85); font-family: Arial, Helvetica, &quot;Microsoft YaHei&quot;; white-space: normal;\">\r\n		&nbsp;</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em; color: rgb(85, 85, 85); font-family: Arial, Helvetica, &quot;Microsoft YaHei&quot;; white-space: normal;\">\r\n		首先我们来了解一下&ldquo;区块链&rdquo;，比特币的核心原理是&ldquo;区块链&rdquo;，每一个区块对应一个帐单，将所有的区块链接起来就是区块链，任何交易信息和转账记录都记录在区块链中。要注意的是区块链存在于整个互联网中，所以任何比特币持有者都不担心比特币遭受损失。</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em; color: rgb(85, 85, 85); font-family: Arial, Helvetica, &quot;Microsoft YaHei&quot;; white-space: normal; text-align: center;\">\r\n		<img alt=\"比特币是怎么产出的？\" border=\"0\" height=\"367\" src=\"http://www.58btc.com/uploads/images/04ac35d80f81192dc4516765c7f9ffc1.jpg\" style=\"outline: none; border-width: initial; border-style: none; vertical-align: top; width: 550px; height: 367px;\" title=\"比特币是怎么产出的？\" vspace=\"0\" width=\"550\" /></p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em; color: rgb(85, 85, 85); font-family: Arial, Helvetica, &quot;Microsoft YaHei&quot;; white-space: normal;\">\r\n		每隔一个时间点，比特币系统会在系统节点上生成一个随机代码，互联网中的所有计算机都可以去寻找此代码，谁找到此代码，就会产生一个区块，随即得到一个比特币，这个过程就是人们常说的挖矿。计算这个随机代码需要大量的GPU运算，于是矿工们采购海量显卡用以更快速的获得比特币获利，这也是近期显卡缺货的重要原因。</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em; color: rgb(85, 85, 85); font-family: Arial, Helvetica, &quot;Microsoft YaHei&quot;; white-space: normal;\">\r\n		有人说那这样比特币不就会越来越多，最后完全没有价值了吗？中本聪当然也想到这个问题，这里比特币系统还有一个机制：那就是比特币具有总量有限，前4年总额将产生10500000BTC，每隔4年产出数额减半，在第4年至第8年会产生5250000BTC，第8至12年则只有2625000BTC，如此类推。到最后，总共产生的比特币数量为接近21000000BTC。</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em; color: rgb(85, 85, 85); font-family: Arial, Helvetica, &quot;Microsoft YaHei&quot;; white-space: normal;\">\r\n		目前一个1个比特币基于目前的数据结构被分割到8个小数位，也就是0.00000001BTC，矿工们挖到比特币最小的单位就是0.00000001BTC。</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em; color: rgb(85, 85, 85); font-family: Arial, Helvetica, &quot;Microsoft YaHei&quot;; white-space: normal;\">\r\n		通俗点说，比特币好比是一座由总量为2100万个金币组成的金山，想要得到它，就需要玩家们利用电脑的运算能力，根据现有的算法计算出一组符合特定规律的数字。</p>\r\n	<p style=\"outline: none; margin: 0px; padding: 0px 0px 15px; text-indent: 2em; color: rgb(85, 85, 85); font-family: Arial, Helvetica, &quot;Microsoft YaHei&quot;; white-space: normal;\">\r\n		当然，这些数学题随着现有比特币的增加正变得越来越难。</p>\r\n	<div>\r\n		&nbsp;</div>\r\n</div>\r\n<p>\r\n	&nbsp;</p>', '', '', '1');
