uot;Microsoft YaHei&quot;; font-size: 24px; white-space: normal;\">\r\n	凡购买过12月10日S9 13.5T算力的客户均可享受差价补券政策（例如17500元购买2台12月10日期货算力，送等量的2张1500元优惠券），该优惠券仅限本人使用，优惠券有效期到2017年11月30日，不与其它优惠政策同享。</p>\r\n<p style=\"margin: 10px 0px 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Arial, Helvetica, &quot;Microsoft YaHei&quot;; font-size: 24px; white-space: normal;\">\r\n	&nbsp;</p>\r\n<p style=\"margin: 10px 0px 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Arial, Helvetica, &quot;Microsoft YaHei&quot;; font-size: 24px; white-space: normal; text-align: right;\">\r\n	&nbsp;</p>\r\n<p style=\"margin: 10px 0px 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Arial, Helvetica, &quot;Microsoft YaHei&quot;; font-size: 24px; white-space: normal; text-align: right;\">\r\n	2017年11月14日</p>', '', '', '1');
INSERT INTO `cms_article_data` VALUES ('74468', '<p style=\"margin: 10px 0px 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Arial, Helvetica, &quot;Microsoft YaHei&quot;; font-size: 24px; white-space: normal;\">\r\n	尊敬的用户：</p>\r\n<p style=\"margin: 10px 0px 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Arial, Helvetica, &quot;Microsoft YaHei&quot;; font-size: 24px; white-space: normal;\">\r\n	算力收益发放模式做出以下调整，算力客户原周六、周日发放的两天收益即日起将不做当日发放，周六、周日发放的收益将累计到下周一一并发放。特此公告！</p>\r\n<p style=\"margin: 10px 0px 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Arial, Helvetica, &quot;Microsoft YaHei&quot;; font-size: 24px; white-space: normal;\">\r\n	感谢您的理解与支持！</p>\r\n<p style=\"margin: 10px 0px 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Arial, Helvetica, &quot;Microsoft YaHei&quot;; font-size: 24px; white-space: normal;\">\r\n	&nbsp;</p>\r\n<p style=\"margin: 10px 0px 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Arial, Helvetica, &quot;Microsoft YaHei&quot;; font-size: 24px; white-space: normal; text-align: right;\">\r\n	&nbsp;</p>\r\n<p style=\"margin: 10px 0px 0px; padding: 0px; color: rgb(68, 68, 68); font-family: Arial, Helvetica, &quot;Microsoft YaHei&quot;; font-size: 24px; white-space: normal; text-align: right;\">\r\n	2017年11月6日</p>', '', '', '1');
INSERT INTO `cms_article_data` VALUES ('74593', '<h3 align=\"right\" style=\"text-align:right;line-height:42.0pt;mso-pagination:widow-orphan\">\r\n	<span style=\"mso-bidi-font-family:宋体;color:black\">协议编号：<span lang=\"EN-US\">&nbsp; &nbsp;<o:p></o:p></span></span></h3>\r\n<h1 align=\"center\" style=\"text-align:center;line-height:42.0pt;mso-pagination:\r\nwidow-orphan\">\r\n	<span style=\"mso-bidi-font-family:宋体;color:black\">聚算宝购买协议<span lang=\"EN-US\"><o:p></o:p></span></span></h1>\r\n<p style=\"line-height:18.0pt;mso-pagination:widow-orphan\">\r\n	<b><span style=\"font-family:宋体;mso-bidi-font-family:宋体;color:black\">甲 方：<u><span lang=\"EN-US\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></u><span lang=\"EN-US\"><o:p></o:p></span></span></b></p>\r\n<p style=\"line-height:18.0pt;mso-pagination:widow-orphan\">\r\n	<b><span style=\"font-family:宋体;mso-bidi-font-family:宋体;color:black\">身份证<span lang=\"EN-US\">/</span>组织机构代码证编号：<u><span lang=\"EN-US\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></u><span lang=\"EN-US\"><o:p></o:p></span></span></b></p>\r\n<p style=\"line-height:18.0pt;mso-pagination:widow-orphan\">\r\n	<b><span style=\"font-family:宋体;mso-bidi-font-family:宋体;color:black\">住址：<u><span lang=\"EN-US\">&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span></u><span lang=\"EN-US\"><o:p></o:p></span></span></b></p>\r\n<p style=\"line-height:18.0pt;mso-pagination:widow-orphan\">\r\n	<b><span style=\"font-family:宋体;mso-bidi-font-family:宋体;color:black\">联系电话：<u><span lang=\"EN-US\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span></u><span lang=\"EN-US\"><o:p></o:p></span></span></b></p>\r\n<p align=\"left\" class=\"MsoNormal\">\r\n	<span lang=\"EN-US\">&nbsp;</span></p>\r\n<p style=\"line-height:18.0pt;mso-pagination:widow-orphan\">\r\n	<b><span style=\"font-family:宋体;mso-bidi-font-family:宋体;color:black\">乙 方：<u><span lang=\"EN-US\">&nbsp;</span>深圳锦晖区块链科技有限公司</u><span lang=\"EN-US\"><o:p></o:p></span></span></b></p>\r\n<p style=\"line-height:18.0pt;mso-pagination:widow-orphan\">\r\n	<b><span style=\"font-family:宋体;mso-bidi-font-family:宋体;color:black\">住 所<span lang=\"EN-US\">:<u>&nbsp;</u></span><u>深圳市福田区福田街道滨河大道<span lang=\"EN-US\">5022</span>号联合广场<span lang=\"EN-US\">A</span>座<span lang=\"EN-US\">18</span>楼<span lang=\"EN-US\">1812</span></u><span lang=\"EN-US\"><o:p></o:p></span></span></b></p>\r\n<p style=\"line-height:18.0pt;mso-pagination:widow-orphan\">\r\n	<b><span style=\"font-family:宋体;mso-bidi-font-family:宋体;color:black\">法定代表人<span lang=\"EN-US\">/</span>负责人<span lang=\"EN-US\">:<u>&nbsp;</u></span><u>朱晖</u><span lang=\"EN-US\"><o:p></o:p></span></span></b></p>\r\n<p style=\"line-height:18.0pt;mso-pagination:widow-orphan\">\r\n	<b><span style=\"font-family:宋体;mso-bidi-font-family:宋体;color:black\">联系电话<span lang=\"EN-US\">:<u>&nbsp;18679618388</u><o:p></o:p></span></span></b></p>\r\n<p class=\"MsoNormal\" style=\"line-height:18.0pt;mso-pagination:widow-orphan\">\r\n	<b><span lang=\"EN-US\" style=\"font-size:12.0pt;\r\nfont-family:宋体;mso-bidi-font-family:宋体;color:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span></b><b><span style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">本协议项下甲乙丙三方单独称&ldquo;一方&rdquo;，合称&ldquo;各方&rdquo;。</span></b><b><span lang=\"EN-US\" style=\"font-size:12.0pt;\r\nfont-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></b></p>\r\n<p class=\"MsoNormal\" style=\"line-height:18.0pt;mso-pagination:widow-orphan\">\r\n	<b><span lang=\"EN-US\" style=\"font-size:12.0pt;\r\nfont-family:宋体;mso-bidi-font-family:宋体;color:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span></b><b><span style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">第一条 释义</span></b><b><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></b></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span><span style=\"font-size:\r\n12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">除非上下文另有解释，下列用于具有以下含义<span lang=\"EN-US\">:</span></span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:\r\n宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;1.1</span><span style=\"font-size:\r\n12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">&ldquo;比特币&rdquo;最初的概念在<span lang=\"EN-US\">2009</span>年提出，比特币的生成是建立在计算机开源软件以及建构其上的<span lang=\"EN-US\">P2P</span>网络基础上。</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;1.1.1</span><span style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">比特币的具体生成流程：</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span><span style=\"font-size:\r\n12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">（<span lang=\"EN-US\">1</span>）下载专用的比特币运算工具，即为一种特定的计算机程序；</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span><span style=\"font-size:\r\n12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">（<span lang=\"EN-US\">2</span>）然后注册相应的合作网站；</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span><span style=\"font-size:\r\n12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">（<span lang=\"EN-US\">3</span>）把注册来的用户名和密码填入计算程序中，再点击运算就正式开始；</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span><span style=\"font-size:\r\n12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">（<span lang=\"EN-US\">4</span>）计算机依照算法进行大量的运算，从而生成特解，所生成的特解均为<span lang=\"EN-US\">64</span>位的数字，为比特币的<span lang=\"EN-US\">P2P</span>网络所需要；</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span><span style=\"font-size:\r\n12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">（<span lang=\"EN-US\">5</span>）作为奖励，用户的电脑在成功的生成比特币网络所需要的特解时，即可获得相应数量的比特币。</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;1.1.2 </span><span style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">比特币具有以下特征<span lang=\"EN-US\">:</span></span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:\r\n宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span><span style=\"font-size:\r\n12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">（<span lang=\"EN-US\">1</span>）本质上是由计算机生成的一串串复杂代码组成<span lang=\"EN-US\">,</span>属于计算信息系统数据；</span><span lang=\"EN-US\" style=\"font-size:12.0pt;\r\nfont-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span><span style=\"font-size:\r\n12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">（<span lang=\"EN-US\">2</span>）比特币不是由货币当局发行，不具有法偿性与强制性等货币属性；</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span><span style=\"font-size:\r\n12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">（<span lang=\"EN-US\">3</span>）比特币是一种特定的虚拟商品，不具有与货币等同的法律地位，不能且不应作为货币在市场上流通使用；</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span><span style=\"font-size:\r\n12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">（<span lang=\"EN-US\">4</span>）作为一种虚拟商品， 比特币可以通过计算机信息系统交易，其价格会由于供需等各种原因产生波动；</span><span lang=\"EN-US\" style=\"font-size:\r\n12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span><span style=\"font-size:\r\n12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">（<span lang=\"EN-US\">5</span>）比特币可以通过交易变现成货币，但是作为一种虚拟商品，比特币无实物的性质。</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;1.2 </span><span style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">&ldquo;算力&rdquo;是指计算机的运算能力。</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;1.3 </span><span style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">&ldquo;挖矿&rdquo;本协议中将通过网络下载专用的比特币运算工具，并利用计算机的运算能力进行大量的运算，从而生成<span lang=\"EN-US\">P2P</span>网络所需要的特解，每生成一个特解，即可获得相应数量的比特币作为奖励的过程称为挖矿。</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;1.4</span><span style=\"font-size:\r\n12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">&ldquo;矿机&rdquo;可以为&ldquo;挖矿&rdquo;提供所需要的运算能力的计算机。</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;1.5</span><span style=\"font-size:\r\n12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">&ldquo;矿场&rdquo;是指为了更为有效的通过挖矿获得比特币，选择特定的地点（包括但不限于厂房、住宅或办公楼等）集中安放运行数量众多的矿机。本协议中，将集中在某一特定地点安放运行的数量众多的矿机称为&ldquo;矿场&rdquo;。</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;1.6</span><span style=\"font-size:\r\n12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">&ldquo;矿池&rdquo;<span lang=\"EN-US\">:</span>处于<span lang=\"EN-US\">P2P</span>网络中的每一台矿机可以独立挖矿，也可以选择和其他的矿机联合一起挖矿。我们将联合众多矿机或矿场共同挖矿，并将挖矿所得的比特币按照特定的分配方式分配给参与挖矿的矿机或矿场的网络平台称为矿池。</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;1.7 </span><span style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">&ldquo;矿机残值&rdquo;是指矿机通过挖矿难以获得收益之后矿机硬件的价值。</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;1.8</span><span style=\"font-size:\r\n12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">&ldquo;比特币钱包&rdquo;：用于接收和存放比特币的网络地址，是大约<span lang=\"EN-US\">33</span>位长的、由字母和数字构成的一串字符，总是由<span lang=\"EN-US\">1</span>或者<span lang=\"EN-US\">3</span>开头。</span><span lang=\"EN-US\" style=\"font-size:12.0pt;\r\nfont-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\">&nbsp;1.9 </span><span style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\">&ldquo;聚算宝&rdquo;：指由丙方深圳锦晖区块链科技有限司运营管理的互联网电子商务信息居间撮合服务平台，&ldquo;聚算宝&rdquo;的网络域名为【<span lang=\"EN-US\">www.hke1688.com</span>】。<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;1.10</span><span style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">支付机构：指在本协议各方之间作为中介机构提供资金转移服务的银行或第三方支付结算机构。</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;1.11 </span><span style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">支付平台：指由支付机构运营的管理支付平台。</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;1.12</span><span style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">本协议：指本《算力购买协议》，及为实现、补充和修改《算力购买协议》而签署的其他协议、合同、修正函、附件、声明函等文件。</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;1.13</span><span style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">法律：指现行有效并公布实施的法律、行政法规、规章、司法解释及监管部门的决定、通知等，本协议中的法律仅指中国法律，不包括香港特别行政区、澳门特别行政区和台湾地区的法律。</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;1.14</span><span style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">元：指本协议中的元，除非特别说明，在本协议指人民币。</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:18.0pt;mso-pagination:widow-orphan\">\r\n	<b><span lang=\"EN-US\" style=\"font-size:12.0pt;\r\nfont-family:宋体;mso-bidi-font-family:宋体;color:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span></b><b><span style=\"font-size:12.0pt;font-family:\r\n宋体;mso-bidi-font-family:宋体;color:black\">第二条 购买算力</span></b><b><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:\r\n宋体\"><o:p></o:p></span></b></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;2.1 </span><span style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">甲方意欲参与比特币的挖矿，乙方提供算力及矿机托管服务，现甲方通过购买乙方一定份额的算力来参与比特币的挖矿。<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;2.2 </span><span style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">算力购买</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;2.2.1 </span><span style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">算力服务的价格 （按照实际价格为准）</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;\r\nmso-bidi-font-family:宋体\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\">&nbsp;</span><span style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\">该项算力服务名称为算力宝云挖矿合约，期货每份合约代表矿机<span lang=\"EN-US\">1T</span>的算力，售价为<span lang=\"EN-US\">1500</span>元<span lang=\"EN-US\">/T</span>。现货每份合约代表矿机<span lang=\"EN-US\">1T</span>的算力，售价为<span lang=\"EN-US\">2000</span>元<span lang=\"EN-US\">/T</span>。<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:red\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;2.2.2</span><span style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">甲方应支付的算购买价格为：</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span><span style=\"font-size:\r\n12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">甲方应支付的算力购买价格<span lang=\"EN-US\">=</span>【<span lang=\"EN-US\"> &nbsp; &nbsp; </span>】<span lang=\"EN-US\">T*</span>【<span lang=\"EN-US\"> &nbsp; &nbsp; </span>】元<span lang=\"EN-US\">/</span>每<span lang=\"EN-US\">T</span></span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;2.3 </span><span style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">算力预售</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\">&nbsp;</span><span style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\">期货预售的算力于<span lang=\"EN-US\">2017</span>年<span lang=\"EN-US\">12</span>月<span lang=\"EN-US\">20</span>日进行算力切割，从<span lang=\"EN-US\">12</span>月<span lang=\"EN-US\">20</span>日起进行算力结算。<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;2.4 </span><span style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">收益的分配</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;2.4.1 </span><span style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">乙方将算力挖矿产生的比特币收益结算给甲方，结算时间为<span lang=\"EN-US\">T+1</span>。用户收益以矿池实际产生的收益为准。即一旦矿池通过挖矿获得比特币，即按固定的方案计算分配甲方。算力在运转过程中，实际算力大小会小幅上下浮动，产生的比特币收益也会随之上下浮动。</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; </span><span lang=\"EN-US\" style=\"font-size:\r\n12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:red\">&nbsp;&nbsp;</span><span style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\">其中，<span lang=\"EN-US\">12</span>月<span lang=\"EN-US\">19</span>日<span lang=\"EN-US\">16</span>：<span lang=\"EN-US\">00</span>前付款的购买预售产品的用户将统一安排在<span lang=\"EN-US\">1</span>月<span lang=\"EN-US\">20</span>日进行算力切割，同时结算收益并于次日发放收益。<span lang=\"EN-US\">12</span>月<span lang=\"EN-US\">19</span>日<span lang=\"EN-US\">16</span>：<span lang=\"EN-US\">00</span>之后的购买用户结算方式照常，<span lang=\"EN-US\">16</span>：<span lang=\"EN-US\">00</span>前付款的用户按当日结算次日发放的方式进行，<span lang=\"EN-US\">16</span>：<span lang=\"EN-US\">00</span>后付款的用户顺延一日进行。<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;2.4.2</span><span style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">甲方每日应得的比特币数量为每日扣除电费后的比特币数量，即：</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:red\">&nbsp;</span><span style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\">甲方每日应得比特币数量<span lang=\"EN-US\">=</span>甲方购买的算力／<span lang=\"EN-US\">300T</span>&times;<span lang=\"EN-US\">100%</span>&times;乙方取得的比特币<span lang=\"EN-US\">-</span>当日电费<span lang=\"EN-US\">/</span>当日比特币市价。<span lang=\"EN-US\"><o:p></o:p></span></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span><span style=\"font-size:\r\n12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">其中：</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span><span style=\"font-size:\r\n12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">（<span lang=\"EN-US\">1</span>）用户应付电费按<span lang=\"EN-US\">0.4</span>元每度的价格以<span lang=\"EN-US\">120W/T</span>的功耗计算；</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span><span style=\"font-size:\r\n12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">（<span lang=\"EN-US\">2</span>）随着矿机设备的折旧等因素，实际算力会小幅下降。甲方所得比特币收益按实际算力产出的比特币为准。</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span><span style=\"font-size:\r\n12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">（<span lang=\"EN-US\">3</span>）每月<span lang=\"EN-US\">1</span>号为停电维护时间，因算力不实际运作，当天甲方不需要交电费给乙方，当天的比特币收益为<span lang=\"EN-US\">0</span>。</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;2.4.3 </span><span style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">乙方与甲方之间采用比特币结算，乙方每天同甲方结算一次比特币即：</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span><span style=\"font-size:\r\n12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">（<span lang=\"EN-US\">1</span>）乙方应每日计算甲方应分配的比特币；</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span><span style=\"font-size:\r\n12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">（<span lang=\"EN-US\">2</span>）每天乙方将当日甲方应分配的比特币一次性支付给甲方。</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;2.4.4 </span><span style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">若连续十天算力宝无忧挖矿一号产出的比特币收益小于电费，则合约终止，甲方不再享有比特币收益。</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;2.4.5 </span><span style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">矿机残值归甲方所有。由乙方共同将矿机残值处理之后按比特币市场价格将比特币打至甲方账户。</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:18.0pt;mso-pagination:widow-orphan\">\r\n	<b><span lang=\"EN-US\" style=\"font-size:12.0pt;\r\nfont-family:宋体;mso-bidi-font-family:宋体;color:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span></b><b><span style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">第三条 比特币的交易</span></b><b><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></b></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;3.1 </span><span style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">比特币的购买</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;3.1.1</span><span style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">甲方应通过乙方运营管理的&ldquo;聚算宝&rdquo;网站注册，成为乙方的会员。</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;3.1.2</span><span style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">甲方应先通过&ldquo;聚算宝&rdquo;网站充值人民币，然后向乙方购买算力，并以人民币进行结算。</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:red\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span><span style=\"font-size:\r\n12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">（<span lang=\"EN-US\">1</span>）乙方在&ldquo;聚算宝&rdquo;网站上公布比特币的当时即时价格；</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span><span style=\"font-size:\r\n12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">（<span lang=\"EN-US\">2</span>）甲方确认需要购买<span lang=\"EN-US\">/</span>卖出的比特币的数量；</span><span lang=\"EN-US\" style=\"font-size:12.0pt;\r\nfont-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span><span style=\"font-size:\r\n12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">（<span lang=\"EN-US\">3</span>）乙方根据甲方确认的需要购买<span lang=\"EN-US\">/</span>卖出的比特币的数量及当时即时价格计算甲方需要支付的现金<span lang=\"EN-US\">/</span>比特币价格；</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span><span style=\"font-size:\r\n12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">（<span lang=\"EN-US\">4</span>）甲方确认购买，通过支付平台向乙方支付购买<span lang=\"EN-US\">/</span>卖出比特币的价款；</span><span lang=\"EN-US\" style=\"font-size:12.0pt;\r\nfont-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;3.2</span><span style=\"font-size:\r\n12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">乙方为甲方建立专门的比特币账户，每日即时公布以下信息：</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span><span style=\"font-size:\r\n12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">（<span lang=\"EN-US\">1</span>）甲方比特币账户应有的比特币数量；</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span><span style=\"font-size:\r\n12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">（<span lang=\"EN-US\">2</span>）比特币的即时价格；</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span><span style=\"font-size:\r\n12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">（<span lang=\"EN-US\">3</span>）按照比特币数量及比特币的即时价格计算的甲方比特币账户的现金价值。</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;3.3 </span><span style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">算力的购买</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span><span style=\"font-size:\r\n12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">甲方按照以下程序从乙方处购买算力：</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;3.3.1</span><span style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">甲方确认购买算力的方案和数量；</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;3.3.2 </span><span style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">根据甲方确认购买算力的方案和数量，乙方计算甲方应支付给乙方的人民币数量；</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;3.3.3 </span><span style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">甲方确认购买，乙方从甲方的人民币账户中扣除相应数量的人民币后支付至乙方的人民币账户。</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;3.4</span><span style=\"font-size:\r\n12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">比特币的处置</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span><span style=\"font-size:\r\n12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">甲方可以随时向乙方发放指令，按照如下程序处分其比特币账户内的比特币：</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;3.4.1</span><span style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">委托乙方将其比特币账户内的一定数量的比特币进行变现；</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:red\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:red\">&nbsp; &nbsp; &nbsp; &nbsp;</span><span lang=\"EN-US\" style=\"font-size:\r\n12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">&nbsp;3.4.3</span><span style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">乙方并将变现后的现金支付至甲方的账户。</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:18.0pt;mso-pagination:widow-orphan\">\r\n	<b><span lang=\"EN-US\" style=\"font-size:12.0pt;\r\nfont-family:宋体;mso-bidi-font-family:宋体;color:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span></b><b><span style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">第四条 权利及义务</span></b><b><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></b></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span><span style=\"font-size:\r\n12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">各方已认真阅读和理解本协议所有内容并自愿按本协议相关约定履行各自的权利义务。</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;4.1 </span><span style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">甲方权利及义务</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;4.1.1 </span><span style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">甲方应通过乙方运营管理的&ldquo;聚算宝&rdquo;网站注册，成为乙方的会员。</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;4.1.2</span><span style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">甲方首次在&ldquo;聚算宝&rdquo;网站购买算力的，应通过乙方和其合作的支付机构的实名认证，实名认证的流程如下：</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span><span style=\"font-size:\r\n12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">（<span lang=\"EN-US\">1</span>）甲方在&ldquo;聚算宝&rdquo;网站登陆会员账户，按照系统提示的流程进行实名认证。甲方在实名认证时应按照提示输入真实的姓名、身份证号码、手机号码及银行卡号，其中银行卡号必须是以甲方本人名义登记，银行卡号开立时所预留的手机号码和实名认证时提交的手机号码必须一致。</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span><span style=\"font-size:\r\n12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">（<span lang=\"EN-US\">2</span>）甲方按照系统提示的程序通过乙方实名认证的同时，支付机构通过与乙方的链接即完成对甲方在支付平台上的实名认证。</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;4.1.2 </span><span style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">甲方同意由乙方接收、保管与本次算力购买有关的所有合同、协议等文件、资料。</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;4.1.3 </span><span style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">甲方通过乙方的链接在支付平台上进行实名认证时，即已经充分知晓允许支付平台：</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span><span style=\"font-size:\r\n12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">（<span lang=\"EN-US\">1</span>）在甲方按照第<span lang=\"EN-US\">3.1.3</span>条的约定购买算力时，支付平台可以直接从甲方实名认证时的银行账户或在支付平台上开立的第三方账户中扣除相应的算力购买价款并向乙方支付。</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span><span style=\"font-size:\r\n12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">（<span lang=\"EN-US\">2</span>）乙方按照第<span lang=\"EN-US\">3.4</span>条的约定为甲方处置比特币后，直接将相应款项通过支付平台支付至甲方实名认证时的银行账户或在支付平台上开立的第三方支付账户。</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span><span style=\"font-size:\r\n12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">因支付平台的问题，致使甲方遭受损失的，乙方不承担赔偿责任，由甲方自行向支付平台请求赔偿。</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;4.1.4 </span><span style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">甲方有权按照约定从乙方处分配比特币。</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;4.1.5</span><span style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">甲方比特币账户的比特币系甲方所有，甲方享有占有、使用、收益和处分的权利。</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;4.1.6</span><span style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">甲方应自行承担因比特币市场的波动所导致的本金损失风险或实际收益低于预期收益的风险。</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;4.1.7</span><span style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">甲方有义务按照&ldquo;聚算宝&rdquo;网站的要求提供真实的信息，因甲方提供虚假信息而造成的一切法律后果（包括但不限于民事赔偿、行政处罚、刑事责任等）均由甲方承担。</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;4.1.8</span><span style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">甲方本人的住所电话、手机号码、账户信息如出现变更的，应在变更后三日内通过&ldquo;聚算宝&rdquo;网站向其他各方提供变更后的最新信息。若因甲方未及时提供最新信息而导致其自身和<span lang=\"EN-US\">/</span>或任何其他方遭受损失的，应由甲方承担。</span><span lang=\"EN-US\" style=\"font-size:\r\n12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;4.1.9</span><span style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">甲方有义务按照&ldquo;聚算宝&rdquo;网站的要求使用网站以及收取乙方发出的所有消息（包括但不限于网站通知、电子邮件、手机短信等），因甲方个人操作不当或疏于查收信息造成的损失由甲方自行承担。</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;4.1.10</span><span style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">因甲方自身的原因导致乙方在提供服务时发生任何错误而产生的任何损失或责任，由甲方自行负责，乙方承担责任。</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;4.1.11</span><span style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">甲方承诺对本协议涉及的比特币购买价款具有完全的支配能力，是其自有闲散资金，为其合法所得。</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;4.1.12</span><span style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">甲方在算力购买和比特币持有及处分过程中产生的相关税费，由甲方自行向主管税务机关申报、缴纳，但如果中国税收法律法规规定其他各方具有代扣代缴义务，则其他各方有权直接代扣代缴并向甲方提供纳税凭证。</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;4.1.13 </span><span style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">由于火灾、水灾等不可抗拒因素导致的算力设备的损毁从而导致的损失由甲方承担。</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;4.2 </span><span style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">乙方的权利及其义务</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;4.2.1 </span><span style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">乙方应按照本协议的约定，为甲方建立独立的人民币账户及比特币账户。乙方应按照本协议的规定，恪尽职守，以诚实、信用、谨慎、有效管理的原则为甲乙双方进行服务。</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;4.2.2 </span><span style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">乙方作为算力的提供方，应保证算力的正常供应，因算力未及时到位给用户造成的损失由乙方承担。若算力未及时供应时长超过<span lang=\"EN-US\">20</span>天，乙方需将用户的资金返还给用户。</span><span lang=\"EN-US\" style=\"font-size:\r\n12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;4.2.3 </span><span style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">矿场及矿机设备中在实际运转过程中若出现问题，乙方应及时告知甲方并共同协商解决方案。</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;4.2.4</span><span style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">乙方承诺对本次算力出售过程中获取的协议各方的信息、资产情况及其他服务相关信息和资料依法保密。</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;4.2.5 </span><span style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">乙方应按照甲方的委托或指示购买和<span lang=\"EN-US\">/</span>或处分甲方比特币账户的比特币。未经甲方允许，乙方不得擅自处分。因乙方擅自处分致使甲方遭受损失的，乙方应对甲方的损失承担赔偿责任。</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;4.2.6 </span><span style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">甲方在比特币账户中的比特币系甲方所有，乙方应妥善管理和处分。鉴于比特币的网络虚拟性，乙方应保证其网络系统的正常运行，因黑客、病毒、计算机设备损毁等原因，致使甲方比特币账户中的比特币损失的，乙方应承担相应的赔偿责任。</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;4.2.7</span><span style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">乙方有权根据算力转让方所提供的信息及其他公开信息，自主决定是否将算力转让方的算力转让需求及相关信息通过&ldquo;聚算宝&rdquo;网站向甲方进行展示，用于促成交易。</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;4.2.8</span><span style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">乙方同意甲方通过乙方的&ldquo;聚算宝&rdquo;网站将取得的比特币进行转让。具体转让规则详见&ldquo;聚算宝&rdquo;网站。</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;4.2.9</span><span style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">就协议其他方提供的信息及乙方通过合法渠道获取的与其相关的信息，乙方有权为本协议目的自行管理并使用。</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:18.0pt;mso-pagination:widow-orphan\">\r\n	<b><span lang=\"EN-US\" style=\"font-size:12.0pt;\r\nfont-family:宋体;mso-bidi-font-family:宋体;color:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span></b><b><span style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">第五条 各方共同承诺及保证</span></b><b><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></b></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span><span style=\"font-size:\r\n12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">为履行本协议的目的，各方做出陈述和保证如下：</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;5.1</span><span style=\"font-size:\r\n12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">各方拥有完全的民事权利能力和行为能力签署本协议、享有本协议项下任何权利及履行本协议项下任何义务所必需的一切权利、权力和授权。</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;5.2</span><span style=\"font-size:\r\n12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">签署和履行本协议不违反任何对其适用的法律、法规、规定或命令，也不违反公司现行有效的章程，且已获得所必需的政府机关批准登记和<span lang=\"EN-US\">/</span>或备案；亦不违反任何以其为对象或以其为一方对其资产有约束力的任何合同、协议或其他文件，并已取得了所有必需的第三方的书面同意。</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;5.3</span><span style=\"font-size:\r\n12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">不进行任何破坏或试图破坏网络安全的行为（包括但不限于钓鱼，黑客，网络诈骗，网站或空间中含有或涉嫌散播：病毒、木马、恶意代码，及通过虚拟主机对其他网站、主机进行涉嫌攻击行为如扫描、嗅探、<span lang=\"EN-US\">ARP</span>欺骗、<span lang=\"EN-US\">DOS</span>等）；</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:18.0pt;mso-pagination:widow-orphan\">\r\n	<b><span lang=\"EN-US\" style=\"font-size:12.0pt;\r\nfont-family:宋体;mso-bidi-font-family:宋体;color:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span></b><b><span style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">第六条 费用</span></b><b><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></b></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;6.1</span><span style=\"font-size:\r\n12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">乙方接收甲方委托持有及处分比特币的，甲方应向乙方支付相应服务费，具体的收费标准，以&ldquo;聚算宝&rdquo;网站实际发布的收费标准为准。</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;6.2</span><span style=\"font-size:\r\n12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">各方自行向其主管税务机关申报、缴纳各方应承担的税费，其他方不负责相关事宜处理。</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:18.0pt;mso-pagination:widow-orphan\">\r\n	<b><span lang=\"EN-US\" style=\"font-size:12.0pt;\r\nfont-family:宋体;mso-bidi-font-family:宋体;color:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span></b><b><span style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">第七条 违约债务</span></b><b><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></b></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;7.1</span><span style=\"font-size:\r\n12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">本协议对各方均有约束力，如任何一方未充分履行其根据本协议所负义务或者任何一方根据本协议所作的陈述、承诺或保证是不真实的或者有重大遗漏或误导的，该方应被视为违约；</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;7.2</span><span style=\"font-size:\r\n12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">若任何一方在本协议履行过程中因其违约行为而使其他方遭受任何损失，违约方应向受损方进行合理及全面的补偿（包括对其直接、间接损失和可期得利益的补偿）。</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;7.3</span><span style=\"font-size:\r\n12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">本协议规定的权利和救济是累积的，并不排斥法律规定的其他权利或者救济。本协议所规定各方的义务是特殊、特定、且非一般性的，因此在任何一方违约时，损害赔偿如不足以弥补损失，非违约方有权要求违约方实际履行。</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;7.4</span><span style=\"font-size:\r\n12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">本协议守约方对违约方违约行为的弃权需通过电子数据或书面的方式做出，且该守约方的弃权行为仅对其自身有效，其他守约方仍有权要求违约方承担违约责任。守约方未行使或者迟延行使其在本协议项下的任何权利或者救济不构成该方的弃权；部分行使权利或者救济亦不应阻碍其行使其他权利或者救济。</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;7.5</span><span style=\"font-size:\r\n12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">尽管有本协议其它规定，本条规定的效力不受本协议中止、解除或终止的影响。</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:18.0pt;mso-pagination:widow-orphan\">\r\n	<b><span lang=\"EN-US\" style=\"font-size:12.0pt;\r\nfont-family:宋体;mso-bidi-font-family:宋体;color:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span></b><b><span style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">第八条 通知及送达</span></b><b><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></b></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;8.1</span><span style=\"font-size:\r\n12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">本协议要求的或根据本协议作出的任何通知、请求、要求和其他通信往来应以电子数据方式进行送达。</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;8.2</span><span style=\"font-size:\r\n12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">上述通知或其它通讯往来如以电子邮件形式发送，则一经发出即视为送达；如在&ldquo;聚算宝&rdquo;网站进行公告，则公告期满<span lang=\"EN-US\">3</span>天即视为送达。</span><span lang=\"EN-US\" style=\"font-size:12.0pt;\r\nfont-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;8.3</span><span style=\"font-size:\r\n12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">甲方依据&ldquo;聚算宝&rdquo;网站规则和本协议约定将本协议项下的算力转让与第三人的，由甲方委托&ldquo;聚算宝&rdquo;网站通过网站公告、邮件或短信的方式向算力的出让方发送算力转让通知书。</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:18.0pt;mso-pagination:widow-orphan\">\r\n	<b><span lang=\"EN-US\" style=\"font-size:12.0pt;\r\nfont-family:宋体;mso-bidi-font-family:宋体;color:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span></b><b><span style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">第九条 关于法律适用及管辖</span></b><b><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></b></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;9.1</span><span style=\"font-size:\r\n12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">适用法律。本协议的全部事项，包括但不限于本协议的效力、解释、履行以及争议的解决均受中国法律管辖；本协议项下任一条款如与中国法律中的强制性规范相抵触，应在该等强制性规范所不禁止的最大限度内进行解释和执行，且任何该等与强制性规范相抵触的约定不应影响本协议其他条款的效力。</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;9.2</span><span style=\"font-size:\r\n12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">争议管辖。各方一致同意，如发生争议，不论争议金额大小，均提交深圳市仲裁委员会适用深圳市仲裁委员会仲裁规则项下的简易程序进行仲裁。</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;9.3</span><span style=\"font-size:\r\n12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">在仲裁期间，本协议中不涉及争议的条款仍须履行，各方均不得以解决争议为由拒不履行其在本协议项下的任何义务。</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:18.0pt;mso-pagination:widow-orphan\">\r\n	<b><span lang=\"EN-US\" style=\"font-size:12.0pt;\r\nfont-family:宋体;mso-bidi-font-family:宋体;color:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span></b><b><span style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">第十条 其他</span></b><b><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></b></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;10.1</span><span style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">本协议项下的附件属于本协议不可分割的组成部分。本协议任何条款的标题仅系为方便援引和阅读而设置，不得被用于解释本协议任何条款的依据。</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;10.2</span><span style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">本协议经甲方和乙方在&ldquo;聚算宝&rdquo;网络平台以线上点击确认的方式，其他方统一在&ldquo;聚算宝&rdquo;后台确认的方式订立。本协议各方委托乙方保管所有与本协议有关的书面文件或电子信息。</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;10.3</span><span style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">任何一方在&ldquo;聚算宝&rdquo;网站对本协议进行操作成功确认时，即视为该方接受本协议条款内容并受此内容之拘束；各方均对本协议进行操作成功确认时，本协议即成立。</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\" style=\"line-height:24.0pt;mso-pagination:widow-orphan\">\r\n	<span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;\r\ncolor:black\">&nbsp; &nbsp; &nbsp; &nbsp;&nbsp;10.4</span><span style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体;color:black\">通过&ldquo;聚算宝&rdquo;网站提供的服务，甲方向乙方成功支付算力购买款时，本协议生效。各方确认并同意，乙方（&ldquo;聚算宝&rdquo;）提供的与本协议有关的书面文件或电子信息作为本协议的组成部分。</span><span lang=\"EN-US\" style=\"font-size:12.0pt;font-family:宋体;mso-bidi-font-family:宋体\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\">\r\n	<span lang=\"EN-US\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\">\r\n	<span lang=\"EN-US\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\">\r\n	<span lang=\"EN-US\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\">\r\n	<span lang=\"EN-US\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\">\r\n	<span lang=\"EN-US\" style=\"font-size:14.0pt\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;mso-ascii-font-family:\r\nCalibri;mso-hansi-font-family:Calibri\">甲方：（签字盖章）</span><span lang=\"EN-US\" style=\"font-size:14.0pt\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;</span><span style=\"font-size:\r\n14.0pt;font-family:宋体;mso-ascii-font-family:Calibri;mso-hansi-font-family:Calibri\">乙方：（签字盖章）</span><span lang=\"EN-US\" style=\"font-size:14.0pt\"><o:p></o:p></span></p>\r\n<p class=\"MsoNormal\">\r\n	<span lang=\"EN-US\" style=\"font-size:14.0pt\">&nbsp;</span></p>\r\n<p class=\"MsoNormal\">\r\n	<span style=\"font-size:14.0pt;font-family:宋体;mso-ascii-font-family:\r\nCalibri;mso-hansi-font-family:Calibri\">时间：</span><span lang=\"EN-US\" style=\"font-size:14.0pt\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</span><span style=\"font-size:14.0pt;font-family:宋体;mso-ascii-font-family:Calibri;\r\nmso-hansi-font-family:Calibri\">时间：</span><span lang=\"EN-US\" style=\"font-size:\r\n14.0pt\">&nbsp; <o:p></o:p></span></p>', '', '', '1');
INSERT INTO `cms_article_data` VALUES ('74661', '<p>\r\n	比特币汇率大涨比特币汇率大涨比特币汇率大涨比特币汇率大涨</p>', '', '', '1');
INSERT INTO `cms_article_data` VALUES ('74663', '<p>\r\n	比特币玩家猛增</p>', '', '', '1');
INSERT INTO `cms_article_data` VALUES ('74869', '<p style=\"text-align: center;\">\r\n	<strong><span style=\"font-size:22px;\">公告 </span></strong></p>\r\n<p>\r\n	<span style=\"font-size:20px;\">为让BTC价格兑换透明，技术部门正在对接全球主要交易平台价格指数，下周一将开放提现功能，处理时间周一至周五10:00-17:00.提现产生的手续费将从提现金额中扣除，手续费0.2%，单笔最低2元，最高50元！</span></p>', '', '', '1');
INSERT INTO `cms_article_data` VALUES ('74883', '<p style=\"font: 18px/27px helvetica; margin: 0px 0px 20px; padding: 0px; text-align: justify; color: rgb(80, 80, 80); text-transform: none; text-indent: 0px; letter-spacing: normal; word-spacing: 0px; white-space: normal; -ms-word-wrap: break-word; widows: 1; font-size-adjust: none; font-stretch: normal; background-color: rgb(255, 255, 255); -webkit-text-stroke-width: 0px;\">\r\n	北京时间周一上午7:00，芝加哥期权交易所 (Cboe) 比特币期货上线交易，比特币正式迎来走进华尔街的里程碑时刻。</p>\r\n<p style=\"font: 18px/27px helvetica; margin: 0px 0px 20px; padding: 0px; text-align: justify; color: rgb(80, 80, 80); text-transform: none; text-indent: 0px; letter-spacing: normal; word-spacing: 0px; white-space: normal; -ms-word-wrap: break-word; widows: 1; font-size-adjust: none; font-stretch: normal; background-color: rgb(255, 255, 255); -webkit-text-stroke-width: 0px;\">\r\n	明年1月到期的比特币期货合约<strong style=\"font-weight: 400;\">开盘报15000美元，随后快速上涨，期间两次触发熔断。当前报价18320美元，成交量为1846手。</strong></p>\r\n<p style=\"font: 18px/27px helvetica; margin: 0px 0px 20px; padding: 0px; text-align: justify; color: rgb(80, 80, 80); text-transform: none; text-indent: 0px; letter-spacing: normal; word-spacing: 0px; white-space: normal; -ms-word-wrap: break-word; widows: 1; font-size-adjust: none; font-stretch: normal; background-color: rgb(255, 255, 255); -webkit-text-stroke-width: 0px;\">\r\n	对此，《华尔街日报》援引芝加哥交易机构DRW Holdings LLC旗下虚拟货币交易公司Cumberland的场外交易负责人Bobby Cho评论称，<strong style=\"font-weight: 400;\">很多交易都只有一张合约，这表明大买家或卖家并没有入场。</strong></p>\r\n<p style=\"font: 18px/27px helvetica; margin: 0px 0px 20px; padding: 0px; text-align: justify; color: rgb(80, 80, 80); text-transform: none; text-indent: 0px; letter-spacing: normal; word-spacing: 0px; white-space: normal; -ms-word-wrap: break-word; widows: 1; font-size-adjust: none; font-stretch: normal; background-color: rgb(255, 255, 255); -webkit-text-stroke-width: 0px;\">\r\n	<strong style=\"font-weight: 400;\"><strong style=\"font-weight: 400;\">北京时间9:35，在上述合约涨超10%后，Cboe表示，由于波动性较大，暂停交易两分钟；到了11:05，涨幅进一步扩大至20%，Cboe再次宣布暂停交易。</strong></strong></p>\r\n<p style=\"font: 18px/27px helvetica; margin: 0px 0px 20px; padding: 0px; text-align: justify; color: rgb(80, 80, 80); text-transform: none; text-indent: 0px; letter-spacing: normal; word-spacing: 0px; white-space: normal; -ms-word-wrap: break-word; widows: 1; font-size-adjust: none; font-stretch: normal; background-color: rgb(255, 255, 255); -webkit-text-stroke-width: 0px;\">\r\n	<strong style=\"font-weight: 400;\">比特币现货价格也大幅上涨。据Bitfinex平台报价，在期货交易启动后<strong style=\"font-weight: 400;\">最初五分钟内，比特币由14468美元涨逾1000美元至15647美元，涨幅达8%。当前比特币现货价格进一步升至16289美元，较比特币期货交易开始时涨幅达13%。</strong></strong></p>\r\n<p style=\"font: 18px/27px helvetica; margin: 0px 0px 20px; padding: 0px; text-align: justify; color: rgb(80, 80, 80); text-transform: none; text-indent: 0px; letter-spacing: normal; word-spacing: 0px; white-space: normal; -ms-word-wrap: break-word; widows: 1; font-size-adjust: none; font-stretch: normal; background-color: rgb(255, 255, 255); -webkit-text-stroke-width: 0px;\">\r\n	<strong style=\"font-weight: 400;\"><strong style=\"font-weight: 400;\">Cboe比特币期货合约以现金结算，价格基于Gemini交易所的比特币美元拍卖价格。</strong></strong></p>\r\n<p style=\"font: 18px/27px helvetica; margin: 0px 0px 20px; padding: 0px; text-align: justify; color: rgb(80, 80, 80); text-transform: none; text-indent: 0px; letter-spacing: normal; word-spacing: 0px; white-space: normal; -ms-word-wrap: break-word; widows: 1; font-size-adjust: none; font-stretch: normal; background-color: rgb(255, 255, 255); -webkit-text-stroke-width: 0px;\">\r\n	<strong style=\"font-weight: 400;\"><strong style=\"font-weight: 400;\">在交易启动的最初7分钟内，成交手数不到120手。Cboe比特币期货的一手，即为1个比特币，最小价格波动幅度为10美元。</strong></strong></p>\r\n<p style=\"font: 18px/27px helvetica; margin: 0px 0px 20px; padding: 0px; text-align: justify; color: rgb(80, 80, 80); text-transform: none; text-indent: 0px; letter-spacing: normal; word-spacing: 0px; white-space: normal; -ms-word-wrap: break-word; widows: 1; font-size-adjust: none; font-stretch: normal; background-color: rgb(255, 255, 255); -webkit-text-stroke-width: 0px;\">\r\n	<strong style=\"font-weight: 400;\"><strong style=\"font-weight: 400;\">在上周冲刺20000美元后，比特币进入连日回调。就在Cboe比特币期货正式推出十几个小时前，Bitfinex平台报价显示，<strong style=\"font-weight: 400;\">比特币价格一度大跌近15%，至1.3万美元下方。</strong></strong></strong></p>\r\n<p style=\"font: 18px/27px helvetica; margin: 0px 0px 20px; padding: 0px; text-align: justify; color: rgb(80, 80, 80); text-transform: none; text-indent: 0px; letter-spacing: normal; word-spacing: 0px; white-space: normal; -ms-word-wrap: break-word; widows: 1; font-size-adjust: none; font-stretch: normal; background-color: rgb(255, 255, 255); -webkit-text-stroke-width: 0px;\">\r\n	<strong style=\"font-weight: 400;\"><strong style=\"font-weight: 400;\">交易启动之初，Cboe官网一度瘫痪。截至发稿，Cboe官网主页访问正常，不过其比特币期货价格展示页面仍然无法访问。</strong></strong></p>\r\n<h2 style=\"font: 700 1em/27px helvetica; margin: 10px 0px; padding: 0px; text-align: justify; color: rgb(48, 48, 48); text-transform: none; text-indent: 0px; letter-spacing: normal; word-spacing: 0px; white-space: normal; -ms-word-wrap: break-word; widows: 1; font-size-adjust: none; font-stretch: normal; background-color: rgb(255, 255, 255); -webkit-text-stroke-width: 0px;\">\r\n	<strong style=\"font-weight: 400;\"><strong style=\"font-weight: 400;\">&ldquo;挺进&rdquo;华尔街</strong></strong></h2>\r\n<p style=\"font: 18px/27px helvetica; margin: 0px 0px 20px; padding: 0px; text-align: justify; color: rgb(80, 80, 80); text-transform: none; text-indent: 0px; letter-spacing: normal; word-spacing: 0px; white-space: normal; -ms-word-wrap: break-word; widows: 1; font-size-adjust: none; font-stretch: normal; background-color: rgb(255, 255, 255); -webkit-text-stroke-width: 0px;\">\r\n	<strong style=\"font-weight: 400;\"><strong style=\"font-weight: 400;\">今年以来，比特币价格持续飞涨，市值也接连超过奈飞、大摩、高盛、迪士尼、通用电气等知名上市公司的市值。CoinMarketCap数据显示，比特币最新总市值已达2620亿美元。</strong></strong></p>\r\n<p style=\"font: 18px/27px helvetica; margin: 0px 0px 20px; padding: 0px; text-align: justify; color: rgb(80, 80, 80); text-transform: none; text-indent: 0px; letter-spacing: normal; word-spacing: 0px; white-space: normal; -ms-word-wrap: break-word; widows: 1; font-size-adjust: none; font-stretch: normal; background-color: rgb(255, 255, 255); -webkit-text-stroke-width: 0px;\">\r\n	<strong style=\"font-weight: 400;\">比特币冲破天际的势头，让不少投资者尝到甜头，但是<strong style=\"font-weight: 400;\">对于正规金融机构来说，他们却始终没有合适的渠道参与进去。而为了解决这个&ldquo;痛点&rdquo;，芝加哥商业交易所 (CME) 和Cboe就在推出比特币期货的跑道上开始了明争暗斗。</strong></strong></p>\r\n<p style=\"font: 18px/27px helvetica; margin: 0px 0px 20px; padding: 0px; text-align: justify; color: rgb(80, 80, 80); text-transform: none; text-indent: 0px; letter-spacing: normal; word-spacing: 0px; white-space: normal; -ms-word-wrap: break-word; widows: 1; font-size-adjust: none; font-stretch: normal; background-color: rgb(255, 255, 255); -webkit-text-stroke-width: 0px;\">\r\n	<strong style=\"font-weight: 400;\">CME早在今年10月就在官网上放出了&ldquo;预告&rdquo;，并在12月1日CFTC审查后宣布将于12月18日推出比特币期货交易。当时Cboe的态度是&ldquo;产品还在审，很快就会给大家一个满意的答案&rdquo;。</strong></p>\r\n<p style=\"font: 18px/27px helvetica; margin: 0px 0px 20px; padding: 0px; text-align: justify; color: rgb(80, 80, 80); text-transform: none; text-indent: 0px; letter-spacing: normal; word-spacing: 0px; white-space: normal; -ms-word-wrap: break-word; widows: 1; font-size-adjust: none; font-stretch: normal; background-color: rgb(255, 255, 255); -webkit-text-stroke-width: 0px;\">\r\n	<strong style=\"font-weight: 400;\">12月5日，Cboe的产品也揭开面纱，并且在推出时间比还要比CME早一周。据Cboe公告，其比特币期货将于12月10日在Cboe旗下期货交易所 (CFE) 正式挂牌交易。</strong></p>\r\n<p style=\"font: 18px/27px helvetica; margin: 0px 0px 20px; padding: 0px; text-align: justify; color: rgb(80, 80, 80); text-transform: none; text-indent: 0px; letter-spacing: normal; word-spacing: 0px; white-space: normal; -ms-word-wrap: break-word; widows: 1; font-size-adjust: none; font-stretch: normal; background-color: rgb(255, 255, 255); -webkit-text-stroke-width: 0px;\">\r\n	<strong style=\"font-weight: 400;\">作为一个全新的事物，在比特币期货即将推出之际，来自华尔街的反对声音也越来越大。</strong></p>\r\n<p style=\"font: 18px/27px helvetica; margin: 0px 0px 20px; padding: 0px; text-align: justify; color: rgb(80, 80, 80); text-transform: none; text-indent: 0px; letter-spacing: normal; word-spacing: 0px; white-space: normal; -ms-word-wrap: break-word; widows: 1; font-size-adjust: none; font-stretch: normal; background-color: rgb(255, 255, 255); -webkit-text-stroke-width: 0px;\">\r\n	<strong style=\"font-weight: 400;\">美国期货业协会（FIA）近日致信商品期货交易委员会 (CFTC)，表达他们对比特币期货推出的反对。作为美国期货行业最主要的游说组织，<strong style=\"font-weight: 400;\">FIA会员包括大量银行，在他们看来，美国金融体系根本还未为比特币期货的推出做好准备。</strong></strong></p>\r\n<p style=\"font: 18px/27px helvetica; margin: 0px 0px 20px; padding: 0px; text-align: justify; color: rgb(80, 80, 80); text-transform: none; text-indent: 0px; letter-spacing: normal; word-spacing: 0px; white-space: normal; -ms-word-wrap: break-word; widows: 1; font-size-adjust: none; font-stretch: normal; background-color: rgb(255, 255, 255); -webkit-text-stroke-width: 0px;\">\r\n	<strong style=\"font-weight: 400;\">信中提到，如此仓促的推出比特币期货，并未做到充分透明和接收公众意见。&ldquo;在发布推出这些产品的许可前，我们认为，并未咨询所有相关交易所的风险评估委员会。&rdquo;</strong></p>\r\n<h2 style=\"font: 700 1em/27px helvetica; margin: 10px 0px; padding: 0px; text-align: justify; color: rgb(48, 48, 48); text-transform: none; text-indent: 0px; letter-spacing: normal; word-spacing: 0px; white-space: normal; -ms-word-wrap: break-word; widows: 1; font-size-adjust: none; font-stretch: normal; background-color: rgb(255, 255, 255); -webkit-text-stroke-width: 0px;\">\r\n	<strong style=\"font-weight: 400;\">价格波动给期货交易带来障碍</strong></h2>\r\n<p style=\"font: 18px/27px helvetica; margin: 0px 0px 20px; padding: 0px; text-align: justify; color: rgb(80, 80, 80); text-transform: none; text-indent: 0px; letter-spacing: normal; word-spacing: 0px; white-space: normal; -ms-word-wrap: break-word; widows: 1; font-size-adjust: none; font-stretch: normal; background-color: rgb(255, 255, 255); -webkit-text-stroke-width: 0px;\">\r\n	<strong style=\"font-weight: 400;\">华尔街见闻此前提及，CME和Cboe都将对比特币期货交易设置熔断机制，而比特币一天动辄上千美元的波幅可能令交易多次中断。</strong></p>\r\n<p style=\"font: 18px/27px helvetica; margin: 0px 0px 20px; padding: 0px; text-align: justify; color: rgb(80, 80, 80); text-transform: none; text-indent: 0px; letter-spacing: normal; word-spacing: 0px; white-space: normal; -ms-word-wrap: break-word; widows: 1; font-size-adjust: none; font-stretch: normal; background-color: rgb(255, 255, 255); -webkit-text-stroke-width: 0px;\">\r\n	<strong style=\"font-weight: 400;\"><strong style=\"font-weight: 400;\">Cboe的熔断机制是，涨/跌幅度达到10%，交易暂停2分钟，涨跌幅度达到20%，暂停5分钟。</strong></strong></p>\r\n<p style=\"font: 18px/27px helvetica; margin: 0px 0px 20px; padding: 0px; text-align: justify; color: rgb(80, 80, 80); text-transform: none; text-indent: 0px; letter-spacing: normal; word-spacing: 0px; white-space: normal; -ms-word-wrap: break-word; widows: 1; font-size-adjust: none; font-stretch: normal; background-color: rgb(255, 255, 255); -webkit-text-stroke-width: 0px;\">\r\n	<strong style=\"font-weight: 400;\">CME则对比特币期货波动的限制将分三档，当日内交易价较前一日收盘涨/跌幅度达到7%和13%时，交易可能暂停2分钟后恢复，当波幅达20%时，全天交易可能到此为止。</strong></p>\r\n<p style=\"font: 18px/27px helvetica; margin: 0px 0px 20px; padding: 0px; text-align: justify; color: rgb(80, 80, 80); text-transform: none; text-indent: 0px; letter-spacing: normal; word-spacing: 0px; white-space: normal; -ms-word-wrap: break-word; widows: 1; font-size-adjust: none; font-stretch: normal; background-color: rgb(255, 255, 255); -webkit-text-stroke-width: 0px;\">\r\n	<strong style=\"font-weight: 400;\">金融博客Zerohedge由此估算，若按以上CME规定，<strong style=\"font-weight: 400;\">光美国时间本周四期间，比特币就得几次暂停交易：开盘后不到两小时跌幅已达7%，几小时后跌去13%，在跌幅达到20%以后，比特币当天又一再反弹。</strong></strong></p>\r\n<p style=\"font: 18px/27px helvetica; margin: 0px 0px 20px; padding: 0px; text-align: justify; color: rgb(80, 80, 80); text-transform: none; text-indent: 0px; letter-spacing: normal; word-spacing: 0px; white-space: normal; -ms-word-wrap: break-word; widows: 1; font-size-adjust: none; font-stretch: normal; background-color: rgb(255, 255, 255); -webkit-text-stroke-width: 0px;\">\r\n	<strong style=\"font-weight: 400;\">此外，在比特币期货推出过程中，一个值得注意的细节是，CME规定的期货合约参照的定价基准，是CME自设的比特币参考汇率（BRR：Bitcoin Reference Rate）。</strong></p>\r\n<p style=\"font: 18px/27px helvetica; margin: 0px 0px 20px; padding: 0px; text-align: justify; color: rgb(80, 80, 80); text-transform: none; text-indent: 0px; letter-spacing: normal; word-spacing: 0px; white-space: normal; -ms-word-wrap: break-word; widows: 1; font-size-adjust: none; font-stretch: normal; background-color: rgb(255, 255, 255); -webkit-text-stroke-width: 0px;\">\r\n	<strong style=\"font-weight: 400;\">这个BRR是怎么来的？华尔街见闻《主编精选》此前文章提到，这个参考价是从几个比特币交易所成交价的加权平均价计算而来，这些交易所目前包括：Bitstamp，GDAX，itBit和Kraken，但偏偏就是没有包括目前全球最大流动性最好的交易所&mdash;&mdash;Bitfinex的成交价。</strong></p>\r\n<p style=\"font: 18px/27px helvetica; margin: 0px 0px 20px; padding: 0px; text-align: justify; color: rgb(80, 80, 80); text-transform: none; text-indent: 0px; letter-spacing: normal; word-spacing: 0px; white-space: normal; -ms-word-wrap: break-word; widows: 1; font-size-adjust: none; font-stretch: normal; background-color: rgb(255, 255, 255); -webkit-text-stroke-width: 0px;\">\r\n	<strong style=\"font-weight: 400;\">很显然，CME这么做可能是不想让&ldquo;实物&rdquo;比特币的成交来影响和主导期货价格（加入Bitfinex后由于其权重大，价格将被该平台的成交价主导），而是希望用期货交易影响比特币的价格，继而通过传统金融系统的交易来&ldquo;控制&rdquo;游离于传统金融体系之外，但又拥有金融属性的比特币的价格。</strong></p>\r\n<p style=\"font: 18px/27px helvetica; margin: 0px 0px 20px; padding: 0px; text-align: justify; color: rgb(80, 80, 80); text-transform: none; text-indent: 0px; letter-spacing: normal; word-spacing: 0px; white-space: normal; -ms-word-wrap: break-word; widows: 1; font-size-adjust: none; font-stretch: normal; background-color: rgb(255, 255, 255); -webkit-text-stroke-width: 0px;\">\r\n	&nbsp;</p>', '聚算宝', '', '1');
