INSERT INTO `mining_machine` VALUES ('74308', '期货1月10日', '2000.00', '10000', '2606', '0.0001700000', '2.80', '/userfiles/1/images/machine/miningMachine/2017/11/slpro-img01.png', '2018-01-20', '0', '1', null, '1', '2017-11-10 21:08:16', '1', '2017-12-12 13:20:40', '&lt;h1 style=&quot;font-family: &amp;quot;microsoft yahei&amp;quot;; font-size: 26px; height: 50px; color: rgb(0, 0, 0); font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px;&quot;&gt;\r\n	用户协议&lt;/h1&gt;\r\n&lt;h3 style=&quot;font-family: &amp;quot;microsoft yahei&amp;quot;; font-size: 14px; font-weight: bold; height: 30px; padding-bottom: 2px; color: rgb(0, 0, 0); font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px;&quot;&gt;\r\n	一、服务条款&lt;/h3&gt;\r\n&lt;p style=&quot;font-family: &amp;quot;microsoft yahei&amp;quot;; line-height: 25px; padding-bottom: 10px; font-size: 14px; color: rgb(0, 0, 0); font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px;&quot;&gt;\r\n	途牛旅游网提供的服务将完全按照其发布的使用协议、服务条款和操作规则严格执行。为获得途牛服务，服务使用人（以下称&amp;ldquo;会员&amp;rdquo;）应当同意本协议的全部条款并按照页面上的提示完成全部的注册程序。&lt;/p&gt;\r\n&lt;h3 style=&quot;font-family: &amp;quot;microsoft yahei&amp;quot;; font-size: 14px; font-weight: bold; height: 30px; padding-bottom: 2px; color: rgb(0, 0, 0); font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px;&quot;&gt;\r\n	二、目的&lt;/h3&gt;\r\n&lt;p style=&quot;font-family: &amp;quot;microsoft yahei&amp;quot;; line-height: 25px; padding-bottom: 10px; font-size: 14px; color: rgb(0, 0, 0); font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px;&quot;&gt;\r\n	本协议是以规定用户使用途牛旅游网提供的服务时，途牛旅游网与会员间的权利、义务、服务条款等基本事宜为目的。&lt;/p&gt;\r\n&lt;h3 style=&quot;font-family: &amp;quot;microsoft yahei&amp;quot;; font-size: 14px; font-weight: bold; height: 30px; padding-bottom: 2px; color: rgb(0, 0, 0); font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px;&quot;&gt;\r\n	三、遵守法律及法律效力&lt;/h3&gt;\r\n&lt;p style=&quot;font-family: &amp;quot;microsoft yahei&amp;quot;; line-height: 25px; padding-bottom: 10px; font-size: 14px; color: rgb(0, 0, 0); font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px;&quot;&gt;\r\n	本服务使用协议在向会员公告后，开始提供服务或以其他方式向会员提供服务同时产生法律效力。&lt;/p&gt;\r\n&lt;p style=&quot;font-family: &amp;quot;microsoft yahei&amp;quot;; line-height: 25px; padding-bottom: 10px; font-size: 14px; color: rgb(0, 0, 0); font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px;&quot;&gt;\r\n	会员同意遵守《中华人民共和国保密法》、《计算机信息系统国际联网保密管理规定》、《中华人民共和国计算机信息系统安全保护条例》、《计算机信息网络国际联网安全保护管理办法》、《中华人民共和国计算机信息网络国际联网管理暂行规定》及其实施办法等相关法律法规的任何及所有的规定，并对会员以任何方式使用服务的任何行为及其结果承担全部责任。&lt;/p&gt;\r\n&lt;p style=&quot;font-family: &amp;quot;microsoft yahei&amp;quot;; line-height: 25px; padding-bottom: 10px; font-size: 14px; color: rgb(0, 0, 0); font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px;&quot;&gt;\r\n	在任何情况下，如果本网站合理地认为会员的任何行为，包括但不限于会员的任何言论和其他行为违反或可能违反上述法律和法规的任何规定，本网站可在任何时候不经任何事先通知终止向会员提供服务。&lt;/p&gt;\r\n&lt;p style=&quot;font-family: &amp;quot;microsoft yahei&amp;quot;; line-height: 25px; padding-bottom: 10px; font-size: 14px; color: rgb(0, 0, 0); font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px;&quot;&gt;\r\n	本网站可能不时的修改本协议的有关条款，一旦条款内容发生变动，本网站将会在相关的页面提示修改内容。在更改此使用服务协议时，本网站将说明更改内容的执行日期，变更理由等。且应同现行的使用服务协议一起，在更改内容发生效力前7日内及发生效力前日向会员公告。&lt;/p&gt;\r\n&lt;p style=&quot;font-family: &amp;quot;microsoft yahei&amp;quot;; line-height: 25px; padding-bottom: 10px; font-size: 14px; color: rgb(0, 0, 0); font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px;&quot;&gt;\r\n	会员需仔细阅读使用服务协议更改内容，会员由于不知变更内容所带来的伤害，本网站一概不予负责。&lt;/p&gt;\r\n&lt;p style=&quot;font-family: &amp;quot;microsoft yahei&amp;quot;; line-height: 25px; padding-bottom: 10px; font-size: 14px; color: rgb(0, 0, 0); font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px;&quot;&gt;\r\n	如果不同意本网站对服务条款所做的修改，用户有权停止使用网络服务。如果用户继续使用网络服务，则视为用户接受服务条款的变动。&lt;/p&gt;\r\n&lt;h3 style=&quot;font-family: &amp;quot;microsoft yahei&amp;quot;; font-size: 14px; font-weight: bold; height: 30px; padding-bottom: 2px; color: rgb(0, 0, 0); font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px;&quot;&gt;\r\n	四、服务内容&lt;/h3&gt;\r\n&lt;p style=&quot;font-family: &amp;quot;microsoft yahei&amp;quot;; line-height: 25px; padding-bottom: 10px; font-size: 14px; color: rgb(0, 0, 0); font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px;&quot;&gt;\r\n	途牛服务的具体内容由本网站根据实际情况提供，本网站保留随时变更、中断或终止部分或全部途牛服务的权利。&lt;/p&gt;\r\n&lt;h3 style=&quot;font-family: &amp;quot;microsoft yahei&amp;quot;; font-size: 14px; font-weight: bold; height: 30px; padding-bottom: 2px; color: rgb(0, 0, 0); font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px;&quot;&gt;\r\n	五、会员的义务&lt;/h3&gt;\r\n&lt;p style=&quot;font-family: &amp;quot;microsoft yahei&amp;quot;; line-height: 25px; padding-bottom: 10px; font-size: 14px; color: rgb(0, 0, 0); font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px;&quot;&gt;\r\n	用户在申请使用本网站途牛服务时，必须向本网站提供准确的个人资料，如个人资料有任何变动，必须及时更新。&lt;/p&gt;\r\n&lt;p style=&quot;font-family: &amp;quot;microsoft yahei&amp;quot;; line-height: 25px; padding-bottom: 10px; font-size: 14px; color: rgb(0, 0, 0); font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px;&quot;&gt;\r\n	用户注册成功后，本网站将给予每个用户一个用户帐号及相应的密码，该用户帐号和密码由用户负责保管；用户应当对以其用户帐号进行的所有活动和事件负法律责任。&lt;/p&gt;\r\n&lt;p style=&quot;font-family: &amp;quot;microsoft yahei&amp;quot;; line-height: 25px; padding-bottom: 10px; font-size: 14px; color: rgb(0, 0, 0); font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px;&quot;&gt;\r\n	用户在使用本网站网络服务过程中，必须遵循以下原则：&lt;/p&gt;\r\n&lt;ul style=&quot;font-family: &amp;quot;microsoft yahei&amp;quot;; font-size: 14px; color: rgb(0, 0, 0); font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px;&quot;&gt;\r\n	&lt;li&gt;\r\n		遵守中国有关的法律和法规；&lt;/li&gt;\r\n	&lt;li&gt;\r\n		不得为任何非法目的而使用网络服务系统；&lt;/li&gt;\r\n	&lt;li&gt;\r\n		遵守所有与网络服务有关的网络协议、规定和程序；&lt;/li&gt;\r\n	&lt;li&gt;\r\n		不得利用途牛服务系统传输任何危害社会，侵蚀道德风尚，宣传不法宗教组织等内容；&lt;/li&gt;\r\n	&lt;li&gt;\r\n		不得利用途牛服务系统进行任何可能对互联网的正常运转造成不利影响的行为；&lt;/li&gt;\r\n	&lt;li&gt;\r\n		不得利用途牛服务系统上载、张贴或传送任何非法、有害、胁迫、滥用、骚扰、侵害、中伤、粗俗、猥亵、诽谤、侵害他人隐私、辱骂性的、恐吓性的、庸俗淫秽的及有害或种族歧视的或道德上令人不快的包括其他任何非法的信息资料；&lt;/li&gt;\r\n	&lt;li&gt;\r\n		不得利用途牛服务系统进行任何不利于本网站的行为；&lt;/li&gt;\r\n	&lt;li&gt;\r\n		如发现任何非法使用用户帐号或帐号出现安全漏洞的情况，应立即通告本网站。&lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;h3 style=&quot;font-family: &amp;quot;microsoft yahei&amp;quot;; font-size: 14px; font-weight: bold; height: 30px; padding-bottom: 2px; color: rgb(0, 0, 0); font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px;&quot;&gt;\r\n	六、本网站的权利及义务&lt;/h3&gt;\r\n&lt;p style=&quot;font-family: &amp;quot;microsoft yahei&amp;quot;; line-height: 25px; padding-bottom: 10px; font-size: 14px; color: rgb(0, 0, 0); font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px;&quot;&gt;\r\n	本网站除特殊情况外（例如：协助公安等相关部门调查破案等），致力于努力保护会员的个人资料不被外漏，且不得在未经本人的同意下向第三者提供会员的个人资料。&lt;/p&gt;\r\n&lt;p style=&quot;font-family: &amp;quot;microsoft yahei&amp;quot;; line-height: 25px; padding-bottom: 10px; font-size: 14px; color: rgb(0, 0, 0); font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px;&quot;&gt;\r\n	本网站根据提供服务的过程，经营上的变化，无需向会员得到同意即可更改，变更所提供服务的内容。&lt;/p&gt;\r\n&lt;p style=&quot;font-family: &amp;quot;microsoft yahei&amp;quot;; line-height: 25px; padding-bottom: 10px; font-size: 14px; color: rgb(0, 0, 0); font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px;&quot;&gt;\r\n	本网站在提供服务过程中，应及时解决会员提出的不满事宜，如在解决过程中确有难处，可以采取公开通知方式或向会员发送电子邮件寻求解决办法。&lt;/p&gt;\r\n&lt;p style=&quot;font-family: &amp;quot;microsoft yahei&amp;quot;; line-height: 25px; padding-bottom: 10px; font-size: 14px; color: rgb(0, 0, 0); font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px;&quot;&gt;\r\n	本网站在下列情况下可以不通过向会员通知，直接删除其上载的内容：&lt;/p&gt;\r\n&lt;ul style=&quot;font-family: &amp;quot;microsoft yahei&amp;quot;; font-size: 14px; color: rgb(0, 0, 0); font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px;&quot;&gt;\r\n	&lt;li&gt;\r\n		有损于本网站，会员或第三者名誉的内容；&lt;/li&gt;\r\n	&lt;li&gt;\r\n		利用途牛服务系统上载、张贴或传送任何非法、有害、胁迫、滥用、骚扰、侵害、中伤、粗俗、猥亵、诽谤、侵害他人隐私、辱骂性的、恐吓性的、庸俗淫秽的及有害或种族歧视的或道德上令人不快的包括其他任何非法的内容；&lt;/li&gt;\r\n	&lt;li&gt;\r\n		侵害本网站或第三者的版权，著作权等内容；&lt;/li&gt;\r\n	&lt;li&gt;\r\n		存在与本网站提供的服务无关的内容；&lt;/li&gt;\r\n	&lt;li&gt;\r\n		无故盗用他人的ID(固有用户名)，姓名上载、张贴或传送任何内容及恶意更改，伪造他人上载内容。&lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;h3 style=&quot;font-family: &amp;quot;microsoft yahei&amp;quot;; font-size: 14px; font-weight: bold; height: 30px; padding-bottom: 2px; color: rgb(0, 0, 0); font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px;&quot;&gt;\r\n	七、知识产权声明&lt;/h3&gt;\r\n&lt;p style=&quot;font-family: &amp;quot;microsoft yahei&amp;quot;; line-height: 25px; padding-bottom: 10px; font-size: 14px; color: rgb(0, 0, 0); font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px;&quot;&gt;\r\n	本网站（www.tuniu.com）所有的产品、技术、程序、页面（包括但不限于页面设计及内容）以及资料内容（包括但不限于本站所刊载的图片、视频、Flash等）均属于知识产权，仅供本用户交流、学习、研究和欣赏，未经授权，任何人不得擅自使用，否则，将依法追究法律责任。&lt;/p&gt;\r\n&lt;p style=&quot;font-family: &amp;quot;microsoft yahei&amp;quot;; line-height: 25px; padding-bottom: 10px; font-size: 14px; color: rgb(0, 0, 0); font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px;&quot;&gt;\r\n	本网站用户在攻略及论坛频道上传的资料内容（包括但不限于图片、视频、Flash、点评等），应保证为原创或已得到充分授权，并具有准确性、真实性、正当性、合法性，且不含任何侵犯第三人权益的内容，因抄袭、转载、侵权等行为所产生的纠纷由用户自行解决，本网站不承担任何法律责任。&lt;/p&gt;\r\n&lt;p style=&quot;font-family: &amp;quot;microsoft yahei&amp;quot;; line-height: 25px; padding-bottom: 10px; font-size: 14px; color: rgb(0, 0, 0); font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px;&quot;&gt;\r\n	&amp;ldquo;途牛旅游网&amp;rdquo;、牛头（图形）及&amp;ldquo;tuniu.com&amp;rdquo;组合为南京途牛科技有限公司注册商标，任何人不得擅自使用，否则，将依法追究法律责任。&lt;/p&gt;\r\n&lt;h3 style=&quot;font-family: &amp;quot;microsoft yahei&amp;quot;; font-size: 14px; font-weight: bold; height: 30px; padding-bottom: 2px; color: rgb(0, 0, 0); font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px;&quot;&gt;\r\n	八、免责声明&lt;/h3&gt;\r\n&lt;p style=&quot;font-family: &amp;quot;microsoft yahei&amp;quot;; line-height: 25px; padding-bottom: 10px; font-size: 14px; color: rgb(0, 0, 0); font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px;&quot;&gt;\r\n	任何人因使用本网站而可能遭致的意外及其造成的损失（包括因下载本网站可能链接的第三方网站内容而感染电脑病毒），我们对此概不负责，亦不承担任何法律责任。&lt;/p&gt;\r\n&lt;p style=&quot;font-family: &amp;quot;microsoft yahei&amp;quot;; line-height: 25px; padding-bottom: 10px; font-size: 14px; color: rgb(0, 0, 0); font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px;&quot;&gt;\r\n	本网站禁止制作、复制、发布、传播等具有反动、色情、暴力、淫秽等内容的信息，一经发现，立即删除。若您因此触犯法律，我们对此不承担任何法律责任。&lt;/p&gt;\r\n&lt;p style=&quot;font-family: &amp;quot;microsoft yahei&amp;quot;; line-height: 25px; padding-bottom: 10px; font-size: 14px; color: rgb(0, 0, 0); font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px;&quot;&gt;\r\n	本网站会员自行上传或通过网络收集的资源，我们仅提供一个展示、交流的平台，不对其内容的准确性、真实性、正当性、合法性负责，也不承担任何法律责任。&lt;/p&gt;\r\n&lt;p style=&quot;font-family: &amp;quot;microsoft yahei&amp;quot;; line-height: 25px; padding-bottom: 10px; font-size: 14px; color: rgb(0, 0, 0); font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px;&quot;&gt;\r\n	任何单位或个人认为通过本网站网页内容可能涉嫌侵犯其著作权，应该及时向我们提出书面权利通知，并提供身份证明、权属证明及详细侵权情况证明。我们收到上述法律文件后，将会依法尽快处理。&lt;/p&gt;\r\n&lt;h3 style=&quot;font-family: &amp;quot;microsoft yahei&amp;quot;; font-size: 14px; font-weight: bold; height: 30px; padding-bottom: 2px; color: rgb(0, 0, 0); font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px;&quot;&gt;\r\n	九、服务变更、中断或终止&lt;/h3&gt;\r\n&lt;p style=&quot;font-family: &amp;quot;microsoft yahei&amp;quot;; line-height: 25px; padding-bottom: 10px; font-size: 14px; color: rgb(0, 0, 0); font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px;&quot;&gt;\r\n	如因系统维护或升级的需要而需暂停途牛服务，本网站将尽可能事先进行通告。&lt;/p&gt;\r\n&lt;p style=&quot;font-family: &amp;quot;microsoft yahei&amp;quot;; line-height: 25px; padding-bottom: 10px; font-size: 14px; color: rgb(0, 0, 0); font-style: normal; font-variant-ligatures: normal; font-variant-caps: normal; font-weight: normal; letter-spacing: normal; orphans: 2; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-stroke-width: 0px;&quot;&gt;\r\n	如发生下列任何一种情形，本网站有&lt;/p&gt;', '0');
INSERT INTO `mining_machine` VALUES ('74309', '现货12月10日', '2500.00', '1000', '562', '0.0001700000', '2.80', '/userfiles/1/images/machine/miningMachine/2017/11/slpro-img01.png', '2017-12-10', '0', '1T', null, '1', '2017-11-10 21:12:12', '1', '2017-12-12 13:20:28', '&lt;h1 class=&quot;tac f30 col333&quot; style=&quot;margin: 0px; padding: 55px 0px 40px; text-align: center !important; font-family: Arial, Helvetica, &amp;quot;Microsoft YaHei&amp;quot;; font-size: 30px; font-weight: normal; white-space: normal;&quot;&gt;\r\n	比特币会成为法定货币吗？&lt;/h1&gt;\r\n&lt;p style=&quot;margin: 0px; padding: 0px; color: rgb(85, 85, 85); font-family: Arial, Helvetica, &amp;quot;Microsoft YaHei&amp;quot;; font-size: 16px; white-space: normal;&quot;&gt;\r\n	&lt;span class=&quot;tac f14 col9c time&quot; style=&quot;text-align: center !important; color: rgb(156, 156, 156) !important; padding-bottom: 40px; font-size: 14px !important; display: block; white-space: normal;&quot;&gt;时间：2017-06-29&lt;/span&gt;&lt;/p&gt;\r\n&lt;div class=&quot;text&quot; style=&quot;color: rgb(85, 85, 85); overflow: hidden; padding-bottom: 80px; font-family: Arial, Helvetica, &amp;quot;Microsoft YaHei&amp;quot;; white-space: normal;&quot;&gt;\r\n	&lt;p style=&quot;margin: 0px; padding: 0px 0px 15px; text-indent: 2em;&quot;&gt;\r\n		&amp;nbsp;&lt;/p&gt;\r\n	&lt;p style=&quot;margin: 0px; padding: 0px 0px 15px; text-indent: 2em;&quot;&gt;\r\n		一般来说，货币有四大职能，分别是价值计量、支付结算、流通手段和价值贮藏。其中，比特币在改善支付和流通手段方面最有可为。事实上，改善支付手段都未必需要比特币，支付宝和微信支付这些第三方支付都可以做得更好。&lt;/p&gt;\r\n	&lt;p style=&quot;margin: 0px; padding: 0px 0px 15px; text-align: center; text-indent: 2em;&quot;&gt;\r\n		&lt;img alt=&quot;比特币会成为法定货币吗？&quot; border=&quot;0&quot; height=&quot;300&quot; src=&quot;http://www.58btc.com/uploads/images/1b4384a08564b2752646e7525940425f.jpg&quot; style=&quot;width: 508px; height: 300px; vertical-align: top;&quot; title=&quot;比特币会成为法定货币吗？&quot; vspace=&quot;0&quot; width=&quot;508&quot; /&gt;&lt;/p&gt;\r\n	&lt;p style=&quot;margin: 0px; padding: 0px 0px 15px; text-indent: 2em;&quot;&gt;\r\n		不过，比特币不能解决价值计量问题。表面上看，比特币的供应量和生产都由算法决定，似乎可以通过算法来确认比特币的价值。问题是，算法是无穷的，如何确认不同算法生产出来的这些币的不同价值呢？&lt;/p&gt;\r\n	&lt;p style=&quot;margin: 0px; padding: 0px 0px 15px; text-indent: 2em;&quot;&gt;\r\n		比特币也不能解决价值贮藏问题。作为天选之子，比特币综合了各种成功必需的因素，包括那个最要命的运气。这里面最重要的因素是拥护比特币的人们对其可能成为未来法定货币的想象共同体。但是，如果有一天这个想象共同体不存在了呢？那么比特币很可能像曾经的&amp;ldquo;郁金香热&amp;rdquo;里那些郁金香一样。甚至还不如郁金香，因为郁金香不具有金融投机属性以后，至少还有作为花的使用价值。&lt;/p&gt;\r\n	&lt;p style=&quot;margin: 0px; padding: 0px 0px 15px; text-indent: 2em;&quot;&gt;\r\n		比特币宣称要去中心化，不需要权威机构来管理比特币。嗯，这样的想法渗透着自由和民主的血液。但是，自由和民主并不是绝对的，绝对的自由其实并不自由，而绝对的民主也并不民主。试想一下，像左右货币供应量这样大的利益，如果真的没有中心，会不会出现霍布斯在《利维坦》中所论述的那样，当自然状态出现时，出现一切人对一切人的战争？&lt;/p&gt;\r\n	&lt;p style=&quot;margin: 0px; padding: 0px 0px 15px; text-indent: 2em;&quot;&gt;\r\n		比特币一直强调由算法决定供应量，没有政府和银行来发行比特币，持有比特币就可以免于货币政策的影响。这种由于货币超发导致的货币贬值，确实是信用货币体系下一个问题，而且影响人们生活的各个方面。大家希望手里的货币不要贬值，这种理想可以理解，但是希望持有的货币不受货币政策影响，这样的想法是有问题的。&lt;/p&gt;\r\n	&lt;p style=&quot;margin: 0px; padding: 0px 0px 15px; text-indent: 2em;&quot;&gt;\r\n		在人类的发展历程中，从实物货币到信用货币，货币的作用是逐步变大的。所以，在现今信用货币体系下，货币政策的作用不仅是调节货币供应量，还有一个重要作用是管理预期。&lt;/p&gt;\r\n	&lt;p style=&quot;margin: 0px; padding: 0px 0px 15px; text-indent: 2em;&quot;&gt;\r\n		为什么要管理预期？因为世界是不确定的，尤其在现代商业社会，参与经济活动的人数空前巨大，使得不确定性更加突出。在如何应对经济不确定性方面，人类发明了一个伟大的工具，就是预期管理。再看比特币，确定性是其一个重要的特点。所谓成也萧何，败也萧何。确定的供应量是比特币吸引人的一个重要特点，也是阻止比特币成为未来法定数字货币的绊脚石。因为，确定的货币供应量，无法用来管理预期。当然了，比特币也许本来就没打算管理预期，甚至就没有管理这个事。&lt;/p&gt;\r\n	&lt;p style=&quot;margin: 0px; padding: 0px 0px 15px; text-indent: 2em;&quot;&gt;\r\n		虽然现在有不少国家的央行成立专门机构研究法定数字货币，可以预见，在当前的商业经济环境下，在现行的货币理论体系下，比特币不会成为未来法定数字货币。不过，如果区块链和比特币改变了货币的理论体系和市场规则，也许有不同的结果。&lt;/p&gt;\r\n&lt;/div&gt;\r\n&lt;p&gt;\r\n	&amp;nbsp;&lt;/p&gt;', '0');
