;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt; mso-pagination: widow-orphan;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;2.2.1 &lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;算力服务的价格 （按照实际价格为准）&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt; mso-pagination: widow-orphan;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;该项算力服务名称为聚算宝云挖矿合约，期货每份合约代表矿机&lt;span lang=&quot;EN-US&quot;&gt;1T&lt;/span&gt;的算力，售价为&lt;span lang=&quot;EN-US&quot;&gt;2000&lt;/span&gt;元&lt;span lang=&quot;EN-US&quot;&gt;/T&lt;/span&gt;。现货每份合约代表矿机&lt;span lang=&quot;EN-US&quot;&gt;1T&lt;/span&gt;的算力，售价为&lt;span lang=&quot;EN-US&quot;&gt;2500&lt;/span&gt;元&lt;span lang=&quot;EN-US&quot;&gt;/T&lt;/span&gt;。&lt;span lang=&quot;EN-US&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt; mso-pagination: widow-orphan;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: red; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt; mso-pagination: widow-orphan;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp;2.2.2&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;甲方应支付的算购买价格为：&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt; mso-pagination: widow-orphan;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;甲方应支付的算力购买价格&lt;span lang=&quot;EN-US&quot;&gt;=&lt;/span&gt;【&lt;span lang=&quot;EN-US&quot;&gt; &amp;nbsp;&amp;nbsp;&lt;/span&gt;】&lt;span lang=&quot;EN-US&quot;&gt;T*&lt;/span&gt;【 &amp;nbsp;&lt;span lang=&quot;EN-US&quot;&gt;&amp;nbsp;&lt;/span&gt;】元&lt;span lang=&quot;EN-US&quot;&gt;/&lt;/span&gt;每&lt;span lang=&quot;EN-US&quot;&gt;T&lt;/span&gt;&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt; mso-pagination: widow-orphan;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;2.3 &lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;收益的分配&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt; mso-pagination: widow-orphan;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;2.3.1 &lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;乙方将算力挖矿产生的比特币收益结算给甲方，结算时间为&lt;span lang=&quot;EN-US&quot;&gt;T+1&lt;/span&gt;。用户收益以矿池实际产生的收益为准。即一旦矿池通过挖矿获得比特币，即按固定的方案计算分配甲方。算力在运转过程中，实际算力大小会小幅上下浮动，产生的比特币收益也会随之上下浮动。&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt; mso-pagination: widow-orphan;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;color: red; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&amp;nbsp;&amp;nbsp;&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;2.3.2&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;甲方每日应得的比特币数量为每日扣除管理费后的比特币数量，即：&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt; mso-pagination: widow-orphan;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;color: red; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;甲方每日应得比特币数量&lt;span lang=&quot;EN-US&quot;&gt;=&lt;/span&gt;甲方购买的算力／&lt;span lang=&quot;EN-US&quot;&gt;T&lt;/span&gt;&amp;times;&lt;span lang=&quot;EN-US&quot;&gt;100%&lt;/span&gt;&amp;times;乙方取得的比特币&lt;span lang=&quot;EN-US&quot;&gt;-&lt;/span&gt;当日电费&lt;span lang=&quot;EN-US&quot;&gt;/&lt;/span&gt;当日比特币市价。&lt;span lang=&quot;EN-US&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt; mso-pagination: widow-orphan;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;其中：&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt; mso-pagination: widow-orphan;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;（&lt;span lang=&quot;EN-US&quot;&gt;1&lt;/span&gt;）用户应付电费按&lt;span lang=&quot;EN-US&quot;&gt;0.4&lt;/span&gt;元每度的价格以&lt;span lang=&quot;EN-US&quot;&gt;120W/T&lt;/span&gt;的功耗计算；&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt; mso-pagination: widow-orphan;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;（&lt;span lang=&quot;EN-US&quot;&gt;2&lt;/span&gt;）随着矿机设备的折旧等因素，实际算力会小幅下降。甲方所得比特币收益按实际算力产出的比特币为准。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt; mso-pagination: widow-orphan;&quot;&gt;\r\n	&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;（&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;3&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;）每月&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;1&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;号为停电维护时间，因算力不实际运作，当天甲方不需要交电费给乙方，当天的比特币收益为&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;0&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;。&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt; mso-pagination: widow-orphan;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;2.3.3 &lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;乙方与甲方之间采用比特币结算，乙方每天同甲方结算一次比特币即：&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt; mso-pagination: widow-orphan;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;（&lt;span lang=&quot;EN-US&quot;&gt;1&lt;/span&gt;）乙方应每日计算甲方应分配的比特币；&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt; mso-pagination: widow-orphan;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;（&lt;span lang=&quot;EN-US&quot;&gt;2&lt;/span&gt;）每天乙方将当日甲方应分配的比特币一次性支付给甲方。&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt; mso-pagination: widow-orphan;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;2.3.4 &lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;若连续十天聚算宝挖矿产出的比特币收益小于电费，则合约终止，甲方不再享有比特币收益，算力残值归甲方所有。由乙方共同将算力残值处理之后按比特币市场价格将比特币打至甲方账户。&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 18pt; mso-pagination: widow-orphan;&quot;&gt;\r\n	&lt;b&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;&lt;/span&gt;&lt;/b&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 18pt; mso-pagination: widow-orphan;&quot;&gt;\r\n	&lt;b&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;第三条 权利及义务&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/b&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt; mso-pagination: widow-orphan;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;各方已认真阅读和理解本协议所有内容并自愿按本协议相关约定履行各自的权利义务。&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt; mso-pagination: widow-orphan;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;3.1 &lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;甲方权利及义务&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt; mso-pagination: widow-orphan;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;3.1.1 &lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;甲方应通过乙方运营管理的&amp;ldquo;聚算宝&amp;rdquo;网站注册，成为乙方的会员。&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt; mso-pagination: widow-orphan;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;3.1.2&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;甲方首次在&amp;ldquo;聚算宝&amp;rdquo;网站购买算力的，应通过乙方和其合作的支付机构的实名认证，实名认证的流程如下：&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt; mso-pagination: widow-orphan;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;（&lt;span lang=&quot;EN-US&quot;&gt;1&lt;/span&gt;）甲方在&amp;ldquo;聚算宝&amp;rdquo;网站登陆会员账户，按照系统提示的流程进行实名认证。甲方在实名认证时应按照提示输入真实的姓名、身份证号码、手机号码及银行卡号，其中银行卡号必须是以甲方本人名义登记，银行卡号开立时所预留的手机号码和实名认证时提交的手机号码必须一致。&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt; mso-pagination: widow-orphan;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;（&lt;span lang=&quot;EN-US&quot;&gt;2&lt;/span&gt;）甲方按照系统提示的程序通过乙方实名认证的同时，支付机构通过与乙方的链接即完成对甲方在支付平台上的实名认证。&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt; mso-pagination: widow-orphan;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;3.1.2 &lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;甲方同意由乙方接收、保管与本次算力购买有关的所有合同、协议等文件、资料。&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt; mso-pagination: widow-orphan;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;3.1.3 &lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;甲方通过乙方的链接在支付平台上进行实名认证时，即已经充分知晓允许支付平台：&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt; mso-pagination: widow-orphan;&quot;&gt;\r\n	&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;（&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;1&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;）在甲方按照第&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;3.1.3&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;条的约定购买算力时，支付平台可以直接从甲方实名认证时的银行账户或在支付平台上开立的第三方账户中扣除相应的算力购买价款并向乙方支付。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt; mso-pagination: widow-orphan;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;（&lt;span lang=&quot;EN-US&quot;&gt;2&lt;/span&gt;）乙方按照第&lt;span lang=&quot;EN-US&quot;&gt;3.4&lt;/span&gt;条的约定为甲方处置比特币后，直接将相应款项通过支付平台支付至甲方实名认证时的银行账户或在支付平台上开立的第三方支付账户。&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt; mso-pagination: widow-orphan;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;因支付平台的问题，致使甲方遭受损失的，乙方不承担赔偿责任，由甲方自行向支付平台请求赔偿。&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt; mso-pagination: widow-orphan;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;3.1.4 &lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;甲方有权按照约定从乙方处分配比特币。&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt; mso-pagination: widow-orphan;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;3.1.5&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;甲方比特币账户的比特币系甲方所有，甲方享有占有、使用、收益和处分的权利。&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt; mso-pagination: widow-orphan;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;3.1.6&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;甲方应自行承担因比特币市场的波动所导致的本金损失风险或实际收益低于预期收益的风险。&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt; mso-pagination: widow-orphan;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;3.1.7&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;甲方有义务按照&amp;ldquo;聚算宝&amp;rdquo;网站的要求提供真实的信息，因甲方提供虚假信息而造成的一切法律后果（包括但不限于民事赔偿、行政处罚、刑事责任等）均由甲方承担。&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt; mso-pagination: widow-orphan;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;3.1.8&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;甲方本人的住所电话、手机号码、账户信息如出现变更的，应在变更后三日内通过&amp;ldquo;聚算宝&amp;rdquo;网站向其他各方提供变更后的最新信息。若因甲方未及时提供最新信息而导致其自身和&lt;span lang=&quot;EN-US&quot;&gt;/&lt;/span&gt;或任何其他方遭受损失的，应由甲方承担。&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt; mso-pagination: widow-orphan;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;3.1.9&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;甲方有义务按照&amp;ldquo;聚算宝&amp;rdquo;网站的要求使用网站以及收取乙方发出的所有消息（包括但不限于网站通知、电子邮件、手机短信等），因甲方个人操作不当或疏于查收信息造成的损失由甲方自行承担。&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt; mso-pagination: widow-orphan;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;3.1.10&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;因甲方自身的原因导致乙方在提供服务时发生任何错误而产生的任何损失或责任，由甲方自行负责，乙方承担责任。&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt; mso-pagination: widow-orphan;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;3.1.11&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;甲方承诺对本协议涉及的比特币购买价款具有完全的支配能力，是其自有闲散资金，为其合法所得。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt; mso-pagination: widow-orphan;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;3.1.12&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;甲方在算力购买和比特币持有及处分过程中产生的相关税费，由甲方自行向主管税务机关申报、缴纳，但如果中国税收法律法规规定其他各方具有代扣代缴义务，则其他各方有权直接代扣代缴并向甲方提供纳税凭证。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt; mso-pagination: widow-orphan;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;3.1.13 &lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;由于火灾、水灾等不可抗拒因素导致的算力设备的损毁从而导致的损失由甲方承担。&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt; mso-pagination: widow-orphan;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;3.2 &lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;乙方的权利及其义务&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt; mso-pagination: widow-orphan;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;3.2.1 &lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;乙方应按照本协议的约定，为甲方建立独立的人民币账户及比特币账户。乙方应按照本协议的规定，恪尽职守，以诚实、信用、谨慎、有效管理的原则为甲乙双方进行服务。&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt; mso-pagination: widow-orphan;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;3.2.2 &lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;乙方作为算力的提供方，应保证算力的正常供应，因算力未及时到位给用户造成的损失由乙方承担。若算力未及时供应时长超过&lt;span lang=&quot;EN-US&quot;&gt;20&lt;/span&gt;天，乙方需将用户的资金返还给用户。&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt; mso-pagination: widow-orphan;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;3.2.3 &lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;矿场及矿机设备中在实际运转过程中若出现问题，乙方应及时告知甲方并共同协商解决方案。&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt; mso-pagination: widow-orphan;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;3.2.4&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;乙方承诺对本次算力出售过程中获取的协议各方的信息、资产情况及其他服务相关信息和资料依法保密。&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt; mso-pagination: widow-orphan;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;3.2.5 &lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;乙方应按照甲方的委托或指示购买和&lt;span lang=&quot;EN-US&quot;&gt;/&lt;/span&gt;或处分甲方比特币账户的比特币。未经甲方允许，乙方不得擅自处分。因乙方擅自处分致使甲方遭受损失的，乙方应对甲方的损失承担赔偿责任。&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt; mso-pagination: widow-orphan;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;3.2.6 &lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;甲方在比特币账户中的比特币系甲方所有，乙方应妥善管理和处分。鉴于比特币的网络虚拟性，乙方应保证其网络系统的正常运行，因黑客、病毒、计算机设备损毁等原因，致使甲方比特币账户中的比特币损失的，乙方应承担相应的赔偿责任。&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt; mso-pagination: widow-orphan;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;3.2.7&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;乙方有权根据算力转让方所提供的信息及其他公开信息，自主决定是否将算力转让方的算力转让需求及相关信息通过&amp;ldquo;聚算宝&amp;rdquo;网站向甲方进行展示，用于促成交易。&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt; mso-pagination: widow-orphan;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;3.2.8&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;乙方同意甲方通过乙方的&amp;ldquo;聚算宝&amp;rdquo;网站将取得的比特币进行转让。具体转让规则详见&amp;ldquo;聚算宝&amp;rdquo;网站。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt; mso-pagination: widow-orphan;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;3.2.9&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;就协议其他方提供的信息及乙方通过合法渠道获取的与其相关的信息，乙方有权为本协议目的自行管理并使用。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 18pt; mso-pagination: widow-orphan;&quot;&gt;\r\n	&lt;b&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;第四条 各方共同承诺及保证&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/b&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt; mso-pagination: widow-orphan;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;为履行本协议的目的，各方做出陈述和保证如下：&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt; mso-pagination: widow-orphan;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;4.1&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;各方拥有完全的民事权利能力和行为能力签署本协议、享有本协议项下任何权利及履行本协议项下任何义务所必需的一切权利、权力和授权。&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt; mso-pagination: widow-orphan;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;4.2&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;签署和履行本协议不违反任何对其适用的法律、法规、规定或命令，也不违反公司现行有效的章程，且已获得所必需的政府机关批准登记和&lt;span lang=&quot;EN-US&quot;&gt;/&lt;/span&gt;或备案；亦不违反任何以其为对象或以其为一方对其资产有约束力的任何合同、协议或其他文件，并已取得了所有必需的第三方的书面同意。&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt; mso-pagination: widow-orphan;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;4.3&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;不进行任何破坏或试图破坏网络安全的行为（包括但不限于钓鱼，黑客，网络诈骗，网站或空间中含有或涉嫌散播：病毒、木马、恶意代码，及通过虚拟主机对其他网站、主机进行涉嫌攻击行为如扫描、嗅探、&lt;span lang=&quot;EN-US&quot;&gt;ARP&lt;/span&gt;欺骗、&lt;span lang=&quot;EN-US&quot;&gt;DOS&lt;/span&gt;等）；&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 18pt; mso-pagination: widow-orphan;&quot;&gt;\r\n	&lt;b&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;第五条 费用&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/b&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt; mso-pagination: widow-orphan;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;5.1&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;乙方接收甲方委托持有及处分比特币的，甲方应向乙方支付相应服务费，具体的收费标准，以&amp;ldquo;聚算宝&amp;rdquo;网站实际发布的收费标准为准。&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt; mso-pagination: widow-orphan;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;5.2&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;各方自行向其主管税务机关申报、缴纳各方应承担的税费，其他方不负责相关事宜处理。&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 18pt; mso-pagination: widow-orphan;&quot;&gt;\r\n	&lt;b&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;第六条 违约债务&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/b&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt; mso-pagination: widow-orphan;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;6.1&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;本协议对各方均有约束力，如任何一方未充分履行其根据本协议所负义务或者任何一方根据本协议所作的陈述、承诺或保证是不真实的或者有重大遗漏或误导的，该方应被视为违约；&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt; mso-pagination: widow-orphan;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;6.2&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;若任何一方在本协议履行过程中因其违约行为而使其他方遭受任何损失，违约方应向受损方进行合理及全面的补偿（包括对其直接、间接损失和可期得利益的补偿）。&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体; mso-font-kerning: 1.0pt; mso-ansi-language: EN-US; mso-fareast-language: ZH-CN; mso-bidi-language: AR-SA;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;6.3&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体; mso-font-kerning: 1.0pt; mso-ansi-language: EN-US; mso-fareast-language: ZH-CN; mso-bidi-language: AR-SA;&quot;&gt;本协议规定的权利和救济是累积的，并不排斥法律规定的其他权利或者救济。本协议所规定各方的义务是特殊、特定、且非一般性的，因此在&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt; mso-pagination: widow-orphan;&quot;&gt;\r\n	&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;任何一方违约时，损害赔偿如不足以弥补损失，非违约方有权要求违约方实际履行。&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt; mso-pagination: widow-orphan;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;6.4&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;本协议守约方对违约方违约行为的弃权需通过电子数据或书面的方式做出，且该守约方的弃权行为仅对其自身有效，其他守约方仍有权要求违约方承担违约责任。守约方未行使或者迟延行使其在本协议项下的任何权利或者救济不构成该方的弃权；部分行使权利或者救济亦不应阻碍其行使其他权利或者救济。&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt; mso-pagination: widow-orphan;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;6.5&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;尽管有本协议其它规定，本条规定的效力不受本协议中止、解除或终止的影响。&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 18pt; mso-pagination: widow-orphan;&quot;&gt;\r\n	&lt;b&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;第七条 通知及送达&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/b&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt; mso-pagination: widow-orphan;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;7.1&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;本协议要求的或根据本协议作出的任何通知、请求、要求和其他通信往来应以电子数据方式进行送达。&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt; mso-pagination: widow-orphan;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;7.2&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;上述通知或其它通讯往来如以电子邮件形式发送，则一经发出即视为送达；如在&amp;ldquo;聚算宝&amp;rdquo;网站进行公告，则公告期满&lt;span lang=&quot;EN-US&quot;&gt;3&lt;/span&gt;天即视为送达。&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt; mso-pagination: widow-orphan;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;7.3&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;甲方依据&amp;ldquo;聚算宝&amp;rdquo;网站规则和本协议约定将本协议项下的算力转让与第三人的，由甲方委托&amp;ldquo;聚算宝&amp;rdquo;网站通过网站公告、邮件或短信的方式向算力的出让方发送算力转让通知书。&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 18pt; mso-pagination: widow-orphan;&quot;&gt;\r\n	&lt;b&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;第八条 关于法律适用及管辖&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/b&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt; mso-pagination: widow-orphan;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;8.1&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;适用法律。本协议的全部事项，包括但不限于本协议的效力、解释、履行以及争议的解决均受中国法律管辖；本协议项下任一条款如与中国法律中的强制性规范相抵触，应在该等强制性规范所不禁止的最大限度内进行解释和执行，且任何该等与强制性规范相抵触的约定不应影响本协议其他条款的效力。&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt; mso-pagination: widow-orphan;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;8.2&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;争议管辖。各方一致同意，如发生争议，不论争议金额大小，均提交深圳市仲裁委员会适用深圳市仲裁委员会仲裁规则项下的简易程序进行仲裁。&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt; mso-pagination: widow-orphan;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;8.3&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;在仲裁期间，本协议中不涉及争议的条款仍须履行，各方均不得以解决争议为由拒不履行其在本协议项下的任何义务。&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 18pt; mso-pagination: widow-orphan;&quot;&gt;\r\n	&lt;b&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;第九条 其他&lt;/span&gt;&lt;/b&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 18pt; mso-pagination: widow-orphan;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;9.1&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;本协议项下的附件属于本协议不可分割的组成部分。本协议任何条款的标题仅系为方便援引和阅读而设置，不得被用于解释本协议任何条款的依据。&lt;/span&gt;&lt;b&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/b&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt; mso-pagination: widow-orphan;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;9.2&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;本协议经甲方和乙方在&amp;ldquo;聚算宝&amp;rdquo;网络平台以线上点击确认的方式，其他方统一在&amp;ldquo;聚算宝&amp;rdquo;后台确认的方式订立。本协议各方委托乙方保管所有与本协议有关的书面文件或电子信息。&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt; mso-pagination: widow-orphan;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;9.3&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;任何一方在&amp;ldquo;聚算宝&amp;rdquo;网站对本协议进行操作成功确认时，即视为该方接受本协议条款内容并受此内容之拘束；各方均对本协议进行操作成功确认时，本协议即成立。&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt; mso-pagination: widow-orphan;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;9.4&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;通过&amp;ldquo;聚算宝&amp;rdquo;网站提供的服务，甲方向乙方成功支付算力购买款时，本协议生效。各方确认并同意，乙方（&amp;ldquo;聚算宝&amp;rdquo;）提供的与本协议有关的书面文件或电子信息作为本协议的组成部分。&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 14pt;&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 14pt;&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 14pt;&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	&lt;span style=&quot;font-family: 宋体; font-size: 14pt; mso-ascii-font-family: Calibri; mso-hansi-font-family: Calibri;&quot;&gt;甲方：（签字盖章）&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 14pt;&quot;&gt;&amp;nbsp;&amp;nbsp; &amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-family: 宋体; font-size: 14pt; mso-ascii-font-family: Calibri; mso-hansi-font-family: Calibri;&quot;&gt;乙方：（签字盖章）&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 14pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 14pt;&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	&lt;span style=&quot;font-family: 宋体; font-size: 14pt; mso-ascii-font-family: Calibri; mso-hansi-font-family: Calibri;&quot;&gt;时间：&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 14pt;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-family: 宋体; font-size: 14pt; mso-ascii-font-family: Calibri; mso-hansi-font-family: Calibri;&quot;&gt;时间：&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 14pt;&quot;&gt;&amp;nbsp; &lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt; mso-pagination: widow-orphan;&quot;&gt;\r\n	&amp;nbsp;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt; mso-pagination: widow-orphan;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt; mso-pagination: widow-orphan;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt; mso-pagination: widow-orphan;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt; mso-pagination: widow-orphan;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt; mso-bidi-font-family: 宋体;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;', '0');
INSERT INTO `mining_machine` VALUES ('74882', '期货1月20日', '2500.00', '2000', '1096', '0.0001528200', '2.80', '/userfiles/1/images/machine/miningMachine/2017/11/slpro-img01.png', '2018-01-20', '1', '1', null, '1', '2017-12-11 13:50:56', '1', '2017-12-19 11:42:55', '&lt;h1 align=&quot;center&quot; style=&quot;text-align: center; line-height: 42pt;&quot;&gt;\r\n	&lt;span style=&quot;color: black;&quot;&gt;聚算宝购买协议&lt;span lang=&quot;EN-US&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/h1&gt;\r\n&lt;p style=&quot;line-height: 18pt;&quot;&gt;\r\n	&lt;b&gt;&lt;span style=&quot;color: black; font-family: 宋体;&quot;&gt;甲 方：&lt;u&gt;&lt;span lang=&quot;EN-US&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/span&gt;&lt;/u&gt;&lt;span lang=&quot;EN-US&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/b&gt;&lt;/p&gt;\r\n&lt;p style=&quot;line-height: 18pt;&quot;&gt;\r\n	&lt;b&gt;&lt;span style=&quot;color: black; font-family: 宋体;&quot;&gt;身份证&lt;span lang=&quot;EN-US&quot;&gt;/&lt;/span&gt;组织机构代码证编号：&lt;u&gt;&lt;span lang=&quot;EN-US&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/span&gt;&lt;/u&gt;&lt;span lang=&quot;EN-US&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/b&gt;&lt;/p&gt;\r\n&lt;p style=&quot;line-height: 18pt;&quot;&gt;\r\n	&lt;b&gt;&lt;span style=&quot;color: black; font-family: 宋体;&quot;&gt;住址：&lt;u&gt;&lt;span lang=&quot;EN-US&quot;&gt;&amp;nbsp;&amp;nbsp; &amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&lt;/span&gt;&lt;/u&gt;&lt;span lang=&quot;EN-US&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/b&gt;&lt;/p&gt;\r\n&lt;p style=&quot;line-height: 18pt;&quot;&gt;\r\n	&lt;b&gt;&lt;span style=&quot;color: black; font-family: 宋体;&quot;&gt;联系电话：&lt;u&gt;&lt;span lang=&quot;EN-US&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/span&gt;&lt;/u&gt;&lt;span lang=&quot;EN-US&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/b&gt;&lt;/p&gt;\r\n&lt;p align=&quot;left&quot; class=&quot;MsoNormal&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p style=&quot;line-height: 18pt;&quot;&gt;\r\n	&lt;b&gt;&lt;span style=&quot;color: black; font-family: 宋体;&quot;&gt;乙 方&lt;span lang=&quot;EN-US&quot;&gt;:&lt;/span&gt;&lt;u&gt;深圳锦晖区块链科技有限公司&lt;span lang=&quot;EN-US&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &lt;/span&gt;&lt;/u&gt;&lt;span lang=&quot;EN-US&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/b&gt;&lt;/p&gt;\r\n&lt;p style=&quot;line-height: 18pt;&quot;&gt;\r\n	&lt;b&gt;&lt;span style=&quot;color: black; font-family: 宋体;&quot;&gt;住 所&lt;span lang=&quot;EN-US&quot;&gt;:&lt;/span&gt;&lt;u&gt;深圳市福田区福田街道滨河大道&lt;span lang=&quot;EN-US&quot;&gt;5022&lt;/span&gt;号联合广场&lt;span lang=&quot;EN-US&quot;&gt;A&lt;/span&gt;座&lt;span lang=&quot;EN-US&quot;&gt;18&lt;/span&gt;楼&lt;span lang=&quot;EN-US&quot;&gt;1812&lt;/span&gt;&lt;/u&gt;&lt;span lang=&quot;EN-US&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/b&gt;&lt;/p&gt;\r\n&lt;p style=&quot;line-height: 18pt;&quot;&gt;\r\n	&lt;b&gt;&lt;span style=&quot;color: black; font-family: 宋体;&quot;&gt;法定代表人&lt;span lang=&quot;EN-US&quot;&gt;/&lt;/span&gt;负责人&lt;span lang=&quot;EN-US&quot;&gt;:&lt;u&gt;&amp;nbsp;&lt;/u&gt;&lt;/span&gt;&lt;u&gt;朱晖&lt;span lang=&quot;EN-US&quot;&gt;&amp;nbsp; &lt;/span&gt;&lt;/u&gt;&lt;span lang=&quot;EN-US&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/b&gt;&lt;/p&gt;\r\n&lt;p style=&quot;line-height: 18pt;&quot;&gt;\r\n	&lt;b&gt;&lt;span style=&quot;color: black; font-family: 宋体;&quot;&gt;联系电话&lt;span lang=&quot;EN-US&quot;&gt;:&lt;u&gt;&amp;nbsp;0755-82770917 &lt;/u&gt;&lt;/span&gt;&lt;u&gt;或 &lt;span lang=&quot;EN-US&quot;&gt;4008093628&amp;nbsp; &amp;nbsp;&lt;/span&gt;&lt;/u&gt;&lt;span lang=&quot;EN-US&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/b&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 18pt;&quot;&gt;\r\n	&lt;b&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;本协议项下甲乙双方单独称&amp;ldquo;一方&amp;rdquo;，合称&amp;ldquo;各方&amp;rdquo;。&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/b&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 18pt;&quot;&gt;\r\n	&lt;b&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;第一条 释义&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/b&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;除非上下文另有解释，下列用于具有以下含义&lt;span lang=&quot;EN-US&quot;&gt;:&lt;/span&gt;&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;1.1&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;ldquo;比特币&amp;rdquo;最初的概念在&lt;span lang=&quot;EN-US&quot;&gt;2009&lt;/span&gt;年提出，比特币的生成是建立在计算机开源软件以及建构其上的&lt;span lang=&quot;EN-US&quot;&gt;P2P&lt;/span&gt;网络基础上。&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;1.1.1&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;比特币的具体生成流程：&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;（&lt;span lang=&quot;EN-US&quot;&gt;1&lt;/span&gt;）下载专用的比特币运算工具，即为一种特定的计算机程序；&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;（&lt;span lang=&quot;EN-US&quot;&gt;2&lt;/span&gt;）然后注册相应的合作网站；&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;（&lt;span lang=&quot;EN-US&quot;&gt;3&lt;/span&gt;）把注册来的用户名和密码填入计算程序中，再点击运算就正式开始；&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;（&lt;span lang=&quot;EN-US&quot;&gt;4&lt;/span&gt;）计算机依照算法进行大量的运算，从而生成特解，所生成的特解均为&lt;span lang=&quot;EN-US&quot;&gt;64&lt;/span&gt;位的数字，为比特币的&lt;span lang=&quot;EN-US&quot;&gt;P2P&lt;/span&gt;网络所需要；&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;（&lt;span lang=&quot;EN-US&quot;&gt;5&lt;/span&gt;）作为奖励，用户的电脑在成功的生成比特币网络所需要的特解时，即可获得相应数量的比特币。&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;1.1.2 &lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;比特币具有以下特征&lt;span lang=&quot;EN-US&quot;&gt;:&lt;/span&gt;&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;（&lt;span lang=&quot;EN-US&quot;&gt;1&lt;/span&gt;）本质上是由计算机生成的一串串复杂代码组成&lt;span lang=&quot;EN-US&quot;&gt;,&lt;/span&gt;属于计算信息系统数据；&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;（&lt;span lang=&quot;EN-US&quot;&gt;2&lt;/span&gt;）比特币不是由货币当局发行，不具有法偿性与强制性等货币属性；&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;（&lt;span lang=&quot;EN-US&quot;&gt;3&lt;/span&gt;）比特币是一种特定的虚拟商品，不具有与货币等同的法律地位，不能且不应作为货币在市场上流通使用；&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;（&lt;span lang=&quot;EN-US&quot;&gt;4&lt;/span&gt;）作为一种虚拟商品， 比特币可以通过计算机信息系统交易，其价格会由于供需等各种原因产生波动；&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;（&lt;span lang=&quot;EN-US&quot;&gt;5&lt;/span&gt;）比特币可以通过交易变现成货币，但是作为一种虚拟商品，比特币无实物的性质。&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;1.2 &lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;ldquo;算力&amp;rdquo;是指计算机的运算能力。&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;1.3 &lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;ldquo;挖矿&amp;rdquo;本协议中将通过网络下载专用的比特币运算工具，并利用计算机的运算能力进行大量的运算，从而生成&lt;span lang=&quot;EN-US&quot;&gt;P2P&lt;/span&gt;网络所需要的特解，每生成一个特解，即可获得相应数量的比特币作为奖励的过程称为挖矿。&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;1.4&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;ldquo;矿机&amp;rdquo;可以为&amp;ldquo;挖矿&amp;rdquo;提供所需要的运算能力的计算机。&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;1.5&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;ldquo;矿场&amp;rdquo;是指为了更为有效的通过挖矿获得比特币，选择特定的地点（包括但不限于厂房、住宅或办公楼等）集中安放运行数量众多的矿机。本协议中，将集中在某一特定地点安放运行的数量众多的矿机称为&amp;ldquo;矿场&amp;rdquo;。&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;1.6&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;ldquo;矿池&amp;rdquo;&lt;span lang=&quot;EN-US&quot;&gt;:&lt;/span&gt;处于&lt;span lang=&quot;EN-US&quot;&gt;P2P&lt;/span&gt;网络中的每一台矿机可以独立挖矿，也可以选择和其他的矿机联合一起挖矿。我们将联合众多矿机或矿场共同挖矿，并将挖矿所得的比特币按照特定的分配方式分配给参与挖矿的矿机或矿场的网络平台称为矿池。&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;1.7 &lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;ldquo;算力残值&amp;rdquo;是指矿机通过挖矿难以获得收益之后矿机硬件的价值。&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;1.8&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;ldquo;比特币钱包&amp;rdquo;：用于接收和存放比特币的网络地址，是大约&lt;span lang=&quot;EN-US&quot;&gt;33&lt;/span&gt;位长的、由字母和数字构成的一串字符，总是由&lt;span lang=&quot;EN-US&quot;&gt;1&lt;/span&gt;或者&lt;span lang=&quot;EN-US&quot;&gt;3&lt;/span&gt;开头。&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp;1.9 &lt;/span&gt;&lt;span style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;ldquo;聚算宝&amp;rdquo;：指由乙方深圳锦晖区块链科技有限司运营管理的互联网电子商务信息居间撮合服务平台，&amp;ldquo;聚算宝&amp;rdquo;的网络域名为【&lt;span lang=&quot;EN-US&quot;&gt;www.hke1688.com&lt;/span&gt;】。&lt;span lang=&quot;EN-US&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;1.10&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;支付机构：指在本协议各方之间作为中介机构提供资金转移服务的银行或第三方支付结算机构。&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;1.11 &lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;支付平台：指由支付机构运营的管理支付平台。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;1.12&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;本协议：指本《聚算宝购买协议》，及为实现、补充和修改《聚算宝购买协议》而签署的其他协议、合同、修正函、附件、声明函等文件。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;1.13&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;法律：指现行有效并公布实施的法律、行政法规、规章、司法解释及监管部门的决定、通知等，本协议中的法律仅指中国法律，不包括香港特别行政区、澳门特别行政区和台湾地区的法律。&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;1.14&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;元：指本协议中的元，除非特别说明，在本协议指人民币。&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 18pt;&quot;&gt;\r\n	&lt;b&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;第二条 购买算力&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/b&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;2.1 &lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;甲方意欲参与比特币的挖矿，乙方提供算力及矿机托管服务，现甲方通过购买乙方一定份额的算力来参与比特币的挖矿。&lt;span lang=&quot;EN-US&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;2.2 &lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;算力购买&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;2.2.1 &lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;算力服务的价格 （按照实际价格为准）&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;该项算力服务名称为聚算宝云挖矿合约，期货每份合约代表矿机&lt;span lang=&quot;EN-US&quot;&gt;1T&lt;/span&gt;的算力，售价为&lt;span lang=&quot;EN-US&quot;&gt;2000&lt;/span&gt;元&lt;span lang=&quot;EN-US&quot;&gt;/T&lt;/span&gt;。现货每份合约代表矿机&lt;span lang=&quot;EN-US&quot;&gt;1T&lt;/span&gt;的算力，售价为&lt;span lang=&quot;EN-US&quot;&gt;2500&lt;/span&gt;元&lt;span lang=&quot;EN-US&quot;&gt;/T&lt;/span&gt;。&lt;span lang=&quot;EN-US&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: red; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp;2.2.2&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;甲方应支付的算购买价格为：&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;甲方应支付的算力购买价格&lt;span lang=&quot;EN-US&quot;&gt;=&lt;/span&gt;【&lt;span lang=&quot;EN-US&quot;&gt; &amp;nbsp;&amp;nbsp;&lt;/span&gt;】&lt;span lang=&quot;EN-US&quot;&gt;T*&lt;/span&gt;【 &amp;nbsp;&lt;span lang=&quot;EN-US&quot;&gt;&amp;nbsp;&lt;/span&gt;】元&lt;span lang=&quot;EN-US&quot;&gt;/&lt;/span&gt;每&lt;span lang=&quot;EN-US&quot;&gt;T&lt;/span&gt;&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;2.3 &lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;收益的分配&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;2.3.1 &lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;乙方将算力挖矿产生的比特币收益结算给甲方，结算时间为&lt;span lang=&quot;EN-US&quot;&gt;T+1&lt;/span&gt;。用户收益以矿池实际产生的收益为准。即一旦矿池通过挖矿获得比特币，即按固定的方案计算分配甲方。算力在运转过程中，实际算力大小会小幅上下浮动，产生的比特币收益也会随之上下浮动。&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;color: red; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp;&amp;nbsp;&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;2.3.2&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;甲方每日应得的比特币数量为每日扣除管理费后的比特币数量，即：&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;color: red; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;甲方每日应得比特币数量&lt;span lang=&quot;EN-US&quot;&gt;=&lt;/span&gt;甲方购买的算力／&lt;span lang=&quot;EN-US&quot;&gt;T&lt;/span&gt;&amp;times;&lt;span lang=&quot;EN-US&quot;&gt;100%&lt;/span&gt;&amp;times;乙方取得的比特币&lt;span lang=&quot;EN-US&quot;&gt;-&lt;/span&gt;当日电费&lt;span lang=&quot;EN-US&quot;&gt;/&lt;/span&gt;当日比特币市价。&lt;span lang=&quot;EN-US&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;其中：&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;（&lt;span lang=&quot;EN-US&quot;&gt;1&lt;/span&gt;）用户应付电费按&lt;span lang=&quot;EN-US&quot;&gt;0.4&lt;/span&gt;元每度的价格以&lt;span lang=&quot;EN-US&quot;&gt;120W/T&lt;/span&gt;的功耗计算；&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;（&lt;span lang=&quot;EN-US&quot;&gt;2&lt;/span&gt;）随着矿机设备的折旧等因素，实际算力会小幅下降。甲方所得比特币收益按实际算力产出的比特币为准。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;（&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;3&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;）每月&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;1&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;号为停电维护时间，因算力不实际运作，当天甲方不需要交电费给乙方，当天的比特币收益为&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;0&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;。&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;2.3.3 &lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;乙方与甲方之间采用比特币结算，乙方每天同甲方结算一次比特币即：&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;（&lt;span lang=&quot;EN-US&quot;&gt;1&lt;/span&gt;）乙方应每日计算甲方应分配的比特币；&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;（&lt;span lang=&quot;EN-US&quot;&gt;2&lt;/span&gt;）每天乙方将当日甲方应分配的比特币一次性支付给甲方。&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;2.3.4 &lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;若连续十天聚算宝挖矿产出的比特币收益小于电费，则合约终止，甲方不再享有比特币收益，算力残值归甲方所有。由乙方共同将算力残值处理之后按比特币市场价格将比特币打至甲方账户。&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 18pt;&quot;&gt;\r\n	&lt;b&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;&lt;/span&gt;&lt;/b&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 18pt;&quot;&gt;\r\n	&lt;b&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;第三条 权利及义务&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/b&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;各方已认真阅读和理解本协议所有内容并自愿按本协议相关约定履行各自的权利义务。&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;3.1 &lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;甲方权利及义务&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;3.1.1 &lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;甲方应通过乙方运营管理的&amp;ldquo;聚算宝&amp;rdquo;网站注册，成为乙方的会员。&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;3.1.2&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;甲方首次在&amp;ldquo;聚算宝&amp;rdquo;网站购买算力的，应通过乙方和其合作的支付机构的实名认证，实名认证的流程如下：&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;（&lt;span lang=&quot;EN-US&quot;&gt;1&lt;/span&gt;）甲方在&amp;ldquo;聚算宝&amp;rdquo;网站登陆会员账户，按照系统提示的流程进行实名认证。甲方在实名认证时应按照提示输入真实的姓名、身份证号码、手机号码及银行卡号，其中银行卡号必须是以甲方本人名义登记，银行卡号开立时所预留的手机号码和实名认证时提交的手机号码必须一致。&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;（&lt;span lang=&quot;EN-US&quot;&gt;2&lt;/span&gt;）甲方按照系统提示的程序通过乙方实名认证的同时，支付机构通过与乙方的链接即完成对甲方在支付平台上的实名认证。&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;3.1.2 &lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;甲方同意由乙方接收、保管与本次算力购买有关的所有合同、协议等文件、资料。&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;3.1.3 &lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;甲方通过乙方的链接在支付平台上进行实名认证时，即已经充分知晓允许支付平台：&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;（&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;1&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;）在甲方按照第&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;3.1.3&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;条的约定购买算力时，支付平台可以直接从甲方实名认证时的银行账户或在支付平台上开立的第三方账户中扣除相应的算力购买价款并向乙方支付。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;（&lt;span lang=&quot;EN-US&quot;&gt;2&lt;/span&gt;）乙方按照第&lt;span lang=&quot;EN-US&quot;&gt;3.4&lt;/span&gt;条的约定为甲方处置比特币后，直接将相应款项通过支付平台支付至甲方实名认证时的银行账户或在支付平台上开立的第三方支付账户。&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;因支付平台的问题，致使甲方遭受损失的，乙方不承担赔偿责任，由甲方自行向支付平台请求赔偿。&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;3.1.4 &lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;甲方有权按照约定从乙方处分配比特币。&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;3.1.5&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;甲方比特币账户的比特币系甲方所有，甲方享有占有、使用、收益和处分的权利。&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;3.1.6&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;甲方应自行承担因比特币市场的波动所导致的本金损失风险或实际收益低于预期收益的风险。&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;3.1.7&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;甲方有义务按照&amp;ldquo;聚算宝&amp;rdquo;网站的要求提供真实的信息，因甲方提供虚假信息而造成的一切法律后果（包括但不限于民事赔偿、行政处罚、刑事责任等）均由甲方承担。&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;3.1.8&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;甲方本人的住所电话、手机号码、账户信息如出现变更的，应在变更后三日内通过&amp;ldquo;聚算宝&amp;rdquo;网站向其他各方提供变更后的最新信息。若因甲方未及时提供最新信息而导致其自身和&lt;span lang=&quot;EN-US&quot;&gt;/&lt;/span&gt;或任何其他方遭受损失的，应由甲方承担。&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;3.1.9&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;甲方有义务按照&amp;ldquo;聚算宝&amp;rdquo;网站的要求使用网站以及收取乙方发出的所有消息（包括但不限于网站通知、电子邮件、手机短信等），因甲方个人操作不当或疏于查收信息造成的损失由甲方自行承担。&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;3.1.10&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;因甲方自身的原因导致乙方在提供服务时发生任何错误而产生的任何损失或责任，由甲方自行负责，乙方承担责任。&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;3.1.11&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;甲方承诺对本协议涉及的比特币购买价款具有完全的支配能力，是其自有闲散资金，为其合法所得。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;3.1.12&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;甲方在算力购买和比特币持有及处分过程中产生的相关税费，由甲方自行向主管税务机关申报、缴纳，但如果中国税收法律法规规定其他各方具有代扣代缴义务，则其他各方有权直接代扣代缴并向甲方提供纳税凭证。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;3.1.13 &lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;由于火灾、水灾等不可抗拒因素导致的算力设备的损毁从而导致的损失由甲方承担。&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;3.2 &lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;乙方的权利及其义务&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;3.2.1 &lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;乙方应按照本协议的约定，为甲方建立独立的人民币账户及比特币账户。乙方应按照本协议的规定，恪尽职守，以诚实、信用、谨慎、有效管理的原则为甲乙双方进行服务。&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;3.2.2 &lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;乙方作为算力的提供方，应保证算力的正常供应，因算力未及时到位给用户造成的损失由乙方承担。若算力未及时供应时长超过&lt;span lang=&quot;EN-US&quot;&gt;20&lt;/span&gt;天，乙方需将用户的资金返还给用户。&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;3.2.3 &lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;矿场及矿机设备中在实际运转过程中若出现问题，乙方应及时告知甲方并共同协商解决方案。&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;3.2.4&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;乙方承诺对本次算力出售过程中获取的协议各方的信息、资产情况及其他服务相关信息和资料依法保密。&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;3.2.5 &lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;乙方应按照甲方的委托或指示购买和&lt;span lang=&quot;EN-US&quot;&gt;/&lt;/span&gt;或处分甲方比特币账户的比特币。未经甲方允许，乙方不得擅自处分。因乙方擅自处分致使甲方遭受损失的，乙方应对甲方的损失承担赔偿责任。&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;3.2.6 &lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;甲方在比特币账户中的比特币系甲方所有，乙方应妥善管理和处分。鉴于比特币的网络虚拟性，乙方应保证其网络系统的正常运行，因黑客、病毒、计算机设备损毁等原因，致使甲方比特币账户中的比特币损失的，乙方应承担相应的赔偿责任。&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;3.2.7&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;乙方有权根据算力转让方所提供的信息及其他公开信息，自主决定是否将算力转让方的算力转让需求及相关信息通过&amp;ldquo;聚算宝&amp;rdquo;网站向甲方进行展示，用于促成交易。&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;3.2.8&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;乙方同意甲方通过乙方的&amp;ldquo;聚算宝&amp;rdquo;网站将取得的比特币进行转让。具体转让规则详见&amp;ldquo;聚算宝&amp;rdquo;网站。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;3.2.9&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;就协议其他方提供的信息及乙方通过合法渠道获取的与其相关的信息，乙方有权为本协议目的自行管理并使用。&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 18pt;&quot;&gt;\r\n	&lt;b&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;第四条 各方共同承诺及保证&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/b&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;为履行本协议的目的，各方做出陈述和保证如下：&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;4.1&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;各方拥有完全的民事权利能力和行为能力签署本协议、享有本协议项下任何权利及履行本协议项下任何义务所必需的一切权利、权力和授权。&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;4.2&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;签署和履行本协议不违反任何对其适用的法律、法规、规定或命令，也不违反公司现行有效的章程，且已获得所必需的政府机关批准登记和&lt;span lang=&quot;EN-US&quot;&gt;/&lt;/span&gt;或备案；亦不违反任何以其为对象或以其为一方对其资产有约束力的任何合同、协议或其他文件，并已取得了所有必需的第三方的书面同意。&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;4.3&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;不进行任何破坏或试图破坏网络安全的行为（包括但不限于钓鱼，黑客，网络诈骗，网站或空间中含有或涉嫌散播：病毒、木马、恶意代码，及通过虚拟主机对其他网站、主机进行涉嫌攻击行为如扫描、嗅探、&lt;span lang=&quot;EN-US&quot;&gt;ARP&lt;/span&gt;欺骗、&lt;span lang=&quot;EN-US&quot;&gt;DOS&lt;/span&gt;等）；&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 18pt;&quot;&gt;\r\n	&lt;b&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;第五条 费用&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/b&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;5.1&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;乙方接收甲方委托持有及处分比特币的，甲方应向乙方支付相应服务费，具体的收费标准，以&amp;ldquo;聚算宝&amp;rdquo;网站实际发布的收费标准为准。&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;5.2&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;各方自行向其主管税务机关申报、缴纳各方应承担的税费，其他方不负责相关事宜处理。&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 18pt;&quot;&gt;\r\n	&lt;b&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;第六条 违约债务&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/b&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;6.1&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;本协议对各方均有约束力，如任何一方未充分履行其根据本协议所负义务或者任何一方根据本协议所作的陈述、承诺或保证是不真实的或者有重大遗漏或误导的，该方应被视为违约；&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;6.2&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;若任何一方在本协议履行过程中因其违约行为而使其他方遭受任何损失，违约方应向受损方进行合理及全面的补偿（包括对其直接、间接损失和可期得利益的补偿）。&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;6.3&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;本协议规定的权利和救济是累积的，并不排斥法律规定的其他权利或者救济。本协议所规定各方的义务是特殊、特定、且非一般性的，因此在&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;任何一方违约时，损害赔偿如不足以弥补损失，非违约方有权要求违约方实际履行。&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;6.4&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;本协议守约方对违约方违约行为的弃权需通过电子数据或书面的方式做出，且该守约方的弃权行为仅对其自身有效，其他守约方仍有权要求违约方承担违约责任。守约方未行使或者迟延行使其在本协议项下的任何权利或者救济不构成该方的弃权；部分行使权利或者救济亦不应阻碍其行使其他权利或者救济。&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;6.5&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;尽管有本协议其它规定，本条规定的效力不受本协议中止、解除或终止的影响。&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 18pt;&quot;&gt;\r\n	&lt;b&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;第七条 通知及送达&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/b&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;7.1&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;本协议要求的或根据本协议作出的任何通知、请求、要求和其他通信往来应以电子数据方式进行送达。&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;7.2&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;上述通知或其它通讯往来如以电子邮件形式发送，则一经发出即视为送达；如在&amp;ldquo;聚算宝&amp;rdquo;网站进行公告，则公告期满&lt;span lang=&quot;EN-US&quot;&gt;3&lt;/span&gt;天即视为送达。&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;7.3&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;甲方依据&amp;ldquo;聚算宝&amp;rdquo;网站规则和本协议约定将本协议项下的算力转让与第三人的，由甲方委托&amp;ldquo;聚算宝&amp;rdquo;网站通过网站公告、邮件或短信的方式向算力的出让方发送算力转让通知书。&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 18pt;&quot;&gt;\r\n	&lt;b&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;第八条 关于法律适用及管辖&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/b&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;8.1&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;适用法律。本协议的全部事项，包括但不限于本协议的效力、解释、履行以及争议的解决均受中国法律管辖；本协议项下任一条款如与中国法律中的强制性规范相抵触，应在该等强制性规范所不禁止的最大限度内进行解释和执行，且任何该等与强制性规范相抵触的约定不应影响本协议其他条款的效力。&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;8.2&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;争议管辖。各方一致同意，如发生争议，不论争议金额大小，均提交深圳市仲裁委员会适用深圳市仲裁委员会仲裁规则项下的简易程序进行仲裁。&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;8.3&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;在仲裁期间，本协议中不涉及争议的条款仍须履行，各方均不得以解决争议为由拒不履行其在本协议项下的任何义务。&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 18pt;&quot;&gt;\r\n	&lt;b&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;第九条 其他&lt;/span&gt;&lt;/b&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 18pt;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;9.1&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;本协议项下的附件属于本协议不可分割的组成部分。本协议任何条款的标题仅系为方便援引和阅读而设置，不得被用于解释本协议任何条款的依据。&lt;/span&gt;&lt;b&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/b&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;9.2&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;本协议经甲方和乙方在&amp;ldquo;聚算宝&amp;rdquo;网络平台以线上点击确认的方式，其他方统一在&amp;ldquo;聚算宝&amp;rdquo;后台确认的方式订立。本协议各方委托乙方保管所有与本协议有关的书面文件或电子信息。&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;9.3&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;任何一方在&amp;ldquo;聚算宝&amp;rdquo;网站对本协议进行操作成功确认时，即视为该方接受本协议条款内容并受此内容之拘束；各方均对本协议进行操作成功确认时，本协议即成立。&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;9.4&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;通过&amp;ldquo;聚算宝&amp;rdquo;网站提供的服务，甲方向乙方成功支付算力购买款时，本协议生效。各方确认并同意，乙方（&amp;ldquo;聚算宝&amp;rdquo;）提供的与本协议有关的书面文件或电子信息作为本协议的组成部分。&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 14pt;&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 14pt;&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 14pt;&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	&lt;span style=&quot;font-family: 宋体; font-size: 14pt;&quot;&gt;甲方：（签字盖章）&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 14pt;&quot;&gt;&amp;nbsp;&amp;nbsp; &amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-family: 宋体; font-size: 14pt;&quot;&gt;乙方：（签字盖章）&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 14pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 14pt;&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot;&gt;\r\n	&lt;span style=&quot;font-family: 宋体; font-size: 14pt;&quot;&gt;时间：&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 14pt;&quot;&gt;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp; &amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;font-family: 宋体; font-size: 14pt;&quot;&gt;时间：&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-size: 14pt;&quot;&gt;&amp;nbsp; &lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/p&gt;\r\n&lt;div&gt;\r\n	&amp;nbsp;&lt;/div&gt;', '0');
