t;#000000&quot;&gt;&lt;font face=&quot;Calibri&quot;&gt;&lt;b&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;本协议项下甲乙双方单独称&amp;ldquo;一方&amp;rdquo;，合称&amp;ldquo;各方&amp;rdquo;。&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/b&gt;&lt;/font&gt;&lt;/font&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 18pt;&quot;&gt;\r\n	&lt;font color=&quot;#000000&quot;&gt;&lt;font face=&quot;Calibri&quot;&gt;&lt;b&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;第一条 释义&lt;/span&gt;&lt;/b&gt;&lt;b&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/b&gt;&lt;/font&gt;&lt;/font&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;font color=&quot;#000000&quot;&gt;&lt;font face=&quot;Calibri&quot;&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;除非上下文另有解释，下列用于具有以下含义&lt;span lang=&quot;EN-US&quot;&gt;:&lt;/span&gt;&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/font&gt;&lt;/font&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;font color=&quot;#000000&quot;&gt;&lt;font face=&quot;Calibri&quot;&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;1.1&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;ldquo;比特币&amp;rdquo;最初的概念在&lt;span lang=&quot;EN-US&quot;&gt;2009&lt;/span&gt;年提出，比特币的生成是建立在计算机开源软件以及建构其上的&lt;span lang=&quot;EN-US&quot;&gt;P2P&lt;/span&gt;网络基础上。&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/font&gt;&lt;/font&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;font color=&quot;#000000&quot;&gt;&lt;font face=&quot;Calibri&quot;&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;1.1.1&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;比特币的具体生成流程：&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/font&gt;&lt;/font&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;font color=&quot;#000000&quot;&gt;&lt;font face=&quot;Calibri&quot;&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;（&lt;span lang=&quot;EN-US&quot;&gt;1&lt;/span&gt;）下载专用的比特币运算工具，即为一种特定的计算机程序；&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/font&gt;&lt;/font&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;font color=&quot;#000000&quot;&gt;&lt;font face=&quot;Calibri&quot;&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;（&lt;span lang=&quot;EN-US&quot;&gt;2&lt;/span&gt;）然后注册相应的合作网站；&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/font&gt;&lt;/font&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;font color=&quot;#000000&quot;&gt;&lt;font face=&quot;Calibri&quot;&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;（&lt;span lang=&quot;EN-US&quot;&gt;3&lt;/span&gt;）把注册来的用户名和密码填入计算程序中，再点击运算就正式开始；&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/font&gt;&lt;/font&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;font color=&quot;#000000&quot;&gt;&lt;font face=&quot;Calibri&quot;&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;（&lt;span lang=&quot;EN-US&quot;&gt;4&lt;/span&gt;）计算机依照算法进行大量的运算，从而生成特解，所生成的特解均为&lt;span lang=&quot;EN-US&quot;&gt;64&lt;/span&gt;位的数字，为比特币的&lt;span lang=&quot;EN-US&quot;&gt;P2P&lt;/span&gt;网络所需要；&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/font&gt;&lt;/font&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;font color=&quot;#000000&quot;&gt;&lt;font face=&quot;Calibri&quot;&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;（&lt;span lang=&quot;EN-US&quot;&gt;5&lt;/span&gt;）作为奖励，用户的电脑在成功的生成比特币网络所需要的特解时，即可获得相应数量的比特币。&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/font&gt;&lt;/font&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;font color=&quot;#000000&quot;&gt;&lt;font face=&quot;Calibri&quot;&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;1.1.2 &lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;比特币具有以下特征&lt;span lang=&quot;EN-US&quot;&gt;:&lt;/span&gt;&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/font&gt;&lt;/font&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;font color=&quot;#000000&quot;&gt;&lt;font face=&quot;Calibri&quot;&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;（&lt;span lang=&quot;EN-US&quot;&gt;1&lt;/span&gt;）本质上是由计算机生成的一串串复杂代码组成&lt;span lang=&quot;EN-US&quot;&gt;,&lt;/span&gt;属于计算信息系统数据；&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/font&gt;&lt;/font&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;font color=&quot;#000000&quot;&gt;&lt;font face=&quot;Calibri&quot;&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;（&lt;span lang=&quot;EN-US&quot;&gt;2&lt;/span&gt;）比特币不是由货币当局发行，不具有法偿性与强制性等货币属性；&lt;/span&gt;&lt;/font&gt;&lt;/font&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;font color=&quot;#000000&quot;&gt;&lt;font face=&quot;Calibri&quot;&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;（&lt;span lang=&quot;EN-US&quot;&gt;3&lt;/span&gt;）比特币是一种特定的虚拟商品，不具有与货币等同的法律地位，不能且不应作为货币在市场上流通使用；&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/font&gt;&lt;/font&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;font color=&quot;#000000&quot;&gt;&lt;font face=&quot;Calibri&quot;&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;（&lt;span lang=&quot;EN-US&quot;&gt;4&lt;/span&gt;）作为一种虚拟商品， 比特币可以通过计算机信息系统交易，其价格会由于供需等各种原因产生波动；&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/font&gt;&lt;/font&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;font color=&quot;#000000&quot;&gt;&lt;font face=&quot;Calibri&quot;&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;（&lt;span lang=&quot;EN-US&quot;&gt;5&lt;/span&gt;）比特币可以通过交易变现成货币，但是作为一种虚拟商品，比特币无实物的性质。&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/font&gt;&lt;/font&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;font color=&quot;#000000&quot;&gt;&lt;font face=&quot;Calibri&quot;&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;1.2 &lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;ldquo;算力&amp;rdquo;是指计算机的运算能力。&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/font&gt;&lt;/font&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;font color=&quot;#000000&quot;&gt;&lt;font face=&quot;Calibri&quot;&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;1.3 &lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;ldquo;挖矿&amp;rdquo;本协议中将通过网络下载专用的比特币运算工具，并利用计算机的运算能力进行大量的运算，从而生成&lt;span lang=&quot;EN-US&quot;&gt;P2P&lt;/span&gt;网络所需要的特解，每生成一个特解，即可获得相应数量的比特币作为奖励的过程称为挖矿。&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/font&gt;&lt;/font&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;font color=&quot;#000000&quot;&gt;&lt;font face=&quot;Calibri&quot;&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;1.4&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;ldquo;矿机&amp;rdquo;可以为&amp;ldquo;挖矿&amp;rdquo;提供所需要的运算能力的计算机。&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/font&gt;&lt;/font&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;font color=&quot;#000000&quot;&gt;&lt;font face=&quot;Calibri&quot;&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;1.5&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;ldquo;矿场&amp;rdquo;是指为了更为有效的通过挖矿获得比特币，选择特定的地点（包括但不限于厂房、住宅或办公楼等）集中安放运行数量众多的矿机。本协议中，将集中在某一特定地点安放运行的数量众多的矿机称为&amp;ldquo;矿场&amp;rdquo;。&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/font&gt;&lt;/font&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;font color=&quot;#000000&quot;&gt;&lt;font face=&quot;Calibri&quot;&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;1.6&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;ldquo;矿池&amp;rdquo;&lt;span lang=&quot;EN-US&quot;&gt;:&lt;/span&gt;处于&lt;span lang=&quot;EN-US&quot;&gt;P2P&lt;/span&gt;网络中的每一台矿机可以独立挖矿，也可以选择和其他的矿机联合一起挖矿。我们将联合众多矿机或矿场共同挖矿，并将挖矿所得的比特币按照特定的分配方式分配给参与挖矿的矿机或矿场的网络平台称为矿池。&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/font&gt;&lt;/font&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;font color=&quot;#000000&quot;&gt;&lt;font face=&quot;Calibri&quot;&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;1.7 &lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;ldquo;算力残值&amp;rdquo;是指矿机通过挖矿难以获得收益之后矿机硬件的价值。&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/font&gt;&lt;/font&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;font color=&quot;#000000&quot;&gt;&lt;font face=&quot;Calibri&quot;&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&amp;nbsp;1.8&lt;/span&gt;&lt;span style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;ldquo;比特币钱包&amp;rdquo;：用于接收和存放比特币的网络地址，是大约&lt;span lang=&quot;EN-US&quot;&gt;33&lt;/span&gt;位长的、由字母和数字构成的一串字符，总是由&lt;span lang=&quot;EN-US&quot;&gt;1&lt;/span&gt;或者&lt;span lang=&quot;EN-US&quot;&gt;3&lt;/span&gt;开头。&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&lt;o:p&gt;&lt;/o:p&gt;&lt;/span&gt;&lt;/font&gt;&lt;/font&gt;&lt;/p&gt;\r\n&lt;p class=&quot;MsoNormal&quot; style=&quot;line-height: 24pt;&quot;&gt;\r\n	&lt;font color=&quot;#000000&quot;&gt;&lt;font face=&quot;Calibri&quot;&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;color: black; font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;&lt;/span&gt;&lt;span lang=&quot;EN-US&quot; style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;nbsp;1.9 &lt;/span&gt;&lt;span style=&quot;font-family: 宋体; font-size: 12pt;&quot;&gt;&amp;ldquo;聚算宝&amp;rdquo;：指由乙方深圳锦晖区块链科技有限司运营管理的互联网电子商务信息居间撮合服务平台，&amp;ldquo;聚算宝&amp;rdquo;的网络域名为【&lt;span lang=&quot;EN-US&quot;&gt